(60, 149, 'Early career', 'Mies worked in his father''s stone-carving shop and at several local design firms before he moved to Berlin, where he joined the office of interior designer Bruno Paul. He began his architectural career as an apprentice at the studio of Peter Behrens from 1908 to 1912, where he was exposed to the current design theories and to progressive German culture, working alongside Walter Gropius and Le Corbusier. Mies served as construction manager of the Embassy of the German Empire in Saint Petersburg under Behrens', 0),
(61, 149, '', 'His talent was quickly recognized and he soon began independent commissions, despite his lack of a formal college-level education. A physically imposing, deliberative, and reticent man, Ludwig Mies renamed himself as part of his rapid transformation from a tradesman''s son to an architect working with Berlin''s cultural elite, adding "van der" and his mother''s surname "Rohe",[3] using the Dutch, rather than the German form, presumably to avoid offending those of genuine aristocratic lineage.', 1),
(62, 149, '', 'He began his independent professional career designing upper class homes, joining the movement seeking a return to the purity of early nineteenth century Germanic domestic styles. He admired the broad proportions, regularity of rhythmic elements, attention to the relationship of the man-made to nature, and compositions using simple cubic forms of the early nineteenth century Prussian Neo-Classical architect Karl Friedrich Schinkel. He dismissed the eclectic and cluttered classical styles so common at the turn of the twentieth century as irrelevant to the modern times.', 2),
