(79, 187, 'Walmart all over the world', 'Walmart Stores U.S. is the company''s largest division, accounting for $258 billion, or 63.8% of total sales for financial year 2010.[42] It consists of three retail formats that have become commonplace in the United States: Discount Stores, Supercenters, and Walmart Markets. The retail department stores sell a variety of mostly non-grocery products, though emphasis has now shifted towards supercenters, which include more grocery items. This division also includes Walmart''s online retailer, walmart.com.', 0),
(80, 187, '', 'Walmart discount stores are discount department stores with size varying from 51,000 square feet (4,738.1 m2) to 224,000 square feet (20,810.3 m2), with an average store covering about 102,000 square feet (9,476.1 m2).[42] They carry general merchandise and a selection of groceries. Many of these stores also have a garden center, a pharmacy, Tire & Lube Express, optical center, one-hour photo processing lab, portrait studio, a bank branch, a cell phone store and a fast food outlet. Some also have gasoline stations.[47]', 1),
(81, 187, '', 'Walmart Market is a chain of grocery stores that average about 42,000 square feet (3,901.9 m2).[42] They are used to fill the gap between discount store and supercenters, offering a variety of products, which include full lines of groceries, pharmaceuticals, health and beauty aids, photo developing services, and a limited selection of general merchandise.', 2),
(82, 187, '', 'Marketside is a chain of four grocery stores, all in the state of Arizona. The stores opened in October 2008 and are said to be less than half the size of a conventional supermarket.[49] The Marketside branding is also used for some groceries found in Walmart', 3),
(83, 187, '', 'Sam''s Club is a chain of warehouse clubs which sell groceries and general merchandise, often in large quantities. Sam''s Club stores are "membership" stores and most customers buy annual memberships. However, non-members can make purchases either by buying a one-day membership or paying a surcharge based on the price of the purchase.[63] Some locations also sell gasoline.[47] The first Sam''s Club opened in 1983 in Midwest City, Oklahoma[63] under the name "Sam''s Wholesale Club".', 4),
(84, 187, '', 'In February 2010, the company agreed to buy Vudu, a Silicon Valley start-up whose three-year-old online movie service is being built into an increasing number of televisions and Blu-ray players. Terms of the acquisition were not disclosed, but a person briefed on the deal said the price for the company, which raised $60 million in capital, was over $100 million.[88] It is the third most popular online movie service, with a market share of 5.3 percent.[89]', 5),
(85, 187, '', 'In 2010, the company teamed with Procter & Gamble to produce Secrets of the Mountain and The Jensen Project, two-hour family movies which featured the characters using Walmart and Procter & Gamble branded products. The Jensen Project also featured a preview of a product to be released in several months in Walmart stores.[92][93] A third movie, A Walk in My Shoes, will air later in 2010 and a fourth is in production.[94] Walmart''s director of brand marketing also serves as co-chair of the Association of National Advertisers''s Alliance for Family Entertainment.[95]', 6),
(86, 187, '', 'For the fiscal year ending January 31, 2011, Wal-Mart reported a net income of $15.4 billion on $422 billion of revenue with a 24.7% gross profit margin). The corporation''s international operations accounted for $109.2 billion, or 26.1%, of total sales.[1] It is the world''s 18th largest public corporation, according to the Forbes Global 2000 list, and the largest public corporation when ranked by revenue.[101]', 7),
(87, 187, '', 'Notable former members of the board include Hillary Clinton (1985â€“1992)[103] and Tom Coughlin (2003â€“2004), the latter having served as Vice Chairman. Clinton left the board before the 1992 U.S. Presidential Election, and Coughlin left in December 2005 after pleading guilty to wire fraud and tax evasion for stealing hundreds of thousands of dollars from Wal-Mart.[', 8),
(88, 187, '', 'Each week, about 100 million customers, nearly one-third of the U.S. population, visit Walmart''s U.S. stores.[112] Walmart customers give low prices as the most important reason for shopping there, reflecting the "Low prices, always" advertising slogan that Wal-Mart used from 1962 until 2006.[', 9),
