(162, 344, 'Outside the Solar System', 'The circulation of the atmosphere occurs due to thermal differences when convection becomes a more efficient transporter of heat than thermal radiation. On planets where the primary heat source is solar radiation, excess heat in the tropics is transported to higher latitudes. When a planet generates a significant amount of heat internally, such as is the case for Jupiter, convection in the atmosphere can transport thermal energy from the higher temperature interior up to the surface.', 0),
(163, 344, '', 'From the perspective of the planetary geologist, the atmosphere is an evolutionary agent essential to the morphology of a planet. The wind transports dust and other particles which erodes the relief and leaves deposits (eolian processes). Frost and precipitations, which depend on the composition, also influence the relief. Climate changes can influence a planet''s geological history. Conversely, studying surface of earth leads to an understanding of the atmosphere and climate of a planet â€” both its present state and its past.', 1),
(164, 344, '', 'Surface gravity, the force that holds down an atmosphere, differs significantly among the planets. For example, the large gravitational force of the giant planet Jupiter is able to retain light gases such as hydrogen and helium that escape from lower gravity objects. Second, the distance from the sun determines the energy available to heat atmospheric gas to the point where its molecules'' thermal motion exceed the planet''s escape velocity, the speed at which gas molecules overcome a planet''s gravitational grasp. Thus, the distant and cold Titan, Triton, and Pluto are able to retain their atmospheres despite relatively low gravities. Interstellar planets, theoretically, may also retain thick atmospheres.', 2),
(165, 344, '', 'Since a gas at any particular temperature will have molecules moving at a wide range of velocities, there will almost always be some slow leakage of gas into space. Lighter molecules move faster than heavier ones with the same thermal kinetic energy, and so gases of low molecular weight are lost more rapidly than those of high molecular weight. It is thought that Venus and Mars may have both lost much of their water when, after being photo dissociated into hydrogen and oxygen by solar ultraviolet, the hydrogen escaped. Earth''s magnetic field helps to prevent this, as, normally, the solar wind would greatly enhance the escape of hydrogen. However, over the past 3 billion years the Earth may have lost gases through the magnetic polar regions due to auroral activity, including a net 2% of its atmospheric oxygen.[4] Other mechanisms that can cause atmosphere depletion are solar wind-induced sputtering, impact erosion, weathering, and sequestration â€” sometimes referred to as "freezing out" â€” into the regolith and polar caps.', 3),
(166, 344, '', 'The atmospheric composition of an extra-solar planet was first determined using the Hubble Space Telescope. Planet HD 209458b is a gas giant with a close orbit around a star in the constellation Pegasus. The atmosphere is heated to temperatures over 1,000 K, and is steadily escaping into space. Hydrogen, oxygen, carbon and sulfur have been detected in the planet''s inflated atmosphere.', 4),
(168, 361, 'History', 'Science in its original sense is a word for a type of knowledge (Latin scientia, Ancient Greek epistem?), rather than a specialized word for the pursuit of such knowledge. In particular it is one of the types of knowledge which people can communicate to each other and share. For example, knowledge about the working of natural things was gathered long before recorded history and led to the development of complex abstract thinking, as shown by the construction of complex calendars, techniques for making poisonous plants edible, and buildings such as the pyramids. However no consistent distinction was made between knowledge of such things which are true in every community, and other types of communal knowledge such as mythologies and legal systems.', 0),
(169, 361, '', 'A major turning point in the history of early philosophical science was the controversial but successful attempt by Socrates to apply philosophy to the study of human things, including human nature, the nature of political communities, and human knowledge itself. He criticized the older type of study of physics as too purely speculative, and lacking in self-criticism. He was particularly concerned that some of the early physicists treated nature as if it could be assumed that it had no intelligent order, explaining things merely in terms of motion and matter.   The study of human things had been the realm of mythology and tradition, and Socrates was executed. Aristotle later created a less controversial systematic programme of Socratic philosophy, which was teleological, and human-centred. He rejected many of the conclusions of earlier scientists. For example in his physics the sun goes around the earth, and many things have it as part of their nature that they are for humans. Each thing has a formal cause and final cause and a role in the rational cosmic order. Motion and change is described as the actualization of potentials already in things, according to what types of things they are. While the Socratics insisted that philosophy should be used to consider the practical question of the best way to live for a human being, they did not argue for any other types of applied science.   Aristotle maintained the sharp distinction between science and the practical knowledge of artisans, treating theoretical speculation as the highest type of human activity, practical thinking about good living as something less lofty, and the knowledge of artisans as something only suitable for the lower classes. In contrast to modern science, Aristotle''s influential emphasis was upon the ', 1),
(170, 361, '', 'During late antiquity and the early Middle Ages, the Aristotelian approach to inquiries on natural phenomenon was used. Some ancient knowledge was lost, or in some cases kept in obscurity, during the fall of the Roman Empire and periodic political struggles. However, the general fields of science, or Natural Philosophy as it was called, and much of the general knowledge from the ancient world remained preserved though the works of the early encyclopedists like Isidore of Seville. During the early medieval period, Syrian Christians from Eastern Europe such as Nestorians and Monophysites were the ones that translated much of the important Greek science texts from Greek to Syriac and the later on they translated many of the works into Arabic and other languages under Islamic rule.[10] This was a major line of transmission for the development of Islamic science which provided much of the activity during the early medieval period. In the later medieval period, Europeans recovered some ancient knowledge by translations of texts and they built their work upon the knowledge of Aristotle, Ptolemy, Euclid, and others works. In Europe, men like Roger Bacon learned Arabic and Hebrew and argued for more experimental science. By the late Middle Ages, a synthesis of Catholicism and Aristotelianism known as Scholasticism was flourishing in Western Europe, which had become a new geographic center of science.', 2),
(171, 361, '', 'By the late Middle Ages, especially in Italy there was an influx of texts and scholars from the collapsing Byzantine empire. Copernicus formulated a heliocentric model of the solar system unlike the geocentric model of Ptolemy''s Almagest. All aspects of scholasticism were criticized in the 15th and 16th centuries; one author who was notoriously persecuted was Galileo, who made innovative use of experiment and mathematics. However the persecution began after Pope Urban VIII blessed Galileo to write about the Copernican system. Galileo had used arguments from the Pope and put them in the voice of the simpleton in the work ', 3),
(172, 361, '', 'In the 17th and 18th centuries, the project of modernity, as had been promoted by Bacon and Descartes, led to rapid scientific advance and the successful development of a new type of natural science, mathematical, methodically experimental, and deliberately innovative. Newton and Leibniz succeeded in developing a new physics, now referred to as Newtonian physics, which could be confirmed by experiment and explained in mathematics. Leibniz also incorporated terms from Aristotelian physics, but now being used in a new non-teleological way, for example ', 4),
(173, 361, '', 'Both John Herschel and William Whewell systematised methodology: the latter coined the term scientist. When Charles Darwin published On the Origin of Species he established descent with modification as the prevailing evolutionary explanation of biological complexity. His theory of natural selection provided a natural explanation of how species originated, but this only gained wide acceptance a century later. John Dalton developed the idea of atoms. The laws of Thermodynamics and the electromagnetic theory were also established in the 19th century, which raised new questions which could not easily be answered using Newton''s framework.', 5),
(174, 361, '', 'Einstein''s Theory of Relativity and the development of quantum mechanics led to the replacement of Newtonian physics with a new physics which contains two parts, that describe different types of events in nature. The extensive use of scientific innovation during the wars of this century, led to the space race and widespread public appreciation of the importance of modern science.', 6),
(175, 361, '', 'Before the invention or discovery of the concept of "nature" (Ancient Greek phusis), by the Pre-Socratic philosophers, the same words tend to be used to describe the natural "way" in which a plant grows,[6] and the "way" in which, for example, one tribe worships a particular god. For this reason it is claimed these men were the first philosophers in the strict sense, and also the first people to clearly distinguish "nature" and "convention".[7] Science was therefore distinguished as the knowledge of nature, and the things which are true for every community, and the name of the specialized pursuit of such knowledge was philosophy â€” the realm of the first philosopher-physicists. They were mainly speculators or theorists, particularly interested in astronomy. In contrast, trying to use knowledge of nature to imitate nature (artifice or technology, Greek techn?) was seen by classical scientists as a more appropriate interest for lower class artisans.', 7),
(176, 361, '', 'Although some scientific research is applied research into specific problems, a great deal of our understanding comes from the curiosity-driven undertaking of basic research. This leads to options for technological advance that were not planned or sometimes even imaginable. This point was made by Michael Faraday when, allegedly in response to the question "what is the use of basic research?" he responded "Sir, what is the use of a new-born child?".[28] For example, research into the effects of red light on the human eye''s rod cells did not seem to have any practical purpose; eventually, the discovery that our night vision is not troubled by red light would lead search and rescue teams (among others) to adopt red light in the cockpits of jets and helicopters.[29] In a nutshell: Basic research is the search for knowledge. Applied research is the search for solutions to practical problems using this knowledge. Finally, even basic research can take unexpected turns, and there is some sense in which the scientific method is built to harness luck.', 8),
(177, 361, '', 'Based on observations of a phenomenon, scientists may generate a model. This is an attempt to describe or depict the phenomenon in terms of a logical, physical or mathematical representation. As empirical evidence is gathered, scientists can suggest a hypothesis to explain the phenomenon.[30] Hypotheses may be formulated using principles such as parsimony (also known as "Occam''s Razor") and are generally expected to seek consilienceâ€”fitting well with other accepted facts related to the phenomena.[31] This new explanation is used to make falsifiable predictions that are testable by experiment or observation. When a hypothesis proves unsatisfactory, it is either modified or discarded.[32] Experimentation is especially important in science to help establish causational relationships (to avoid the correlation fallacy). Operationalization also plays an important role in coordinating research in/across different fields.', 9),
(178, 361, '', 'Once a hypothesis has survived testing, it may become adopted into the framework of a scientific theory. This is a logically reasoned, self-consistent model or framework for describing the behavior of certain natural phenomena. A theory typically describes the behavior of much broader sets of phenomena than a hypothesis; commonly, a large number of hypotheses can be logically bound together by a single theory. Thus a theory is a hypothesis explaining various other hypotheses. In that vein, theories are formulated according to most of the same scientific principles as hypotheses.', 10),
