(225, 504, 'Cricket - Tennis uses Hawk-Eye', 'The technology was first used by Channel 4 during a Test match between England and Pakistan on Lord''s Cricket Ground, on 21 May 2001. It is used primarily by the majority of television networks to track the trajectory of balls in flight. In the winter season of 2008/2009 the ICC trialled a referral system where Hawk-Eye was used for referring decisions to the third umpire if a team disagreed with an LBW decision. The third umpire was able to look at what the ball actually did up to the point when it hit the batsman, but could not look at the predicted flight of the ball after it hit the batsman.[5]', 0),
(226, 504, '', 'Its major use in cricket broadcasting is in analysing leg before wicket decisions, where the likely path of the ball can be projected forward, through the batsman''s legs, to see if it would have hit the stumps. Consultation of the third umpire, for conventional slow motion or Hawk-Eye, on leg before wicket decisions, is currently sanctioned in international cricket even though doubts remain about its accuracy in cricket.[6', 1),
(227, 504, '', 'Due to its realtime coverage of bowling speed, the systems are also used to show delivery patterns of bowler''s behaviour such as line and length, or swing/turn information. At the end of an over, all six deliveries are often shown simultaneously to show a bowler''s variations, such as slower deliveries, bouncers and leg-cutters. A complete record of a bowler can also be shown over the course of a match.   Batsmen also benefit from the analysis of Hawk-Eye, as a record can be brought up of the deliveries batsmen scored from. These are often shown as a 2-D silhouetted figure of a batsmen and colour-coded dots of the balls faced by the batsman. Information such as the exact spot where the ball pitches or speed of the ball from the bowler''s hand (to gauge batsman reaction time) can also help in post-match analysis. ', 2),
(228, 504, '', 'In Serena Williams''s quarterfinal loss to Jennifer Capriati at the 2004 US Open, many crucial calls were contested by Williams, and TV replays demonstrated that some were indeed erroneous. Though the calls themselves were not reversed, the chair umpire Mariana Alves was removed from consideration for further matches at that year''s U.S. Open. These errors prompted talks about line calling assistance especially as the Auto-Ref system was being tested by the U.S. Open at that time and was shown to be very accurate', 3),
(229, 504, '', 'In late 2005 Hawk-Eye was tested by the International Tennis Federation (ITF) in New York City and was passed for professional use. Hawk-Eye reported that the New York tests involved 80 shots being measured by the ITF''s high speed camera, a device similar to MacCAM. During an early test of the system during an exhibition tennis tournament in Australia (seen on local TV), there was an instance when the tennis ball was shown as "Out", but the accompanying word was "In".[citation needed] This was explained to be an error in the way the tennis ball was shown on the graphical display as a circle, rather than as an ellipse.[citation needed] This was immediately corrected.', 4),
(230, 504, '', 'Hawk-Eye has been used in television coverage of several major tennis tournaments, including Wimbledon, the Stella Artois at Queens, the Australian Open, the Davis Cup and the Tennis Masters Cup. The US Open Tennis Championship announced they would make official use of the technology for the 2006 US Open where each player receives two challenges per set.[8] It is also used as part of a larger tennis simulation implemented by IBM called PointTracker.', 5),
