(11, 596, 'My review of the Apple TV after owning and using one for the last 2 months. Pro''s Con''s and everything in between.', 'I have been using the Apple TV MD199LL/A for about 2 months now and I have to say my initial reaction was that this device is outstanding for a mere $99.  My reaction is still the same after 2 months of using it.  They packed so much punch into this device for that price point that got me wondering why I''ve waited so long to get one of these babies. \n\nFirst, like all Apple devices this one is super easy to use.  You just have to plug in the power and the HDMI cable to your TV.  You can also use an Ethernet cable for internet if it''s accessible, but here''s the great part; it''s wireless so you don''t have to go crazy running wires through walls they don''t belong.  I use mine through wireless and have never had a problem.\n\nAfter you''ve successfully hooked it up to your TV, just go through the settings menu and connect it to your iTunes.  This literally is as easy as entering your iTunes username and password.  \n\nNow that you''re in you can watch all the movies, shows, music, or anything else you have stored on your iTunes straight to you TV (in 1080p as long as your TV and the content supports it). \n\nIt''s really easy to use and one of the best 100 buks I''ve ever spent. \n\nOne of the coolest features of all or at least my favorite:  AirPlay.\n\nIf your an iPhone or Ipad lover like myself you''re going to love AirPlay through Apple TV.  Airplay basically lets you play anything from your iPhone or iPad straight to your TV.  So say you want to watch that funny video on youtube with your friends, but how annoying is it when 5 of you are trying to watch that video on a tiny iPhone screen?  Not when you have airplay.  Just airplay it straight to the TV.  No wires or install necessary.\n\nYou have a photo gallery that you want to show the family on the iPhone or iPad, just airplay it right on the to TV.  It''s so effortless and cool and the quality is super sharp.   \n\nThe only disappointing factor was that it doesn''t have Amazon On Demand which is normal since they are competing platforms but so is Netflix in essence but that''s available.  oh well, that I''ll have to live with considering all the other awesome features it comes with.   ', 0, 0),
