(15, 690, 'My Review of the Keurig B40 Elite Brewing System Coffee Machine', 'I''ve been using the Keurig B40 Coffee machine for about 3 months now and I really like it.  I wasn’t too big on the whole single serve instant coffee thing but I’m really all about it now.  Before this machine I had a Cuisinart coffee maker that would grind whole beans right before the brew.  The only problem is that I would have to make a minimum of 3-4 cups of coffee at a time and cleaning that machine was very annoying.  Having said that I will say the Cuisinart made better tasting coffee but you just can’t beat the convenience of the Keurig B40 coffee machine.  It makes great tasting coffee, there are plenty of flavor options out there, and ease of use is unbeatable.  There is nothing to clean and nothing to wash.  It takes about a couple of minutes in the morning (or when you just turn it on) for the water to start warming up.  Every brew after that is pretty instant and takes around 20 seconds to brew.  You can’t beat that type of convenience.  \nI did my research and read other reviews online before purchasing this unit and read a few reviews of people saying this machine was loud.  I must say that I did not experience this at all.  It’s a fairly quiet coffee machine for my standards and really gets the jobs done.       \nThe only negative thing I will say about this unit is that I wish the water tray was little larger.  You have to refill the water about every 5 cups of coffee.  Although it’s not the end of the world to keep filling up the tray with water, I just would’ve liked it to last a little longer.  Of course there are Keurig Brewing Systems with a larger water tray that will last longer.  \n\nAll in all I would definitely recommend this machine for anyone who is in the market for an in home coffee machine.      \n', 0, 0),
