(28, 124, '0', '<a style="TEXT-ALIGN: left; TEXT-DECORATION: none" target="_blank"><b>Farewell Titles Seniors</b></a><div><a style="TEXT-ALIGN: left; TEXT-DECORATION: none" target="_blank"><b><br></b></a></div><div><a style="TEXT-ALIGN: left; TEXT-DECORATION: none" target="_blank"><b><p>A <b>wiki</b> (<span class="nowrap"><a title="Listen" href="http://upload.wikimedia.org/wikipedia/commons/4/46/En-us-wiki.ogg"><img alt="Listen" src="http://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Speakerlink.svg/11px-Speakerlink.svg.png" width="11" height="11"></a><sup class="noexcerpt"><span style="font: bold 80%/normal sans-serif; padding: 0px 0.1em; color: rgb(0, 0, 238); font-size-adjust: none; font-stretch: normal;" class="IPA"><a title="File:En-us-wiki.ogg" href="http://en.wikipedia.org/wiki/File:En-us-wiki.ogg">i</a></span></sup><span class="IPA" title="Representation in the International Phonetic Alphabet (IPA)"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English">/</a></span><span class="IPA"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English#Key"><span style="border-bottom-color: currentColor; border-bottom-width: 1px; border-bottom-style: dotted;" title="primary stress follows">?</span></a></span><span class="IPA"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English#Key"><span style="border-bottom-color: currentColor; border-bottom-width: 1px; border-bottom-style: dotted;" title="''w'' in ''wind''">w</span></a></span><span class="IPA"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English#Key"><span style="border-bottom-color: currentColor; border-bottom-width: 1px; border-bottom-style: dotted;" title="short ''i'' in ''bid''">?</span></a></span><span class="IPA"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English#Key"><span style="border-bottom-color: currentColor; border-bottom-width: 1px; border-bottom-style: dotted;" title="''k'' in ''kind''">k</span></a></span><span class="IPA"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English#Key"><span style="border-bottom-color: currentColor; border-bottom-width: 1px; border-bottom-style: dotted;" title="''y'' in ''happy''">i</span></a></span><span class="IPA" title="Representation in the International Phonetic Alphabet (IPA)"><a title="Wikipedia:IPA for English" href="http://en.wikipedia.org/wiki/Wikipedia:IPA_for_English">/</a></span></span> <span class="IPA" title="English pronunciation respelling"><a title="Wikipedia:Pronunciation respelling key" href="http://en.wikipedia.org/wiki/Wikipedia:Pronunciation_respelling_key"><i><b><span style="font-variant: small-caps;" class="SMALLCAPS"><span style="text-transform: lowercase;" class="NOCAPS">WIK</span></span></b>-ee</i></a></span>) is a <a title="Website" href="http://en.wikipedia.org/wiki/Website">website</a> whose users can add, modify, or delete its content via a <a title="Web browser" href="http://en.wikipedia.org/wiki/Web_browser">web browser</a> using a simplified <a title="Markup language" href="http://en.wikipedia.org/wiki/Markup_language">markup language</a> or a <a title="Online rich-text editor" href="http://en.wikipedia.org/wiki/Online_rich-text_editor">rich-text editor</a>.<sup id="cite_ref-0" class="reference"><a href="http://en.wikipedia.org/wiki/Wiki#cite_note-0"><span>[</span>1<span>]</span></a></sup><sup id="cite_ref-Britannica_1-0" class="reference"><a href="http://en.wikipedia.org/wiki/Wiki#cite_note-Britannica-1"><span>[</span>2<span>]</span></a></sup><sup id="cite_ref-urlEasy_Wiki_Hosting.2C_Scott_Hanselmans_blog.2C_and_Snagging_Screens_2-0" class="reference"><a href="http://en.wikipedia.org/wiki/Wiki#cite_note-urlEasy_Wiki_Hosting.2C_Scott_Hanselmans_blog.2C_and_Snagging_Screens-2"><span>[</span>3<span>]</span></a></sup> Wikis are typically powered by <a title="Wiki software" href="http://en.wikipedia.org/wiki/Wiki_software">wiki software</a> and are often <a title="Collaborative software" href="http://en.wikipedia.org/wiki/Collaborative_software">created collaboratively</a> by multiple users. Examples include community websites, corporate <a title="Intranet" href="http://en.wikipedia.org/wiki/Intranet">intranets</a>, <a title="Knowledge management" href="http://en.wikipedia.org/wiki/Knowledge_management">knowledge management</a> systems, and <a class="mw-redirect" title="Notetaking software" href="http://en.wikipedia.org/wiki/Notetaking_software">notetaking</a>.</p><p>Wikis may serve many different purposes. Some permit control over different functions (levels of access). For example, editing rights may permit changing, adding or removing material. Others may permit access without enforcing access control. Other rules may also be imposed for organizing content.</p></b></a></div>', 0),
