(32, 156, '0', '<p><b>Ludwig Mies van der Rohe</b> (March 27, 1886 â€“ August 17, 1969) was a German <a title="Architect" href="http://en.wikipedia.org/wiki/Architect">architect</a>.<sup id="cite_ref-obit_0-0" class="reference"><a href="http://en.wikipedia.org/wiki/Ludwig_Mies_van_der_Rohe#cite_note-obit-0">[1]</a></sup> He is commonly referred to and addressed as <b>Mies</b>, his surname.</p><p>Ludwig Mies van der Rohe, along with <a title="Walter Gropius" href="http://en.wikipedia.org/wiki/Walter_Gropius">Walter Gropius</a> and <a title="Le Corbusier" href="http://en.wikipedia.org/wiki/Le_Corbusier">Le Corbusier</a>, are widely regarded as the pioneering masters of <a title="Modern architecture" href="http://en.wikipedia.org/wiki/Modern_architecture">modern architecture</a>. Mies, like many of his post-<a title="World War I" href="http://en.wikipedia.org/wiki/World_War_I">World War I</a> contemporaries, sought to establish a new architectural style that could represent modern times just as <a title="Classical architecture" href="http://en.wikipedia.org/wiki/Classical_architecture">Classical</a> and <a title="Gothic architecture" href="http://en.wikipedia.org/wiki/Gothic_architecture">Gothic</a> did for their own eras. He created an influential twentieth century architectural style, stated with extreme clarity and simplicity.</p><p>His mature buildings made use of modern materials such as industrial steel and <a class="mw-redirect" title="Plate glass" href="http://en.wikipedia.org/wiki/Plate_glass">plate glass</a> to define interior spaces. He strived towards an architecture with a minimal framework of structural order balanced against the implied freedom of free-flowing open space. He called his buildings "skin and bones" architecture. He sought a rational approach that would guide the creative process of architectural design. He is often associated with the aphorisms "<a class="mw-redirect" title="Minimalist architecture" href="http://en.wikipedia.org/wiki/Minimalist_architecture">less is more</a>" and "<a title="God is in the detail" href="http://en.wikipedia.org/wiki/God_is_in_the_detail">God is in the details</a>".</p><p><p>Mies worked in his father''s stone-carving shop and at several local design firms before he moved to Berlin, where he joined the office of interior designer <a title="Bruno Paul" href="http://en.wikipedia.org/wiki/Bruno_Paul">Bruno Paul</a>. He began his architectural career as an apprentice at the studio of <a title="Peter Behrens" href="http://en.wikipedia.org/wiki/Peter_Behrens">Peter Behrens</a> from 1908 to 1912, where he was exposed to the current design theories and to progressive German culture, working alongside <a title="Walter Gropius" href="http://en.wikipedia.org/wiki/Walter_Gropius">Walter Gropius</a> and <a title="Le Corbusier" href="http://en.wikipedia.org/wiki/Le_Corbusier">Le Corbusier</a>. Mies served as construction manager of the <a title="Embassy of Germany in Saint Petersburg" href="http://en.wikipedia.org/wiki/Embassy_of_Germany_in_Saint_Petersburg">Embassy of the German Empire</a> in <a title="Saint Petersburg" href="http://en.wikipedia.org/wiki/Saint_Petersburg">Saint Petersburg</a> under Behrens.<sup id="cite_ref-encspb_1-0" class="reference"><a href="http://en.wikipedia.org/wiki/Ludwig_Mies_van_der_Rohe#cite_note-encspb-1">[2]</a></sup></p><p style="text-align: center;">His talent was quickly recognized and he soon began independent commissions, despite his lack of a formal college-level education. A physically imposing, deliberative, and reticent man, Ludwig Mies renamed himself as part of his rapid transformation from a tradesman''s son to an architect working with Berlin''s cultural elite, adding "van der" and his mother''s surname "Rohe",<sup id="cite_ref-2" class="reference"><a href="http://en.wikipedia.org/wiki/Ludwig_Mies_van_der_Rohe#cite_note-2">[3]</a></sup> using the Dutch, rather than the German form, presumably to avoid offending those of genuine aristocratic lineage.<sup id="cite_ref-3" class="reference"><a href="http://en.wikipedia.org/wiki/Ludwig_Mies_van_der_Rohe#cite_note-3">[4]</a></sup></p><p style="text-align: center;">He began his independent professional career designing upper class homes, joining the movement seeking a return to the purity of early nineteenth century Germanic domestic styles. He admired the broad proportions, regularity of rhythmic elements, attention to the relationship of the man-made to nature, and compositions using simple cubic forms of the early nineteenth century Prussian Neo-Classical architect <a title="Karl Friedrich Schinkel" href="http://en.wikipedia.org/wiki/Karl_Friedrich_Schinkel">Karl Friedrich Schinkel</a>. He dismissed the eclectic and cluttered classical styles so common at the turn of the twentieth century as irrelevant to the modern times.</p><p style="text-align: center;"><br></p><p style="text-align: center;"><img src="http://en.wikipedia.org/wiki/File:Stamps_of_Germany_(Berlin)_1986,_MiNr_753.jpg" alt="s" align="none"></p></p>', 0),
