(40, 186, '0', '<p></p><p><i>In October 2005, Walmart announced it would implement several environmental measures to increase <a title="Efficient energy use" href="http://en.wikipedia.org/wiki/Efficient_energy_use">energy efficiency</a>. The primary goals included spending $500 million a year to increase fuel efficiency in Walmart''s truck fleet by 25% over three years and double it within ten, reduce <a title="Greenhouse gas" href="http://en.wikipedia.org/wiki/Greenhouse_gas">greenhouse gas</a> emissions by 20% in seven years, reduce energy use at stores by 30%, and cut solid waste from U.S. stores and Sam''s Clubs by 25% in three years. </i>CEO Lee Scott said that Walmart''s goal was to be a "good steward for the environment" and ultimately use only <a title="Renewable energy" href="http://en.wikipedia.org/wiki/Renewable_energy">renewable energy</a> sources and produce zero waste.<sup id="cite_ref-going_green_27-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-going_green-27"><span>[</span>28<span>]</span></a></sup> The company also designed three new experimental stores in <a title="McKinney, Texas" href="http://en.wikipedia.org/wiki/McKinney,_Texas">McKinney, Texas</a>, <a title="Aurora, Colorado" href="http://en.wikipedia.org/wiki/Aurora,_Colorado">Aurora, Colorado</a>, and <a class="mw-redirect" title="Las Vegas metropolitan area" href="http://en.wikipedia.org/wiki/Las_Vegas_metropolitan_area">Las Vegas, Nevada</a>. with <a title="Wind turbine" href="http://en.wikipedia.org/wiki/Wind_turbine">wind turbines</a>, <a class="mw-redirect" title="Photovoltaic" href="http://en.wikipedia.org/wiki/Photovoltaic">photovoltaic</a> solar panels, <a title="Biofuel" href="http://en.wikipedia.org/wiki/Biofuel">biofuel</a>-capable boilers, water-cooled refrigerators, and <a class="mw-redirect" title="Xeriscape" href="http://en.wikipedia.org/wiki/Xeriscape">xeriscape</a> gardens.<sup id="cite_ref-28" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-28"><span>[</span>29<span>]</span></a></sup> Despite much criticism of its environmental record, Walmart took a few steps in what is viewed as a positive direction, which included becoming the biggest seller of organic milk and the biggest buyer of organic cotton in the world, as well as reducing packaging and energy costs.<sup id="cite_ref-GuntherMark_29-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-GuntherMark-29"><span>[</span>30<span>]</span></a></sup> Wal-Mart also spent nearly a year working with outside consultants to discover the company''s total environmental impact and find where they could improve. They discovered, for example, that by eliminating excess packaging on their toy line Kid Connection, they could not only save $2.4 million a year in shipping costs but also 3,800 trees and a million barrels of oil.<sup id="cite_ref-GuntherMark_29-1" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-GuntherMark-29"><span>[</span>30<span>]</span></a></sup> Walmart has also recently created its own <a class="mw-redirect" title="Electrical power industry" href="http://en.wikipedia.org/wiki/Electrical_power_industry">electric company</a> in Texas, <i>Texas Retail Energy</i>, and plans to supply its stores with cheap power purchased at wholesale prices. Through this new venture, the company expects to save $15 million annually and also lays the groundwork and infrastructure to sell electricity to Texas consumers in the future.<sup id="cite_ref-redorbit_electricity_30-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-redorbit_electricity-30"><span>[</span>31<span>]</span></a></sup></p><p>In March 2006, Walmart sought to appeal to a more affluent demographic. The company launched a new Supercenter concept in <a title="Plano, Texas" href="http://en.wikipedia.org/wiki/Plano,_Texas">Plano, Texas</a>, intended to compete against stores seen as more upscale and appealing, such as <a title="Target Corporation" href="http://en.wikipedia.org/wiki/Target_Corporation">Target</a>.<sup id="cite_ref-31" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-31"><span>[</span>32<span>]</span></a></sup><sup id="cite_ref-32" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-32"><span>[</span>33<span>]</span></a></sup> The new store has wood floors, wider aisles, a <a title="Sushi" href="http://en.wikipedia.org/wiki/Sushi">sushi</a> bar, a coffee/sandwich shop with free <a title="Wi-Fi" href="http://en.wikipedia.org/wiki/Wi-Fi">Wi-Fi</a> <a title="Internet" href="http://en.wikipedia.org/wiki/Internet">Internet</a> access, and more expensive beers, wines, electronics, and other goods. The exterior has a hunter green background behind the Walmart letters, similar to Neighborhood Market by Walmarts, instead of the blue previously used at its supercenters.</p><p>On September 12, 2007, Walmart introduced new <a title="Advertising" href="http://en.wikipedia.org/wiki/Advertising">advertising</a> with the <a title="Slogan" href="http://en.wikipedia.org/wiki/Slogan">slogan</a>, "<i>Save Money Live Better</i>," replacing the "<i>Always Low Prices, Always</i>" slogan, which it had used for the previous 19 years. <a title="Global Insight" href="http://en.wikipedia.org/wiki/Global_Insight">Global Insight</a>, which conducted the research that supported the ads, found that Walmart''s <a title="Price level" href="http://en.wikipedia.org/wiki/Price_level">price level</a> reduction resulted in savings for consumers of $287 billion in 2006, which equated to $957 per person or $2,500 per <a title="Household" href="http://en.wikipedia.org/wiki/Household">household</a> (up 7.3% from the 2004 savings estimate of $2,329).<sup id="cite_ref-33" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-33"><span>[</span>34<span>]</span></a></sup></p><p>On June 30, 2008, Walmart unveiled a new company logo, featuring the non-hyphenated name "Walmart" and in place of the star, a symbol that resembles a sunburst or flower. The new logo received mixed reviews from some design critics, who questioned whether the new logo was as bold as competitors, such as the <a title="Target Corporation" href="http://en.wikipedia.org/wiki/Target_Corporation">Target</a> bullseye or as instantly recognizable as the former company logo, which was used for 18 years.<sup id="cite_ref-34" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-34"><span>[</span>35<span>]</span></a></sup> The new logo made its debut on the company''s <i>walmart.com</i> website on July 1, 2008. Walmart''s U.S. locations were to update store logos in the fall of 2008, as part of an ongoing evolution of its overall brand.<sup id="cite_ref-new_logo_35-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-new_logo-35"><span>[</span>36<span>]</span></a></sup> Wal-Mart Canada started to adopt the logo for its stores in early 2009.</p><p>On March 20, 2009, Walmart announced that it is paying a combined $933.6 million in bonuses to every full and part time hourly worker of the company. An additional $788.8 million in <a title="Profit sharing" href="http://en.wikipedia.org/wiki/Profit_sharing">profit sharing</a>, <a title="401(k)" href="http://en.wikipedia.org/wiki/401(k)">401(k)</a> contributions, and hundreds of millions of dollars in merchandise discounts and contributions to the employees'' stock purchase plan is also included in this plan. While the economy at large was in an ongoing <a title="Recession" href="http://en.wikipedia.org/wiki/Recession">recession</a>, the largest retailer in the U.S. reported solid financial figures for the most recent fiscal year (ending January 31, 2009), with $401.2 billion in net sales, a gain of 7.2% from the prior year. Income from continuing operations increased 3% to $13.3 billion, and earnings per share rose 6% to $3.35.<sup id="cite_ref-36" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-36"><span>[</span>37<span>]</span></a></sup></p><p>On July 16, 2009, Walmart announced plans to develop a worldwide sustainable product index.<sup id="cite_ref-Walmart_Announces_Sustainable_Product_Index_37-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-Walmart_Announces_Sustainable_Product_Index-37"><span>[</span>38<span>]</span></a></sup></p><p>On February 22, 2010, the company confirming it was acquiring <a title="Streaming media" href="http://en.wikipedia.org/wiki/Streaming_media">video streaming</a> company <a class="mw-redirect" title="Vudu, Inc." href="http://en.wikipedia.org/wiki/Vudu,_Inc.">Vudu, Inc.</a> for an estimated $100 million.<sup id="cite_ref-38" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-38"><span>[</span>39<span>]</span></a></sup></p><p>In January 2011, at the urging of <a title="Michelle Obama" href="http://en.wikipedia.org/wiki/Michelle_Obama">Michelle Obama</a> and her staff, Wal-Mart announced a program to improve the nutritional values of its store brands over the next five years, gradually reducing the amount of salt and sugar, and eliminating trans fat. Wal-Mart also promised to negotiate with suppliers such as <a title="Kraft Foods" href="http://en.wikipedia.org/wiki/Kraft_Foods">Kraft</a> with respect to nutritional issues. Reductions in the prices of whole foods and vegetables were also promised as well as efforts to open stores in low-income areas, "food deserts", where there are no supermarkets.<sup id="cite_ref-39" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-39"><span>[</span>40<span>]</span></a></sup></p><p>On April 23, 2011, the company announced that it was testing its new "Walmart To Go" home delivery system where customers will be able to order specific items offered on their website such as groceries, toiletries, and household supplies. The initial test is in <a title="San Jose, California" href="http://en.wikipedia.org/wiki/San_Jose,_California">San Jose, California</a>, and the company has not said whether it will be rolled out nationwide.<sup id="cite_ref-40" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-40"><span>[</span>41<span>]</span></a></sup></p><p></p><p></p><p>Walmart''s international operations currently comprise 4,263 stores and 660,000 workers in 15 countries outside the United States.<sup id="cite_ref-international_65-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-international-65"><span>[</span>66<span>]</span></a></sup> There are wholly owned operations in Argentina, Brazil, Canada,and the UK. With 2.1 million employees worldwide, the company is the largest private employer in the US and Mexico, and one of the largest in Canada.<sup id="cite_ref-WalMartFactsheet_66-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-WalMartFactsheet-66"><span>[</span>67<span>]</span></a></sup> In the financial year 2010, Walmart''s international division sales were $100 billion, or 24.7% of total sales.<sup id="cite_ref-annrep_41-7" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-annrep-41"><span>[</span>42<span>]</span></a></sup></p><p>Walmart has operated in Canada since its acquisition of 122 stores comprising the <a title="Woolco" href="http://en.wikipedia.org/wiki/Woolco">Woolco</a> division of <a title="F. W. Woolworth Company" href="http://en.wikipedia.org/wiki/F._W._Woolworth_Company">Woolworth Canada, Inc</a> in 1994. As of July 2010, it operates over 300 locations (including 100 Supercentres) and employs 82,000 Canadians, with a local home office in <a title="Mississauga" href="http://en.wikipedia.org/wiki/Mississauga">Mississauga</a>, <a title="Ontario" href="http://en.wikipedia.org/wiki/Ontario">Ontario</a>.<sup id="cite_ref-67" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-67"><span>[</span>68<span>]</span></a></sup> <a title="Walmart Canada" href="http://en.wikipedia.org/wiki/Walmart_Canada">Walmart Canada</a>''s first three Supercentres (spelled as in <a title="Canadian English" href="http://en.wikipedia.org/wiki/Canadian_English">Canadian English</a>) opened on November 8, 2006, in <a title="Hamilton, Ontario" href="http://en.wikipedia.org/wiki/Hamilton,_Ontario">Hamilton</a>, <a title="London, Ontario" href="http://en.wikipedia.org/wiki/London,_Ontario">London</a>, and <a title="Aurora, Ontario" href="http://en.wikipedia.org/wiki/Aurora,_Ontario">Aurora</a>, Ontario. The 100th Canadian Supercentre opened on July 10, 2010, in <a title="Victoria, British Columbia" href="http://en.wikipedia.org/wiki/Victoria,_British_Columbia">Victoria</a>, BC. In 2010, Walmart Canada Bank was introduced in Canada with the launch of the Walmart Rewards MasterCard.<sup id="cite_ref-walmart_canada_bank_68-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-walmart_canada_bank-68"><span>[</span>69<span>]</span></a></sup></p><p>In the mid 1990s Wal-mart tried with a large financial investment to get a foothold in the German retail market. In 1997 Wal-mart took over the supermarket chain Wertkauf with its 21 stores for DEM750 million (â‚¬375 million)<sup id="cite_ref-69" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-69"><span>[</span>70<span>]</span></a></sup> and in 1998 Wal-mart took over 74 Interspar stores for DEM1.3 billion (â‚¬750 million).<sup id="cite_ref-70" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-70"><span>[</span>71<span>]</span></a></sup><sup id="cite_ref-71" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-71"><span>[</span>72<span>]</span></a></sup> Several reasons led to Wal-martâ€™s failure in the German market.</p><p>The German market at this point was an <a title="Oligopoly" href="http://en.wikipedia.org/wiki/Oligopoly">oligopoly</a> with high competition among the companies which also used a similar low price strategy as Wal-mart. Because of this, Wal-mart''s low price strategy yielded no competitive advantage. Also Wal-martâ€™s <a class="mw-redirect" title="Corporate culture" href="http://en.wikipedia.org/wiki/Corporate_culture">corporate culture</a> was not viewed positively among employees and customers in Germany, particularly Wal-mart''s "statement of ethics", which restricted relationships between employees and led to a public discussion in the media, resulting in a bad reputation for Wal-mart among customers.<sup id="cite_ref-72" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-72"><span>[</span>73<span>]</span></a></sup><sup id="cite_ref-73" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-73"><span>[</span>74<span>]</span></a></sup> Also Wal-martâ€™s "Big Box â€“ Low Price" Model, a price strategy that works well in the U.S., was not successful in Germany.</p><p>In July 2006, Wal-Mart announced its withdrawal from Germany due to sustained losses. The stores were sold to the German company <a class="mw-redirect" title="METRO AG" href="http://en.wikipedia.org/wiki/METRO_AG">Metro</a> during Wal-Mart''s fiscal third quarter.<sup id="cite_ref-2006-3Q-8K_74-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-2006-3Q-8K-74"><span>[</span>75<span>]</span></a></sup><sup id="cite_ref-walmartgermany_75-0" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-walmartgermany-75"><span>[</span>76<span>]</span></a></sup>. Wal-mart did not disclose its losses from its ill fated German investment, but they were estimated around â‚¬3 billion.<sup id="cite_ref-76" class="reference"><a href="http://en.wikipedia.org/wiki/Walmart#cite_note-76"><span>[</span>77<span>]</span></a></sup> On the other hand Wal-mart''s competitors in Germany were able to increase their market share.</p><p></p>', 0);
INSERT INTO `paragraph` (`paragraph_id`, `capsule_id`, `title`, `value`, `weight`) VALUES
(41, 190, '0', '<p>The first working steam-powered vehicle was likely to have been designed by <a title="Ferdinand Verbiest" href="http://en.wikipedia.org/wiki/Ferdinand_Verbiest">Ferdinand Verbiest</a>, a <a title="Flemish people" href="http://en.wikipedia.org/wiki/Flemish_people">Flemish</a> member of a <a title="Jesuit China missions" href="http://en.wikipedia.org/wiki/Jesuit_China_missions">Jesuit mission in China</a> around 1672. It was a 65 cm-long scale-model toy for the Chinese Emperor, that was unable to carry a driver or a passenger.<sup id="cite_ref-9" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-9"><span>[</span>10<span>]</span></a></sup><sup id="cite_ref-CuriousExp_10-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-CuriousExp-10"><span>[</span>11<span>]</span></a></sup><sup id="cite_ref-setright_11-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-setright-11"><span>[</span>12<span>]</span></a></sup> It is not known if Verbiest''s model was ever built.<sup id="cite_ref-CuriousExp_10-1" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-CuriousExp-10"><span>[</span>11<span>]</span></a></sup></p><p><a title="Nicolas-Joseph Cugnot" href="http://en.wikipedia.org/wiki/Nicolas-Joseph_Cugnot">Nicolas-Joseph Cugnot</a> is widely credited with building the first self-propelled mechanical vehicle or automobile in about 1769; he created a steam-powered tricycle.<sup id="cite_ref-12" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-12"><span>[</span>13<span>]</span></a></sup> He also constructed two steam tractors for the French Army, one of which is preserved in the French National Conservatory of Arts and Crafts.<sup id="cite_ref-Encyclopaedia_Britannica_13-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-Encyclopaedia_Britannica-13"><span>[</span>14<span>]</span></a></sup> His inventions were however handicapped by problems with water supply and maintaining steam pressure.<sup id="cite_ref-Encyclopaedia_Britannica_13-1" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-Encyclopaedia_Britannica-13"><span>[</span>14<span>]</span></a></sup> In 1801, <a title="Richard Trevithick" href="http://en.wikipedia.org/wiki/Richard_Trevithick">Richard Trevithick</a> built and demonstrated his <i>Puffing Devil</i> road locomotive, believed by many to be the first demonstration of a steam-powered road vehicle. It was unable to maintain sufficient steam pressure for long periods, and was of little practical use.</p><p>In 1807 <a title="NicÃ©phore NiÃ©pce" href="http://en.wikipedia.org/wiki/Nic%C3%A9phore_Ni%C3%A9pce">NicÃ©phore NiÃ©pce</a> and his brother Claude probably created the world''s first <a title="Internal combustion engine" href="http://en.wikipedia.org/wiki/Internal_combustion_engine">internal combustion engine</a> which they called a <a title="PyrÃ©olophore" href="http://en.wikipedia.org/wiki/Pyr%C3%A9olophore">PyrÃ©olophore</a>, but they chose to install it in a boat on the river <a class="mw-redirect" title="Saone" href="http://en.wikipedia.org/wiki/Saone">Saone</a> in France.<sup id="cite_ref-NieMus_14-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-NieMus-14"><span>[</span>15<span>]</span></a></sup> Coincidentally, in 1807 the Swiss inventor <a title="FranÃ§ois Isaac de Rivaz" href="http://en.wikipedia.org/wiki/Fran%C3%A7ois_Isaac_de_Rivaz">FranÃ§ois Isaac de Rivaz</a> designed his own ''<a title="De Rivaz engine" href="http://en.wikipedia.org/wiki/De_Rivaz_engine">de Rivaz internal combustion engine</a>'' and used it to develop the world''s first vehicle to be powered by such an engine. The NiÃ©pces'' PyrÃ©olophore was fuelled by a mixture of <a title="Lycopodium powder" href="http://en.wikipedia.org/wiki/Lycopodium_powder">Lycopodium powder</a> (dried <a title="Lycopodium" href="http://en.wikipedia.org/wiki/Lycopodium">Lycopodium</a> moss), finely crushed coal dust and resin that were mixed with oil, whereas de Rivaz used a mixture of <a title="Hydrogen" href="http://en.wikipedia.org/wiki/Hydrogen">hydrogen</a> and <a title="Oxygen" href="http://en.wikipedia.org/wiki/Oxygen">oxygen</a>.<sup id="cite_ref-NieMus_14-1" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-NieMus-14"><span>[</span>15<span>]</span></a></sup> Neither design was very successful, as was the case with others, such as <a title="Samuel Brown (engineer)" href="http://en.wikipedia.org/wiki/Samuel_Brown_(engineer)">Samuel Brown</a>, <a title="Samuel Morey" href="http://en.wikipedia.org/wiki/Samuel_Morey">Samuel Morey</a>, and <a class="mw-redirect" title="Etienne Lenoir" href="http://en.wikipedia.org/wiki/Etienne_Lenoir">Etienne Lenoir</a> with his <a class="mw-redirect" title="Hippomobile (car)" href="http://en.wikipedia.org/wiki/Hippomobile_(car)">hippomobile</a>, who each produced vehicles (usually adapted carriages or carts) powered by clumsy internal combustion engines.<sup id="cite_ref-stein_15-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-stein-15"><span>[</span>16<span>]</span></a></sup></p><p>In November 1881, French inventor <a title="Gustave TrouvÃ©" href="http://en.wikipedia.org/wiki/Gustave_Trouv%C3%A9">Gustave TrouvÃ©</a> demonstrated a working three-wheeled automobile powered by electricity at the <a title="International Exposition of Electricity, Paris" href="http://en.wikipedia.org/wiki/International_Exposition_of_Electricity,_Paris">International Exposition of Electricity, Paris</a>.<sup id="cite_ref-16" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-16"><span>[</span>17<span>]</span></a></sup></p><p><br></p><p><p>In 1893, the first running, gasoline-powered <a class="mw-redirect" title="American car" href="http://en.wikipedia.org/wiki/American_car">American car</a> was built and road-tested by the <a class="mw-redirect" title="Duryea brothers" href="http://en.wikipedia.org/wiki/Duryea_brothers">Duryea brothers</a> of <a title="Springfield, Massachusetts" href="http://en.wikipedia.org/wiki/Springfield,_Massachusetts">Springfield, Massachusetts</a>. The first public run of the <a title="Duryea Motor Wagon" href="http://en.wikipedia.org/wiki/Duryea_Motor_Wagon">Duryea Motor Wagon</a> took place on September 21, 1893, on Taylor Street in <a title="Metro Center, Springfield, Massachusetts" href="http://en.wikipedia.org/wiki/Metro_Center,_Springfield,_Massachusetts">Metro Center</a> Springfield.<sup id="cite_ref-ausbcomp.com_17-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-ausbcomp.com-17"><span>[</span>18<span>]</span></a></sup><sup id="cite_ref-18" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-18"><span>[</span>19<span>]</span></a></sup> To construct the Duryea Motor Wagon, the brothers had purchased a used horse-drawn buggy for $70 and then installed a 4 HP, single cylinder gasoline engine.<sup id="cite_ref-ausbcomp.com_17-1" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-ausbcomp.com-17"><span>[</span>18<span>]</span></a></sup> The car had a friction transmission, spray carburetor, and low tension ignition. It was road-tested again on November 10, when the <a class="mw-redirect" title="The Springfield Republican" href="http://en.wikipedia.org/wiki/The_Springfield_Republican">The Springfield Republican</a> newspaper made the announcement.<sup id="cite_ref-ausbcomp.com_17-2" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-ausbcomp.com-17"><span>[</span>18<span>]</span></a></sup> This particular car was put into storage in 1894 and stayed there until 1920 when it was rescued by Inglis M. Uppercu and presented to the <a class="mw-redirect" title="United States National Museum" href="http://en.wikipedia.org/wiki/United_States_National_Museum">United States National Museum</a>.<sup id="cite_ref-ausbcomp.com_17-3" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-ausbcomp.com-17"><span>[</span>18<span>]</span></a></sup></p><p>In Britain, there had been several attempts to build steam cars with varying degrees of success, with <a title="Rickett (car)" href="http://en.wikipedia.org/wiki/Rickett_(car)">Thomas Rickett</a> even attempting a production run in 1860.<sup id="cite_ref-V.26VCars_19-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-V.26VCars-19"><span>[</span>20<span>]</span></a></sup> <a title="Santler (car)" href="http://en.wikipedia.org/wiki/Santler_(car)">Santler</a> from Malvern is recognized by the Veteran Car Club of Great Britain as having made the first petrol-powered car in the country in 1894<sup id="cite_ref-Beaulieu_20-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-Beaulieu-20"><span>[</span>21<span>]</span></a></sup> followed by <a class="mw-redirect" title="Frederick William Lanchester" href="http://en.wikipedia.org/wiki/Frederick_William_Lanchester">Frederick William Lanchester</a> in 1895, but these were both one-offs.<sup id="cite_ref-Beaulieu_20-1" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-Beaulieu-20"><span>[</span>21<span>]</span></a></sup> The first production vehicles in Great Britain came from the <a title="Daimler Motor Company" href="http://en.wikipedia.org/wiki/Daimler_Motor_Company">Daimler Motor Company</a>, a company founded by <a class="mw-redirect" title="Harry J. Lawson" href="http://en.wikipedia.org/wiki/Harry_J._Lawson">Harry J. Lawson</a> in 1896, after purchasing the right to use the name of the engines. Lawson''s company made its first automobiles in 1897, and they bore the name <i>Daimler</i>.<sup id="cite_ref-Beaulieu_20-2" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-Beaulieu-20"><span>[</span>21<span>]</span></a></sup></p><p>In 1892, German engineer <a title="Rudolf Diesel" href="http://en.wikipedia.org/wiki/Rudolf_Diesel">Rudolf Diesel</a> was granted a patent for a "New Rational Combustion Engine". In 1897, he built the first <a class="mw-redirect" title="Diesel Engine" href="http://en.wikipedia.org/wiki/Diesel_Engine">Diesel Engine</a>.<sup id="cite_ref-stein_15-2" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-stein-15"><span>[</span>16<span>]</span></a></sup> Steam-, electric-, and gasoline-powered vehicles competed for decades, with gasoline internal combustion engines achieving dominance in the 1910s.</p><p>Although various <a title="Pistonless rotary engine" href="http://en.wikipedia.org/wiki/Pistonless_rotary_engine">pistonless rotary engine</a> designs have attempted to compete with the conventional <a title="Piston" href="http://en.wikipedia.org/wiki/Piston">piston</a> and <a title="Crankshaft" href="http://en.wikipedia.org/wiki/Crankshaft">crankshaft</a> design, only <a title="Mazda Wankel engine" href="http://en.wikipedia.org/wiki/Mazda_Wankel_engine">Mazda</a>''s version of the <a title="Wankel engine" href="http://en.wikipedia.org/wiki/Wankel_engine">Wankel engine</a> has had more than very limited success</p><p><br></p><p><p>The weight of a car influences fuel consumption and performance, with more weight resulting in increased fuel consumption and decreased performance. According to a research conducted by <a class="new" title="Julian Allwood (page does not exist)" href="http://en.wikipedia.org/w/index.php?title=Julian_Allwood&amp;action=edit&amp;redlink=1">Julian Allwood</a> of the <a title="University of Cambridge" href="http://en.wikipedia.org/wiki/University_of_Cambridge">University of Cambridge</a>, global energy use could be heavily reduced by using lighter cars, and an average weight of 500 kg has been said to be well achievable.<sup id="cite_ref-23" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-23"><span>[</span>24<span>]</span></a></sup></p><p>In some competitions such as the <a class="new" title="Shell Eco Marathon (page does not exist)" href="http://en.wikipedia.org/w/index.php?title=Shell_Eco_Marathon&amp;action=edit&amp;redlink=1">Shell Eco Marathon</a>, average car weights of 45 kg have also been achieved.<sup id="cite_ref-24" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-24"><span>[</span>25<span>]</span></a></sup><sup id="cite_ref-25" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-25"><span>[</span>26<span>]</span></a></sup> These cars are only single-seaters (still falling within the definition of a car, although 4-seater cars are more common), but it nevertheless demonstrates the huge degree in which car weights can still be reduced, and the subsequent lower fuel use (i.e. up to a fuel use of 2560 km/l.<sup id="cite_ref-26" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-26"><span>[</span>27<span>]</span></a></sup></p><p><p>Transportation is a major contributor to <a title="Air pollution" href="http://en.wikipedia.org/wiki/Air_pollution">air pollution</a> in most industrialised nations. According to the American Surface Transportation Policy Project nearly half of all Americans are breathing unhealthy air. Their study showed air quality in dozens of metropolitan areas has worsened over the last decade.<sup id="cite_ref-35" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-35"><span>[</span>36<span>]</span></a></sup> In the United States the average passenger car emits 11,450 pounds (5,190 kg) of the <a title="Greenhouse gas" href="http://en.wikipedia.org/wiki/Greenhouse_gas">greenhouse gas</a>, <a title="Carbon dioxide" href="http://en.wikipedia.org/wiki/Carbon_dioxide">carbon dioxide</a> annually, along with smaller amounts of <a title="Carbon monoxide" href="http://en.wikipedia.org/wiki/Carbon_monoxide">carbon monoxide</a>, <a class="mw-redirect" title="Hydrocarbons" href="http://en.wikipedia.org/wiki/Hydrocarbons">hydrocarbons</a>, and <a title="Nitrogen" href="http://en.wikipedia.org/wiki/Nitrogen">nitrogen</a>.<sup id="cite_ref-36" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-36"><span>[</span>37<span>]</span></a></sup></p><p>Animals and plants are often negatively impacted by automobiles via <a title="Habitat destruction" href="http://en.wikipedia.org/wiki/Habitat_destruction">habitat destruction</a> and pollution. Over the lifetime of the average automobile the "loss of habitat potential" may be over 50,000 square meters (540,000 sq ft) based on <a title="Primary production" href="http://en.wikipedia.org/wiki/Primary_production">primary production</a> correlations.<sup id="cite_ref-37" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-37"><span>[</span>38<span>]</span></a></sup> Millions of animals are also killed every year on roads by automobilesâ€”so-called <a title="Roadkill" href="http://en.wikipedia.org/wiki/Roadkill">Roadkill</a>.<sup style="white-space: nowrap;" class="Template-Fact">[<i><a title="Wikipedia:Citation needed" href="http://en.wikipedia.org/wiki/Wikipedia:Citation_needed"><span title="This claim needs references to reliable sources from December 2011">citation needed</span></a></i>]</sup></p><p>Growth in the popularity of vehicles and <a title="Commuting" href="http://en.wikipedia.org/wiki/Commuting">commuting</a> has led to <a title="Traffic congestion" href="http://en.wikipedia.org/wiki/Traffic_congestion">traffic congestion</a>. Brussels is considered Europe''s most congested city.<sup id="cite_ref-38" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-38"><span>[</span>39<span>]</span></a></sup></p><p><a title="Fuel tax" href="http://en.wikipedia.org/wiki/Fuel_tax">Fuel taxes</a> may act as an incentive for the production of more efficient, hence less polluting, car designs (e.g. <a class="mw-redirect" title="Hybrid vehicles" href="http://en.wikipedia.org/wiki/Hybrid_vehicles">hybrid vehicles</a>) and the development of <a title="Alternative fuel" href="http://en.wikipedia.org/wiki/Alternative_fuel">alternative fuels</a>. High fuel taxes may provide a strong incentive for consumers to purchase lighter, smaller, more fuel-efficient cars, or to not drive. On average, today''s automobiles are about 75 percent recyclable, and using recycled steel helps reduce energy use and pollution.<sup id="cite_ref-39" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-39"><span>[</span>40<span>]</span></a></sup> In the United States Congress, federally mandated fuel efficiency standards have been debated regularly, passenger car standards have not risen above the 27.5 miles per US gallon (8.55 L/100 km; 33.0 mpg<sub><small>-imp</small></sub>) standard set in 1985. Light <a title="Truck" href="http://en.wikipedia.org/wiki/Truck">truck</a> standards have changed more frequently, and were set at 22.2 miles per US gallon (10.6 L/100 km; 26.7 mpg<sub><small>-imp</small></sub>) in 2007.<sup id="cite_ref-40" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-40"><span>[</span>41<span>]</span></a></sup> <a title="Alternative fuel" href="http://en.wikipedia.org/wiki/Alternative_fuel">Alternative fuel</a> vehicles are another option that is less <a class="mw-redirect" title="Polluting" href="http://en.wikipedia.org/wiki/Polluting">polluting</a> than conventional <a title="Petroleum" href="http://en.wikipedia.org/wiki/Petroleum">petroleum</a> powered vehicles.</p><p><a class="mw-redirect" title="Oil consumption" href="http://en.wikipedia.org/wiki/Oil_consumption">Oil consumption</a> in the twentieth and twenty-first centuries has been abundantly pushed by automobile growth; the <a title="1980s oil glut" href="http://en.wikipedia.org/wiki/1980s_oil_glut">1985-2003 oil glut</a> even fuelled the sales of low economy vehicles in <a class="mw-redirect" title="OECD" href="http://en.wikipedia.org/wiki/OECD">OECD</a> countries. The <a title="BRIC" href="http://en.wikipedia.org/wiki/BRIC">BRIC</a> countries might also kick in, as <a title="China" href="http://en.wikipedia.org/wiki/China">China</a> briefly was the first automobile market in December 2009.<sup id="cite_ref-China-market_41-0" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-China-market-41"><span>[</span>42<span>]</span></a></sup></p><p>Residents of low-density, residential-only sprawling communities are also more likely to die in <a class="mw-redirect" title="Car collision" href="http://en.wikipedia.org/wiki/Car_collision">car collisions</a><sup style="white-space: nowrap;" class="noprint Inline-Template">[<i><a title="Wikipedia:No original research" href="http://en.wikipedia.org/wiki/Wikipedia:No_original_research"><span title="The material in the vicinity of this tag may be based upon unreliable original research from July 2009">original research?</span></a></i>]</sup> which kill 1.2 million people worldwide each year, and injure about forty times this number.<sup id="cite_ref-who_stats_28-1" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-who_stats-28"><span>[</span>29<span>]</span></a></sup> Sprawl is more broadly a factor in inactivity and <a title="Obesity" href="http://en.wikipedia.org/wiki/Obesity">obesity</a>, which in turn can lead to increased risk of a variety of diseases.<sup id="cite_ref-42" class="reference"><a href="http://en.wikipedia.org/wiki/Car#cite_note-42"><span>[</span>43<span>]</span></a></sup></p></p><p><br></p></p></p>', 0),
