(44, 200, '0', 'The 911 can trace its roots back to sketches drawn by Ferdinand "Butzi" Porsche in 1959.[5] The Porsche 911 classic was developed as a much more powerful, larger, more comfortable replacement for the Porsche 356, the company''s first model. The new car made its public debut at the 1963[1] Frankfurt Motor Show (German: Internationale Automobil-Ausstellung).[6] The car presented at the auto show had a non-operational mockup of the 901 engine, receiving a working one in February 1964.[5]<br><br>It originally was designated as the "Porsche 901" (901 being its internal project number). 82 cars were built as 901s.[5] However, Peugeot protested on the grounds that in France it had exclusive rights to car names formed by three numbers with a zero in the middle. So, instead of selling the new model with another name in France, Porsche changed the name to 911. Internally, the cars'' part numbers carried on the prefix 901 for years.[5] Production began in September 1964,[6] the first 911s reached the US in February 1965 with a price tag of US$6,500. The earliest edition of the 911 had a 130 PS (96 kW; 128 hp)[1] flat-6 engine, in the "boxer" configuration like the 356, air-cooled and rear-mounted, displaced 1991 cc compared with the 356''s four-cylinder, 1600 cc unit. The car had four seats although the rear seats were very small, thus the car is usually called a 2+2 rather than a four-seater (the 356 was also a 2+2). It was mated to a four or five-speed manual "Type 901" transmission. The styling was largely by Ferdinand "Butzi" Porsche, son of Ferdinand "Ferry" Porsche. Erwin Komenda, the leader of the Porsche car body construction department, was also involved in the design.<br><br>The 356 came to the end of its production life in 1965, but there was still a market for a 4-cylinder car, particularly in the USA. The Porsche 912, introduced the same year, served as a direct replacement, offering the 356''s 4-cylinder, 1600 cc, 90 hp (67 kW) engine inside the 911 bodywork.<br><br>In 1966 Porsche introduced the more powerful 911S, the engine''s power raised to 160 PS (118 kW; 158 hp). Alloy wheels from Fuchs, in a distinctive 5-leaf design, were offered for the first time. In motorsport at the same time, installed in the mid-engined Porsche 904 and Porsche 906, the engine was developed to 210 PS (154 kW).<br><br>In 1967 the Targa (meaning "plate" in Italian[7]) version was introduced as a "stop gap" model. The Targa had a stainless steel-clad roll bar, as Porsche had, at one point, thought that the U.S. National Highway Traffic Safety Administration (NHTSA) would outlaw fully open convertibles in the US, an important market for the 911. The name "Targa" came from the Targa Florio sports car road race in Sicily, Italy in which Porsche had notable success, with seven victories since 1956, and four more to come until 1973. This last win in the subsequently discontinued event is especially notable as it was scored with a 911 Carrera RS against prototypes entered by Italian factories of Ferrari and Alfa Romeo. The road going Targa was equipped with a removable roof panel and a removable plastic rear window (although a fixed glass version was offered alongside from 1968).<br><br>The 110 PS (81 kW; 108 hp) 911T was also launched in 1967 and effectively replaced the 912. The staple 130 PS (96 kW; 128 hp) model was renamed the 911L. The 911R had a very limited production (20 in all), as this was a lightweight racing version with thin aluminium doors, a magnesium crankcase, twin-spark cylinder heads, and a power output of 210 PS (154 kW).<br><br>In 1969 the B series was introduced: the wheelbase for all 911 and 912 models was increased from 2211 to 2268 mm (87 to 89Â¼ in), an effective remedy to the cars nervous handling at the limit. The overall length of the car did not change: rather, the rear wheels were relocated aft. Fuel injection arrived for the 911S and for a new middle model, 911E. A semi-automatic Sportomatic[8] model, composed of a torque converter, an automatic clutch, and the four-speed transmission was added to the product lineup. It was canceled after the 1980 model year[9] partly because of the elimination of a forward gear to make it a three-speed.[9]<br><br>The 2.2 L 911E was called "The secret weapon from Zuffenhausen"[citation needed]. Despite the lower power output of the 911E (155 PS (114 kW; 153 hp)) compared to the 911S (180 PS (132 kW; 178 hp)) the 911E was quicker in acceleration up to 160 km/h (100 mph).<br><br>The 1972â€“1973 model years consisted of the same models, but with a new, larger 2341 cc (142 inÂ³) engine. This is universally known as the "2.4 L" engine, despite its displacement being closer to 2.3 litres. The 911E and 911S used mechanical fuel injection (MFI) in all markets. For 1972 the 911T was carbureted, except in the U.S. and some Asian markets where emission regulations forced Porsche to equip the 911T with mechanical fuel injection. In January, 1973, US 911Ts were switched to the new K-Jetronic CIS (Continuous Fuel Injection) system from Bosch.<br><br>With the power and torque increases, the 2.4 L cars also got a newer, stronger transmission, identified by its Porsche type number 915. Derived from the transmission in the Porsche 908 race car, the 915 did away with the 901/911 transmission''s "dog-leg" style first gear arrangement, opting for a traditional H pattern with first gear up to the left, second gear underneath first, etc.<br><br>911S models also gained a discreet spoiler under the front bumper to improve high-speed stability. With the cars weighing only 1050 kg (2315 lb), these are often regarded as the best classic mainstream 911s. For racing at this time, the 911 ST was produced in limited numbers (the production run for the ST only lasted from 1970 to 1971). The cars were available with engines of either 2466 cc or 2492 cc, producing 270 PS (199 kW; 266 hp) at 8000 rpm. Weight was down to 960 kg (2166 lb). The cars had success at the Daytona 6 Hours, the Sebring 12 Hours, the 1000 km NÃ¼rburgring and the Targa Florio. <br>', 0),
(45, 218, '0', 'This is my article&nbsp;<div><p style="margin-top: 0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 19px; font-family: sans-serif; ">A&nbsp;<b>blog</b>&nbsp;(a&nbsp;<a href="http://en.wikipedia.org/wiki/Portmanteau" title="Portmanteau" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">portmanteau</a>&nbsp;of the term&nbsp;<i><b>web log</b></i>)<sup id="cite_ref-0" class="reference" style="line-height: 1em; "><a href="http://en.wikipedia.org/wiki/Blog#cite_note-0" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; white-space: nowrap; ">[1]</a></sup>&nbsp;is a personal&nbsp;<a href="http://en.wikipedia.org/wiki/Journal" title="Journal" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">journal</a>&nbsp;published on the&nbsp;<a href="http://en.wikipedia.org/wiki/World_Wide_Web" title="World Wide Web" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">World Wide Web</a>&nbsp;consisting of discrete entries ("posts") typically displayed in reverse chronological order so the most recent post appears first. Blogs are usually the work of a single individual, occasionally of a small group, and often are themed on a single subject.&nbsp;<i>Blog</i>&nbsp;can also be used as a verb, meaning&nbsp;<i>to maintain or add content to a blog</i>.</p><p style="margin-top: 0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 19px; font-family: sans-serif; ">The emergence and growth of blogs in the late 1990s coincided with the advent of&nbsp;<a href="http://en.wikipedia.org/wiki/Blog_software" title="Blog software" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">web publishing tools</a>&nbsp;that facilitated the posting of content by non-technical users. (Previously a knowledge of such technologies as&nbsp;<a href="http://en.wikipedia.org/wiki/HTML" title="HTML" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">HTML</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/FTP" title="FTP" class="mw-redirect" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">FTP</a>&nbsp;had been required to publish content on the Web.)</p><p style="margin-top: 0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 19px; font-family: sans-serif; ">Although not a must, most good quality blogs are interactive, allowing visitors to leave comments and even message each other via&nbsp;<a href="http://en.wikipedia.org/wiki/GUI_widget" title="GUI widget" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">GUI widgets</a>&nbsp;on the blogs and it is this interactivity that distinguishes them from other static websites.<sup id="cite_ref-1" class="reference" style="line-height: 1em; "><a href="http://en.wikipedia.org/wiki/Blog#cite_note-1" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; white-space: nowrap; ">[2]</a></sup>&nbsp;In that sense, blogging can be seen as a form of&nbsp;<a href="http://en.wikipedia.org/wiki/Social_network" title="Social network" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">social networking</a>. Indeed, bloggers do not only produce content to post on their blogs but also build social relations with their readers and other bloggers.<sup id="cite_ref-2" class="reference" style="line-height: 1em; "><a href="http://en.wikipedia.org/wiki/Blog#cite_note-2" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; white-space: nowrap; ">[3]</a></sup></p><p style="margin-top: 0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 19px; font-family: sans-serif; ">Many blogs provide commentary on a particular subject; others function as more personal&nbsp;<a href="http://en.wikipedia.org/wiki/Online_diary" title="Online diary" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">online diaries</a>; yet still others function more as<a href="http://en.wikipedia.org/wiki/Online_advertising" title="Online advertising" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">online brand advertising</a>&nbsp;of a particular individual or company. A typical blog combines text, images, and links to other blogs,&nbsp;<a href="http://en.wikipedia.org/wiki/Web_page" title="Web page" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">Web pages</a>, and other media related to its topic. The ability of readers to leave comments in an interactive format is an important part of many blogs. Most blogs are primarily textual, although some focus on art (<a href="http://en.wikipedia.org/wiki/Art_blog" title="Art blog" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">art blog</a>), photographs (<a href="http://en.wikipedia.org/wiki/Photoblog" title="Photoblog" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">photoblog</a>), videos (<a href="http://en.wikipedia.org/wiki/Video_blogging" title="Video blogging" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">video blogging</a>&nbsp;or vlogging), music (<a href="http://en.wikipedia.org/wiki/MP3_blog" title="MP3 blog" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">MP3 blog</a>), and audio (<a href="http://en.wikipedia.org/wiki/Podcast" title="Podcast" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">podcasting</a>).&nbsp;<a href="http://en.wikipedia.org/wiki/Microblogging" title="Microblogging" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; ">Microblogging</a>&nbsp;is another type of blogging, featuring very short posts.</p><p style="margin-top: 0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 19px; font-family: sans-serif; ">As of 16 February 2011, there were over 156&nbsp;million public blogs in existence.<sup id="cite_ref-3" class="reference" style="line-height: 1em; "><a href="http://en.wikipedia.org/wiki/Blog#cite_note-3" style="color: rgb(11, 0, 128); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; white-space: nowrap; ">[4]</a></sup></p></div>', 0),
(46, 223, '0', '<p>This is the <strong>best chili recipe</strong> you''ll ever make. It \nwas the blue ribbon winner at a chili cook-off, garnering a prize worth \n$20,000 according the the recipe book it came from. With surprise \ningredients like beer and unsweetened cocoa, the blend of seasonings and\n flavors creates a mouth watering chili that will have them begging for \nthe recipe. For the brave souls that like more fire, double the hot \nsauce to kick it up a notch.</p>\n<p>This chili has been taste tested by people that have searched high and low for the <strong>best chili recipe</strong> and they agreed...it is definitely a winner!</p><p><br></p><p>Directions:&nbsp; <br></p><p><br></p><p>1. In a large saucepan brown 1 1/4 pounds of the ground meat (the beef and the pork), drain the fat.</p>\n<p>2. Remove meat (the beef and the pork). Brown the rest of the ground meat, drain all but 2 tablespoons of the fat.</p>\n<p>3. Add the garlic and onion, cook and stir until tender.</p>\n<p>4. Add the other half of the meat and the tomato sauce, water, beer, \nchili powder, bouillon, cumin, paprika, oregano, sugar, coriander, \ncocoa, and hot sauce. Mix well.</p>\n<p>5. Bring to a boil then reduce heat and simmer, covered , for 2 hours.</p>\n<p>6. In a small bowl, stir together the cornmeal and flour, then add the warm water and mix well.</p>\n<p>7. Stir into chili and cook, covered, for an additional 20 minutes.</p>', 0),
(47, 230, '0', '<br>', 0),
(48, 236, '0', '<p>A feline <a href="http://en.wikipedia.org/wiki/Litter_%28animal%29" title="Litter (animal)">litter</a> usually consists of two to five kittens. The kits are born after a <a href="http://en.wikipedia.org/wiki/Gestation" title="Gestation">gestation</a> that lasts between 64 and 67 days, with an <a href="http://en.wikipedia.org/wiki/Average" title="Average">average</a> length of 66 days.<sup id="cite_ref-1" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-1"><span>[</span>2<span>]</span></a></sup> Kittens emerge in a sac called the <i><a href="http://en.wikipedia.org/wiki/Amnion" title="Amnion">amnion</a></i> which is bitten off and eaten by the mother cat.<sup id="cite_ref-2" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-2"><span>[</span>3<span>]</span></a></sup></p>\n<p>For the first several weeks, kittens are unable to urinate or defecate without being stimulated by their mother. <sup id="cite_ref-petedu_3-0" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-petedu-3"><span>[</span>4<span>]</span></a></sup> They are also unable to regulate their body temperature for the first three weeks, so kittens born in temperatures less than 27<a href="http://en.wikipedia.org/wiki/Celsius" title="Celsius">Â°C</a> (80 <a href="http://en.wikipedia.org/wiki/Fahrenheit" title="Fahrenheit">Â°F</a>) can die from exposure if they are not kept warm by their mother.</p>\n<p>The mother''s milk is very important for the kittens'' nutrition and proper growth. This milk transfers <a href="http://en.wikipedia.org/wiki/Antibody" title="Antibody">antibodies</a> to the kittens, which helps protect them against <a href="http://en.wikipedia.org/wiki/Infectious_disease" title="Infectious disease">infectious disease</a>.<sup id="cite_ref-4" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-4"><span>[</span>5<span>]</span></a></sup> Newborn kittens are also unable to produce concentrated <a href="http://en.wikipedia.org/wiki/Urine" title="Urine">urine</a>, and so have a very high requirement for fluids.<sup id="cite_ref-5" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-5"><span>[</span>6<span>]</span></a></sup></p>\n<p>Kittens open their <a href="http://en.wikipedia.org/wiki/Eye" title="Eye">eyes</a> about seven to ten days after <a href="http://en.wikipedia.org/wiki/Birth" title="Birth">birth</a>. At first, the <a href="http://en.wikipedia.org/wiki/Retina" title="Retina">retina</a> is poorly developed and vision is poor. Kittens are not able to see as well as adult cats until about ten weeks after birth.<sup id="cite_ref-6" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-6"><span>[</span>7<span>]</span></a></sup></p><p><br><sup id="cite_ref-6" class="reference"><a href="http://en.wikipedia.org/wiki/Kitten#cite_note-6"><span></span></a></sup></p>', 0),
