(50, 227, '0', '<h5>FULL HD 3D Blu-ray Disc Playback</h5> <p>Advanced 2D image \ntechnology accumulated over the years at the Panasonic Hollywood \nLaboratory (PHL) has also been applied to 3D image playback, allowing \nhigh quality images to approach original film quality. Life-like 3D \nimages with dramatic leaping effects and enhanced depth, luster and \ntexture are beautifully reproduced.</p><h5>2D-3D Conversion</h5> <p>The 2D-3D Conversion makes it possible to \nconvert images from DVDs and Blu-ray Discs into 3D with natural depth \nperception. This allows you to watch your prized DVD movie collection in\n 3D with real-life depth, for even greater viewing enjoyment.</p> <h5>3D Effect Controller</h5> <p>The\n 3D Effect Controller lets you moderate the leaping effects of 3D \nimages. It also lets you adjust the amount of depth so you can view \nexpansive images and enjoy movies with the exact kind of 3D effects you \nwant.</p><p><br></p><h5>Touch-Free Sensor</h5> <p>A motion sensor is now provided on the top\n panel of the Blu-ray Disc player. The disc tray can be opened or closed\n by simply passing your hand over the sensor. This is very useful when \nyour hands are full or when you''re in a dark room and can''t see the \nbuttons clearly.</p>', 0),
(51, 246, '0', '<ol><li>asdfhaskdflkasdfad<img src="uploads/post/paragraph-images/568532567471266.jpg" width="160">zxcvzcvzcvzxcvzcvzxcvzxcvzcvzcvzxcvzxcvzxcvzxlkjl;zkjxvcljzxlkcjvzlkxjvlkzxjcvlzjxclvjz;xlcjvlkzxjcvlkxzjcvlzjxclkjvzlxcjvlkczj</li><li><br></li><li><br></li><li><br></li><li><br></li><li><br></li></ol>asldfja;jdfasdfjadsf<u>asdfadfa<i>asdfasdf<b>asdfasdfadfasdfadfadasdfadf</b></i></u><div><img src="http://upload.wikimedia.org/wikipedia/commons/1/10/Krabi_98.91910E_8.06075N.jpg" alt="krabi" align="none"><br><img src="http://www.nasdaq.com" alt="this is a test" align="left"><img src="http://en.wikipedia.org/wiki/File:Krabi_98.91910E_8.06075N.jpg" alt="krabi" align="left"></div>', 0),
