(54, 262, '0', '<div><b>About New York City</b></div><div><br></div><div>New York is the most populous city in the United States[11] and the center of the New York Metropolitan Area, one of the most populous metropolitan areas in the world.[12][13][14] New York exerts a significant impact upon global commerce, finance, media, art, fashion, research, technology, education, and entertainment. The home of the United Nations Headquarters,[15] New York is an important center for international diplomacy[16] and has been described as the cultural capital of the world.[17] The city is also referred to as <b>New York City</b> or <b>The City of New York</b>[18] to distinguish it from the <b>State of New York, of which it is a part.</b>[19]</div><div><br></div><div>Located on one of the world''s largest natural harbors,[20] <b>New York City consists of five boroughs</b>, each of which comprises a state county.[21] The five boroughs â€” <b>The Bronx, Brooklyn, Manhattan, Queens, and Staten Island</b> â€” were consolidated into a single city in 1898.[22][23] With a <b>Census-estimated 2011 population of 8,244,910</b>[24] distributed over a land area of just<b> 305 square miles (790 km2)</b>,[25][26][27] New York is the most densely populated major city in the United States.[28] As many as<b> 800 languages</b> are spoken in New York, making it the most <b>linguistically diverse city in the world.</b>[29] The New York City Metropolitan Area''s population is the United States'' largest, with <b>18.9 million people distributed over 6,720 square miles (17,400 km2)</b>,[30][31] and is also part of the most populous combined statistical area in the United States, containing 22.1 million people as of the 2010 Census.[32]</div>', 0),
(55, 264, '0', '<b>Economy</b><div><br></div><div><div>New York is a <b>global hub of international business and commerce and is one of three "command centers" for the world economy (along with London and Tokyo)</b>.[228] The city is a major center for banking and finance, retailing, world trade, transportation, tourism, real estate, new media as well as traditional media, advertising, legal services, accountancy, insurance, theater, fashion, and the arts in the United States. The <b>New York metropolitan area had approximately gross metropolitan product of $1.28 trillion in 2010,[229] making it the largest regional economy in the United States and, according to IT Week, the second largest city economy in the world</b>.[230] According to Cinco Dias, <b>New York controlled 40% of the world''s finances by the end of 2008, making it the largest financial center in the world</b>.[231][232][233]</div><div><br></div><div><br></div><div><b>The New York Stock Exchange on Wall Street, the world''s largest stock exchange by total market capitalization of its listed companies.[234]</b></div><div><b><br></b></div><div>New York City has been ranked first among 120 cities across the globe in attracting capital, businesses, and tourists.[235]</div><div><br></div><div>Many major corporations are headquartered in New York City, including 45 Fortune 500 companies.[236] New York is also unique among American cities for its large number of foreign corporations. One out of ten private sector jobs in the city is with a foreign company.[237] <b>Manhattan had 353.7 million square feet (32,860,000 mÂ²) of office space in 2001</b>.[238] <b>Midtown Manhattan</b> is the largest central business district in the United States. Lower Manhattan is the third largest central business district in the United States and is home to The New York Stock Exchange, located on Wall Street, and the NASDAQ, representing the world''s first and second largest stock exchanges, respectively, when measured by average daily trading volume and overall market capitalization.[239] Financial services account for more than 35% of the city''s employment income.[240]</div><div>Real estate is a major force in the city''s economy, as the total value of all New York City property was $802.4 billion in 2006.[241] The Time Warner Center is the property with the highest-listed market value in the city, at $1.1 billion in 2006.[241] New York City is home to some of the nation''sâ€”and the world''sâ€”most valuable real estate. 450 Park Avenue was sold on July 2, 2007 for $510 million, about $1,589 per square foot ($17,104/mÂ²), breaking the barely month-old record for an American office building of $1,476 per square foot ($15,887/mÂ²) set in the June 2007 sale of 660 Madison Avenue.[242]</div><div><br></div><div>The city''s television and film industry is the second largest in the country after Hollywood.[243] Creative industries such as new media, advertising, fashion, design and architecture account for a growing share of employment, with New York City possessing a strong competitive advantage in these industries.[244]</div><div>High-tech industries like biotechnology, software development, game design, and internet services are also growing, bolstered by the city''s position at the terminus of several transatlantic fiber optic trunk lines.[245] Other important sectors include medical research and technology, non-profit institutions, and universities. Manufacturing accounts for a large but declining share of employment. <b>Garments, chemicals, metal products, processed foods, and furniture are some of the principal products.</b>[246] The food-processing industry is the most stable major manufacturing sector in the city.[247] <b>Food making is a $5 billion industry that employs more than 19,000 residents. Chocolate is New York City''s leading specialty-food export, with $234 million worth of exports each yea</b>r.[247]</div></div>', 0),
(56, 268, '0', 'irst named in October as President Obamaâ€™s picks for the agency, \ntheir appointments were held up for several months as Sen Chuck Grassley\n (R-Iowa.) refused to vote for their nominations as a measure of protest\n against the FCC. The lawmaker said he would only vote on the nominees \nif the agency agreed to release documents related to its controversial \nlicensing decisions on Reston-based satellite venture LightSquared. <p>Last week, Grassley agreed to lift his hold after the release of those documents.</p><p>FCC Chairman Julius Genachowski lauded the confirmations.</p><p>â€œThey\n bring deep knowledge of our sector, and proven track records of \naccomplishment,â€ he said. â€œPresident Obama made an outstanding choice in\n their nominations, and I look forward to working with them.â€</p><p>The \nbiggest agenda items for the FCC this year include the development of an\n auction of broadcast airwaves to be used to bolster wireless Internet \nnetworks. <br></p>', 0),
