(62, 299, '0', 'New Jersey is a state in the Northeastern and Middle Atlantic regions of the United States. It is bordered on the north and east by the state of New York, on the southeast and south by the Atlantic Ocean, on the west by Pennsylvania and on the southwest by Delaware. New Jersey is the 4th least extensive, but the 11th most populous and the most densely populated of the 50 United States. New Jersey lies mostly within the sprawling metropolitan areas of New York City and Philadelphia. It is also the third wealthiest by 2009â€“2010 median household income.[7]<br><br>The area was inhabited by Native Americans for more than 2,800 years, with historical tribes such as the Lenape along the coast. In the early 17th century, the Dutch and the Swedes made the first European settlements.[8] The British later seized control of the region,[9] naming it the Province of New Jersey. It was granted as a colony to Sir George Carteret and John Berkeley, 1st Baron Berkeley of Stratton. At this time, it was named after the largest of the British Channel Islands, Jersey, Carteret''s birthplace.[10] New Jersey was the site of several decisive battles during the American Revolutionary War.<br><br>In the 19th century, factories in cities such as Elizabeth, Paterson, and Trenton helped to drive the Industrial Revolution. New Jersey''s position at the center of the Northeast megalopolis, between Boston and New York City to the northeast, and Philadelphia, Baltimore and Washington, D.C. to the southwest, fueled its rapid growth through the suburban boom of the 1950s and beyond.<br>', 0),
(63, 302, '0', 'Watch movies, view photos, and listen to music anytime, anyplace with \nthe DVP-FX750 portable DVD player in black. Ideal for road trips, plane \nrides, or the daily commute, this stylish player features a vibrant \n7-inch screen and up to 3 hours of battery life. And when you want more \nthan movies, you can view at personal photo albums or play CDs and MP3s.\n Share entertainment with a friend via two built-in headphone jacks. An \nincluded car adapter ensures you''ll be ready to go no matter how long \nthe road trip while the A/V adapter makes it easy to connect to a TV.', 0);
