(64, 336, '0', '<p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; "><font face="sans-serif"><span  19px;"><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; ">The Avengers is a team of superheroes, appearing in magazines published by Marvel Comics. The team made its debut in The Avengers #1 (Sept. 1963), and was created by writer-editor Stan Lee and artist/co-plotter Jack Kirby, following the trend of super-hero teams after the success of DC Comics'' Justice League of America.[1]</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; ">Labeled "Earth''s Mightiest Heroes", the Avengers originally consisted of Iron Man (Tony Stark), Ant-Man (Dr. Henry Pym), Wasp (Janet Van Dyne), Thor, and the Hulk (Bruce Banner). The original Captain America was discovered by the team in issue #4, trapped in ice, and he joined the group when they revived him. The rotating roster has become a hallmark of the team, although one theme remains consistent: the Avengers fight "the foes no single superhero can withstand". The team, famous for its battle cry of "Avengers Assemble!", has featured humans, mutants, robots, gods, aliens, supernatural beings, and even former villains.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; ">An animated television series, The Avengers: Earth''s Mightiest Heroes, premiered on October 20, 2010, based off the early adventures of the team, as well as the other heroes. The show has so far run for two seasons. A feature film version has Nick Fury recruit Iron Man, Captain America, Hulk, Thor, Black Widow and Hawkeye to form the Avengers. It was released in the spring 2012 and set the record for the biggest opening debut in North America, with a weekend gross of $207.4 million.[2]</p></span></font></p>', 0),
(65, 339, '0', '<p  8px; margin-right: 0px; margin-bottom: 8px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(51, 51, 51); font-family: Arial; font-size: 12px; line-height: 19px; text-align: justify; background-color: rgb(121, 124, 124); "><strong>TRIUMPH DAYTONA 675</strong></p><p  8px; margin-right: 0px; margin-bottom: 8px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(51, 51, 51); font-family: Arial; font-size: 12px; line-height: 19px; text-align: justify; background-color: rgb(121, 124, 124); ">- Race track developed technology<br>- Compact 125PS Motor<br>- 72Nm three-cylinder engine for class-leading performance<br>- Fully adjustable suspension for controllable and precise handling<br>- Monobloc caliper brakes<br>- Class-leading, award-winning, supersport contender<br>- New graphics for 2012<br>- top speed 165mph<br>- average fuel consumption 38mpg.</p><p  8px; margin-right: 0px; margin-bottom: 8px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; color: rgb(51, 51, 51); font-family: Arial; font-size: 12px; line-height: 19px; text-align: justify; background-color: rgb(121, 124, 124); ">The engine is changed, with pumps additional 3 BHP and claims power up to 126 BHP. The ride quality on all sorts of roads is astoundingly good. The Daytona is not a all rounder. The riding positionis very forward leaning. The Seat is tip-toe and will<br>strain your wrists. But if youâ€™re looking forward to fun road rides and a few track day , this is the one.</p>', 0),
(66, 343, '0', '<span class="Apple-style-span"  19px; font-family: sans-serif; "><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; "><a href="http://en.wikipedia.org/wiki/Atmospheric_pressure" title="Atmospheric pressure"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Atmospheric pressure</a>&nbsp;is the force per unit area that is always applied perpendicularly to a surface by the surrounding gas. It is determined by a planet''s gravitational force in combination with the total mass of a column of gas above a location. Units of air pressure are based on the internationally-recognized&nbsp;<a href="http://en.wikipedia.org/wiki/Atmosphere_(unit)" title="Atmosphere (unit)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">standard atmosphere</a>&nbsp;(atm), which is defined as 101,325&nbsp;<a href="http://en.wikipedia.org/wiki/Pascal_(unit)" title="Pascal (unit)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Pa</a>&nbsp;(or 1,013,250&nbsp;<a href="http://en.wikipedia.org/wiki/Dyne" title="Dyne"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">dynes</a>&nbsp;per cm<sup  1em; ">2</sup>). One (atm) equals 14.696&nbsp;<a href="http://en.wikipedia.org/wiki/Pounds_per_square_inch" title="Pounds per square inch"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">pounds per square inch</a>&nbsp;(psi).</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">The pressure of an atmospheric gas decreases with altitude due to the diminishing mass of gas above each location. The height at which the pressure from an atmosphere declines by a factor of&nbsp;<i><a href="http://en.wikipedia.org/wiki/E_(mathematical_constant)" title="E (mathematical constant)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">e</a></i>&nbsp;(an&nbsp;<a href="http://en.wikipedia.org/wiki/Irrational_number" title="Irrational number"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">irrational number</a>&nbsp;with a value of 2.71828..) is called the&nbsp;<a href="http://en.wikipedia.org/wiki/Scale_height" title="Scale height"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">scale height</a>&nbsp;and is denoted by&nbsp;<i>H</i>. For an atmosphere with a uniform temperature, the scale height is proportional to the temperature and inversely proportional to the mean&nbsp;<a href="http://en.wikipedia.org/wiki/Molecular_mass" title="Molecular mass"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">molecular mass</a>&nbsp;of dry air times the planet''s gravitational acceleration. For such a model atmosphere, the pressure declines exponentially with increasing altitude. However, atmospheres are not uniform in temperature, so the exact determination of the atmospheric pressure at any particular altitude is more complex.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; "><br></p></span><span class="Apple-style-span"  19px; font-family: sans-serif; "><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; "><a href="http://en.wikipedia.org/wiki/Surface_gravity" title="Surface gravity"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Surface gravity</a>, the force that holds down an atmosphere, differs significantly among the planets. For example, the large gravitational force of the giant planet&nbsp;<a href="http://en.wikipedia.org/wiki/Jupiter" title="Jupiter"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Jupiter</a>&nbsp;is able to retain light gases such as&nbsp;<a href="http://en.wikipedia.org/wiki/Hydrogen" title="Hydrogen"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">hydrogen</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Helium" title="Helium"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">helium</a>&nbsp;that escape from lower gravity objects. Second, the distance from the sun determines the energy available to heat atmospheric gas to the point where its molecules''&nbsp;<a href="http://en.wikipedia.org/wiki/Thermal_motion" title="Thermal motion" class="mw-redirect"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">thermal motion</a>&nbsp;exceed the planet''s&nbsp;<a href="http://en.wikipedia.org/wiki/Escape_velocity" title="Escape velocity"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">escape velocity</a>, the speed at which gas molecules overcome a planet''s gravitational grasp. Thus, the distant and cold&nbsp;<a href="http://en.wikipedia.org/wiki/Titan_(moon)" title="Titan (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Titan</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Triton_(moon)" title="Triton (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Triton</a>, and&nbsp;<a href="http://en.wikipedia.org/wiki/Pluto" title="Pluto"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Pluto</a>&nbsp;are able to retain their atmospheres despite relatively low gravities.&nbsp;<a href="http://en.wikipedia.org/wiki/Interstellar_planet" title="Interstellar planet" class="mw-redirect"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Interstellar planets</a>, theoretically, may also retain thick atmospheres.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">Since a gas at any particular temperature will have molecules moving at a wide range of velocities, there will almost always be some slow leakage of gas into space. Lighter molecules move faster than heavier ones with the same thermal&nbsp;<a href="http://en.wikipedia.org/wiki/Kinetic_energy" title="Kinetic energy"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">kinetic energy</a>, and so gases of low&nbsp;<a href="http://en.wikipedia.org/wiki/Molecular_mass" title="Molecular mass"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">molecular weight</a>&nbsp;are lost more rapidly than those of high molecular weight. It is thought that&nbsp;<a href="http://en.wikipedia.org/wiki/Venus" title="Venus"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Venus</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Mars" title="Mars"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Mars</a>&nbsp;may have both lost much of their water when, after being&nbsp;<a href="http://en.wikipedia.org/wiki/Photodissociation" title="Photodissociation"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">photo dissociated</a>&nbsp;into hydrogen and oxygen by solar&nbsp;<a href="http://en.wikipedia.org/wiki/Ultraviolet" title="Ultraviolet"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">ultraviolet</a>, the hydrogen escaped.&nbsp;<a href="http://en.wikipedia.org/wiki/Earth" title="Earth"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Earth</a>''s&nbsp;<a href="http://en.wikipedia.org/wiki/Magnetic_field" title="Magnetic field"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">magnetic field</a>&nbsp;helps to prevent this, as, normally, the solar wind would greatly enhance the escape of hydrogen. However, over the past 3 billion years the Earth may have lost gases through the magnetic polar regions due to auroral activity, including a net 2% of its atmospheric oxygen.<sup id="cite_ref-3" class="reference"  1em; font-weight: normal; font-style: normal; "><a href="http://en.wikipedia.org/wiki/Celestial_body_atmosphere#cite_note-3"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; white-space: nowrap; background-position: initial initial; background-repeat: initial initial; "><span>[</span>4<span>]</span></a></sup></p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">Other mechanisms that can cause&nbsp;<a href="http://en.wikipedia.org/wiki/Atmospheric_escape" title="Atmospheric escape"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">atmosphere depletion</a>&nbsp;are&nbsp;<a href="http://en.wikipedia.org/wiki/Solar_wind" title="Solar wind"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">solar wind</a>-induced sputtering,&nbsp;<a href="http://en.wikipedia.org/wiki/Impact_event" title="Impact event"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">impact</a>&nbsp;erosion,&nbsp;<a href="http://en.wikipedia.org/wiki/Weathering" title="Weathering"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">weathering</a>, and sequestration&nbsp;â€” sometimes referred to as "freezing out"&nbsp;â€” into the&nbsp;<a href="http://en.wikipedia.org/wiki/Regolith" title="Regolith"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">regolith</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Polar_ice_cap" title="Polar ice cap"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">polar caps</a>.</p></span><span class="Apple-style-span"  sans-serif; line-height: 19px; ">Initial atmospheric makeup is generally related to the chemistry and temperature of the local&nbsp;<a href="http://en.wikipedia.org/wiki/Solar_nebula" title="Solar nebula" class="mw-redirect"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">solar nebula</a>&nbsp;during planetary formation and the subsequent escape of interior gases. These original atmospheres underwent much evolution over time, with the varying properties of each planet resulting in very different outcomes.</span><span class="Apple-style-span"  19px; font-family: sans-serif; "><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">The atmospheres of the planets&nbsp;<a href="http://en.wikipedia.org/wiki/Venus" title="Venus"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Venus</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Mars" title="Mars"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Mars</a>&nbsp;are primarily composed of&nbsp;<a href="http://en.wikipedia.org/wiki/Carbon_dioxide" title="Carbon dioxide"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">carbon dioxide</a>, with small quantities of&nbsp;<a href="http://en.wikipedia.org/wiki/Nitrogen" title="Nitrogen"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">nitrogen</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Argon" title="Argon"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">argon</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Oxygen" title="Oxygen"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">oxygen</a>&nbsp;and traces of other gases.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">The atmospheric composition on Earth is largely governed by the by-products of the very life that it sustains.&nbsp;<a href="http://en.wikipedia.org/wiki/Earth_atmosphere" title="Earth atmosphere" class="mw-redirect"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Earth''s atmosphere</a>&nbsp;contains roughly (by molar content/volume) 78.08% nitrogen, 20.95% oxygen, a variable amount (average around 1.247%, National Center for Atmospheric Research) water vapor, 0.93% argon, 0.038% carbon dioxide, and traces of hydrogen, helium, and other "noble" gases.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">The low temperatures and higher gravity of the&nbsp;<a href="http://en.wikipedia.org/wiki/Gas_giant" title="Gas giant"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">gas giants</a>&nbsp;â€”&nbsp;<a href="http://en.wikipedia.org/wiki/Jupiter" title="Jupiter"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Jupiter</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Saturn" title="Saturn"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Saturn</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Uranus" title="Uranus"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Uranus</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Neptune" title="Neptune"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Neptune</a>&nbsp;â€” allows them to more readily retain gases with low&nbsp;<a href="http://en.wikipedia.org/wiki/Molecular_mass" title="Molecular mass"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">molecular masses</a>. These planets have hydrogen-helium atmospheres, with trace amounts of more complex compounds.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">Two satellites of the outer planets possess non-negligible atmospheres:&nbsp;<a href="http://en.wikipedia.org/wiki/Titan_(moon)" title="Titan (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Titan</a>, a moon of Saturn, and&nbsp;<a href="http://en.wikipedia.org/wiki/Triton_(moon)" title="Triton (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Triton</a>, a moon of Neptune, which are mainly&nbsp;<a href="http://en.wikipedia.org/wiki/Nitrogen" title="Nitrogen"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">nitrogen</a>.&nbsp;<a href="http://en.wikipedia.org/wiki/Pluto" title="Pluto"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Pluto</a>, in the nearer part of its orbit, has an atmosphere of nitrogen and methane similar to Triton''s, but these gases are frozen when farther from the Sun.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">Other bodies within the&nbsp;<a href="http://en.wikipedia.org/wiki/Solar_System" title="Solar System"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Solar System</a>&nbsp;have extremely thin atmospheres not in equilibrium. These include&nbsp;<a href="http://en.wikipedia.org/wiki/Moon" title="Moon"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">the Moon</a>&nbsp;(<a href="http://en.wikipedia.org/wiki/Sodium" title="Sodium"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">sodium</a>&nbsp;gas),&nbsp;<a href="http://en.wikipedia.org/wiki/Mercury_(planet)" title="Mercury (planet)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Mercury</a>&nbsp;(sodium gas),&nbsp;<a href="http://en.wikipedia.org/wiki/Europa_(moon)" title="Europa (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Europa</a>&nbsp;(oxygen),&nbsp;<a href="http://en.wikipedia.org/wiki/Io_(moon)" title="Io (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Io</a>&nbsp;(<a href="http://en.wikipedia.org/wiki/Sulfur" title="Sulfur"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">sulfur</a>), and&nbsp;<a href="http://en.wikipedia.org/wiki/Enceladus_(moon)" title="Enceladus (moon)"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Enceladus</a>&nbsp;(water vapor).</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">The atmospheric composition of an&nbsp;<a href="http://en.wikipedia.org/wiki/Extra-solar_planet" title="Extra-solar planet" class="mw-redirect"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">extra-solar planet</a>&nbsp;was first determined using the&nbsp;<a href="http://en.wikipedia.org/wiki/Hubble_Space_Telescope" title="Hubble Space Telescope"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Hubble Space Telescope</a>. Planet&nbsp;<a href="http://en.wikipedia.org/wiki/HD_209458" title="HD 209458"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">HD 209458b</a>&nbsp;is a gas giant with a close orbit around a star in the&nbsp;<a href="http://en.wikipedia.org/wiki/Constellation" title="Constellation"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">constellation</a>&nbsp;<a href="http://en.wikipedia.org/wiki/Pegasus" title="Pegasus"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Pegasus</a>. The atmosphere is heated to temperatures over 1,000&nbsp;K, and is steadily escaping into space. Hydrogen, oxygen, carbon and sulfur have been detected in the planet''s inflated atmosphere.</p></span><span class="Apple-style-span"  19px; font-family: sans-serif; "><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">The&nbsp;<a href="http://en.wikipedia.org/wiki/Earth''s_atmosphere" title="Earth''s atmosphere" class="mw-redirect"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">Earth''s atmosphere</a>&nbsp;consists, from the ground up, of the&nbsp;<a href="http://en.wikipedia.org/wiki/Troposphere" title="Troposphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">troposphere</a>&nbsp;(which includes the&nbsp;<a href="http://en.wikipedia.org/wiki/Planetary_boundary_layer" title="Planetary boundary layer"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">planetary boundary layer</a>&nbsp;or peplosphere as lowest layer),&nbsp;<a href="http://en.wikipedia.org/wiki/Stratosphere" title="Stratosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">stratosphere</a>&nbsp;(which includes the&nbsp;<a href="http://en.wikipedia.org/wiki/Ozone_layer" title="Ozone layer"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">ozone layer</a>),&nbsp;<a href="http://en.wikipedia.org/wiki/Mesosphere" title="Mesosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">mesosphere</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Thermosphere" title="Thermosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">thermosphere</a>&nbsp;(which contains the&nbsp;<a href="http://en.wikipedia.org/wiki/Ionosphere" title="Ionosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">ionosphere</a>),&nbsp;<a href="http://en.wikipedia.org/wiki/Exosphere" title="Exosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">exosphere</a>&nbsp;and also the&nbsp;<a href="http://en.wikipedia.org/wiki/Magnetosphere" title="Magnetosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">magnetosphere</a>. Each of the layers has a different&nbsp;<a href="http://en.wikipedia.org/wiki/Lapse_rate" title="Lapse rate"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">lapse rate</a>, defining the rate of change in temperature with height.</p><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; ">Three quarters of the atmosphere lies within the troposphere, and the depth of this layer varies between 17&nbsp;km at the equator and 7&nbsp;km at the poles. The&nbsp;<a href="http://en.wikipedia.org/wiki/Ozone_layer" title="Ozone layer"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">ozone layer</a>, which absorbs&nbsp;<a href="http://en.wikipedia.org/wiki/Ultraviolet" title="Ultraviolet"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">ultraviolet</a>&nbsp;energy from the Sun, is located primarily in the stratosphere, at altitudes of 15 to 35&nbsp;km. The&nbsp;<a href="http://en.wikipedia.org/wiki/KÃ¡rmÃ¡n_line" title="KÃ¡rmÃ¡n line"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">KÃ¡rmÃ¡n line</a>, located within the thermosphere at an altitude of 100&nbsp;km, is commonly used to define the boundary between the Earth''s atmosphere and outer space. However, the exosphere can extend from 500 up to 10,000&nbsp;km above the surface, where it interacts with the planet''s&nbsp;<a href="http://en.wikipedia.org/wiki/Magnetosphere" title="Magnetosphere"  none; color: rgb(6, 69, 173); background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial; ">magnetosphere</a>.</p></span><span class="Apple-style-span"  19px; font-family: sans-serif; "><p  0.4em; margin-right: 0px; margin-bottom: 0.5em; margin-left: 0px; line-height: 1.5em; "><br></p></span>', 0),
