(68, 360, '0', 'In modern use, "science" more often refers to a way of pursuing knowledge, not only the knowledge itself. It is "often treated as synonymous with â€˜natural and physical scienceâ€™, and thus restricted to those branches of study that relate to the phenomena of the material universe and their laws, sometimes with implied exclusion of pure mathematics. This is now the dominant sense in ordinary use."<sup id="cite_ref-3" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-3"><span>[</span>4<span>]</span></a></sup> This narrower sense of "science" developed as scientists such as <a title="Johannes Kepler" href="http://en.wikipedia.org/wiki/Johannes_Kepler">Johannes Kepler</a>, <a title="Galileo Galilei" href="http://en.wikipedia.org/wiki/Galileo_Galilei">Galileo Galilei</a> and <a title="Isaac Newton" href="http://en.wikipedia.org/wiki/Isaac_Newton">Isaac Newton</a> began formulating <i><a class="mw-redirect" title="Laws of nature" href="http://en.wikipedia.org/wiki/Laws_of_nature">laws of nature</a></i> such as <a title="Newton''s laws of motion" href="http://en.wikipedia.org/wiki/Newton''s_laws_of_motion">Newton''s laws of motion</a>. In this period it became more common to refer to natural philosophy as "natural science". Over the course of the 19th century, the word "science" became increasingly associated with <a title="Scientific method" href="http://en.wikipedia.org/wiki/Scientific_method">scientific method</a>, a disciplined way to study the natural world, including <a title="Physics" href="http://en.wikipedia.org/wiki/Physics">physics</a>, <a title="Chemistry" href="http://en.wikipedia.org/wiki/Chemistry">chemistry</a>, <a title="Geology" href="http://en.wikipedia.org/wiki/Geology">geology</a> and <a title="Biology" href="http://en.wikipedia.org/wiki/Biology">biology</a>. It is in the 19th century also that the term <i><a title="Scientist" href="http://en.wikipedia.org/wiki/Scientist">scientist</a></i> was created by the naturalist-theologian <a title="William Whewell" href="http://en.wikipedia.org/wiki/William_Whewell">William Whewell</a> to distinguish those who sought knowledge on nature from those who sought knowledge on other disciplines. The <i>Oxford English Dictionary</i> dates the origin of the word "scientist" to 1834. This sometimes left the study of human thought and society in a linguistic limbo, which was resolved by classifying these areas of academic study as <a title="Social science" href="http://en.wikipedia.org/wiki/Social_science">social science</a>. Similarly, several other major areas of disciplined study and knowledge exist today under the general rubric of "science", such as <a title="Formal science" href="http://en.wikipedia.org/wiki/Formal_science">formal science</a> and <a title="Applied science" href="http://en.wikipedia.org/wiki/Applied_science">applied science</a>.<div><br></div><div>Working scientists usually take for granted a set of basic assumptions that are needed to justify a scientific method: (1) that there is an objective reality shared by all rational observers; (2) that this objective reality is governed by natural laws; (3) that these laws can be discovered by means of systematic observation and experimentation. Philosophy of science seeks a deep understanding of what these underlying assumptions mean and whether they are valid. Most contributions to the philosophy of science have come from philosophers, who frequently view the beliefs of most scientists as superficial or naiveâ€”thus there is often a degree of antagonism between working scientists and philosophers of science.</div><div><br></div><div><p>The belief that all observers share a common reality is known as <a title="Realism" href="http://en.wikipedia.org/wiki/Realism">realism</a>. It can be contrasted with <a title="Anti-realism" href="http://en.wikipedia.org/wiki/Anti-realism">anti-realism</a>, the belief that there is no valid concept of absolute truth such that things that are true for one observer are true for all observers. The most commonly defended form of anti-realism is <a title="Idealism" href="http://en.wikipedia.org/wiki/Idealism">idealism</a>, the belief that the mind or spirit is the most basic essence, and that each mind generates its own reality.<sup id="cite_ref-14" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-14"><span>[</span>15<span>]</span></a></sup> In an idealistic world-view, what is true for one mind need not be true for other minds.</p><p>There are different schools of thought in philosophy of science. The most popular position is <a title="Empiricism" href="http://en.wikipedia.org/wiki/Empiricism">empiricism</a>, which claims that knowledge is created by a process involving observation and that scientific theories are the result of generalizations from such observations.<sup id="cite_ref-15" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-15"><span>[</span>16<span>]</span></a></sup> Empiricism generally encompasses <a title="Inductivism" href="http://en.wikipedia.org/wiki/Inductivism">inductivism</a>, a position that tries to explain the way general theories can be justified by the finite number of observations humans can make and the hence finite amount of empirical evidence available to confirm scientific theories. This is necessary because the number of predictions those theories make is infinite, which means that they cannot be known from the finite amount of evidence using <a class="mw-redirect" title="Deductive logic" href="http://en.wikipedia.org/wiki/Deductive_logic">deductive logic</a> only. Many versions of empiricism exist, with the predominant ones being <a class="mw-redirect" title="Bayesianism" href="http://en.wikipedia.org/wiki/Bayesianism">bayesianism</a><sup id="cite_ref-16" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-16"><span>[</span>17<span>]</span></a></sup> and the <a class="mw-redirect" title="Hypothetico-deductive method" href="http://en.wikipedia.org/wiki/Hypothetico-deductive_method">hypothetico-deductive method</a>.<sup id="cite_ref-17" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-17"><span>[</span>18<span>]</span></a></sup></p><p>Empiricism has stood in contrast to <a title="Rationalism" href="http://en.wikipedia.org/wiki/Rationalism">rationalism</a>, the position originally associated with <a class="mw-redirect" title="Descartes" href="http://en.wikipedia.org/wiki/Descartes">Descartes</a>, which holds that knowledge is created by the human intellect, not by observation.<sup id="cite_ref-18" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-18"><span>[</span>19<span>]</span></a></sup> A significant twentieth century version of rationalism is <a title="Critical rationalism" href="http://en.wikipedia.org/wiki/Critical_rationalism">critical rationalism</a>, first defined by Austrian-British philosopher <a title="Karl Popper" href="http://en.wikipedia.org/wiki/Karl_Popper">Karl Popper</a>. Popper rejected the way that empiricism describes the connection between theory and observation. He claimed that theories are not generated by observation, but that observation is made in the light of theories and that the only way a theory can be affected by observation is when it comes in conflict with it.<sup id="cite_ref-19" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-19"><span>[</span>20<span>]</span></a></sup> Popper proposed <a title="Falsifiability" href="http://en.wikipedia.org/wiki/Falsifiability">falsifiability</a> as the landmark of scientific theories, and <a title="Falsifiability" href="http://en.wikipedia.org/wiki/Falsifiability#Falsificationism">falsification</a> as the empirical method, to replace verifiability<sup id="cite_ref-20" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-20"><span>[</span>21<span>]</span></a></sup> and induction by purely deductive notions.<sup id="cite_ref-21" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-21"><span>[</span>22<span>]</span></a></sup> Popper further claimed that there is actually only one universal method, and that this method is not specific to science: The negative method of criticism, <a title="Trial and error" href="http://en.wikipedia.org/wiki/Trial_and_error">trial and error</a>.<sup id="cite_ref-22" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-22"><span>[</span>23<span>]</span></a></sup> It covers all products of the human mind, including science, mathematics, philosophy, and art <sup id="cite_ref-23" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-23"><span>[</span>24<span>]</span></a></sup></p><p>Another approach, <a title="Instrumentalism" href="http://en.wikipedia.org/wiki/Instrumentalism">instrumentalism</a>, colloquially termed "shut up and calculate", emphasizes the utility of theories as instruments for explaining and predicting phenomena.<sup id="cite_ref-24" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-24"><span>[</span>25<span>]</span></a></sup> It claims that scientific theories are black boxes with only their input (initial conditions) and output (predictions) being relevant. Consequences, notions and logical structure of the theories are claimed to be something that should simply be ignored and that scientists shouldn''t make a fuss about (see <a title="Interpretations of quantum mechanics" href="http://en.wikipedia.org/wiki/Interpretations_of_quantum_mechanics">interpretations of quantum mechanics</a>).</p><p>Finally, another approach often cited in debates of <a title="Scientific skepticism" href="http://en.wikipedia.org/wiki/Scientific_skepticism">scientific skepticism</a> against controversial movements like "<a class="mw-redirect" title="Scientific creationism" href="http://en.wikipedia.org/wiki/Scientific_creationism">scientific creationism</a>", is <a class="mw-redirect" title="Methodological naturalism" href="http://en.wikipedia.org/wiki/Methodological_naturalism">methodological naturalism</a>. Its main point is that a difference between natural and <a title="Supernatural" href="http://en.wikipedia.org/wiki/Supernatural">supernatural</a> explanations should be made, and that science should be restricted methodologically to natural explanations.<sup id="cite_ref-25" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-25"><span>[</span>26<span>]</span></a></sup> That the restriction is merely methodological (rather than ontological) means that science should not consider supernatural explanations itself, but should not claim them to be wrong either. Instead, supernatural explanations should be left a matter of personal belief outside the scope of science. Methodological naturalism maintains that proper science requires strict adherence to <a title="Empirical" href="http://en.wikipedia.org/wiki/Empirical">empirical</a> study and <a class="new" title="Independent verification (page does not exist)" href="http://en.wikipedia.org/w/index.php?title=Independent_verification&action=edit&redlink=1">independent verification</a> as a process for properly developing and evaluating explanations for <a title="Observation" href="http://en.wikipedia.org/wiki/Observation">observable</a> phenomena.<sup id="cite_ref-26" class="reference"><a href="http://en.wikipedia.org/wiki/Science#cite_note-26"><span>[</span>27<span>]</span></a></sup> The absence of these standards, <a class="mw-redirect" title="Appeal to authority" href="http://en.wikipedia.org/wiki/Appeal_to_authority">arguments from authority</a>, biased <a class="mw-redirect" title="Observational studies" href="http://en.wikipedia.org/wiki/Observational_studies">observational studies</a> and other common <a title="Fallacy" href="http://en.wikipedia.org/wiki/Fallacy">fallacies</a> are frequently cited by supporters of methodological naturalism as criteria for the dubious claims they criticize not to be true science.</p></div>', 0),
