(72, 390, '0', '<ol><li><span class="plaincharacterwrap break">\n                    Preheat oven to 425 degrees F (220 degrees C.)\n                </span></li><li><span class="plaincharacterwrap break">\n                    In a saucepan, combine chicken, carrots, peas, and \ncelery. Add water to cover and boil for 15 minutes. Remove from heat, \ndrain and set aside.\n                </span></li><li><span class="plaincharacterwrap break">\n                    In the saucepan over medium heat, cook onions in \nbutter until soft and translucent. Stir in flour, salt, pepper, and \ncelery seed. Slowly stir in chicken broth and milk. Simmer over \nmedium-low heat until thick. Remove from heat and set aside.\n                </span></li><li><span class="plaincharacterwrap break">\n                    Place the chicken mixture in bottom pie crust. Pour \nhot liquid mixture over. Cover with top crust, seal edges, and cut away \nexcess dough. Make several small slits in the top to allow steam to \nescape.\n                </span></li><li><span class="plaincharacterwrap break">\n                    Bake in the preheated oven for 30 to 35 minutes, or \nuntil pastry is golden brown and filling is bubbly. Cool for 10 minutes \nbefore serving.\n                </span></li></ol>', 0),
(73, 394, '0', '<span class="plaincharacterwrap break">In a large saucepan, cook bacon \nuntil crisp. Drain, reserving 1 tablespoon drippings. Set bacon aside. \nSaute onion and garlic in the drippings until tender. Stir in flour, \nsalt, basil and pepper; mix well. Gradually add broth. Bring to boil; \nboil and stir for 2 minutes. Add the potatoes, cream and hot pepper \nsauce; heat through but do not boil. Garnish with bacon, cheese and \nparsley.\n                </span>', 0),
