(75, 403, '0', '<p 0.4em="" 0px="" 0.5em;="" line-height:="" 19px;="" font-family:="" sans-serif;="" "="">Texas is the&nbsp;<a href="http://en.wikipedia.org/wiki/List_of_U.S._states_and_territories_by_area" title="List of U.S. states and territories by area">second largest</a>&nbsp;U.S. state, behind Alaska, with an area of 268,820 square miles (696,200 km<sup 1em;="" "="">2</sup>). It is 10%&nbsp;<a href="http://en.wikipedia.org/wiki/List_of_countries_by_area" title="List of countries by area" class="mw-redirect">larger than</a>&nbsp;France and almost twice as large as Germany or Japan, though it ranks only 27th worldwide amongst&nbsp;<a href="http://en.wikipedia.org/wiki/List_of_the_largest_country_subdivisions_by_area" title="List of the largest country subdivisions by area">country subdivisions by size</a>. If it were a country, Texas would be the&nbsp;<a href="http://en.wikipedia.org/wiki/List_of_countries_by_area" title="List of countries by area" class="mw-redirect">40th largest</a>&nbsp;behind&nbsp;<a href="http://en.wikipedia.org/wiki/Chile" title="Chile">Chile</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Zambia" title="Zambia">Zambia</a>.</p><p 0.4em="" 0px="" 0.5em;="" line-height:="" 19px;="" font-family:="" sans-serif;="" "="">Texas is in the&nbsp;<a href="http://en.wikipedia.org/wiki/South_Central_United_States" title="South Central United States">south-central</a>&nbsp;part of the United States of America. Three of its borders are defined by rivers. The&nbsp;<a href="http://en.wikipedia.org/wiki/Rio_Grande" title="Rio Grande">Rio Grande</a>&nbsp;river forms a natural border with the Mexican states of&nbsp;<a href="http://en.wikipedia.org/wiki/Chihuahua_(state)" title="Chihuahua (state)">Chihuahua</a>,<a href="http://en.wikipedia.org/wiki/Coahuila" title="Coahuila">Coahuila</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Nuevo_LeÃ³n" title="Nuevo LeÃ³n">Nuevo LeÃ³n</a>, and&nbsp;<a href="http://en.wikipedia.org/wiki/Tamaulipas" title="Tamaulipas">Tamaulipas</a>&nbsp;to the south. The&nbsp;<a href="http://en.wikipedia.org/wiki/Red_River_(Mississippi_watershed)" title="Red River (Mississippi watershed)" class="mw-redirect">Red River</a>&nbsp;forms a natural border with Oklahoma and Arkansas to the north. The&nbsp;<a href="http://en.wikipedia.org/wiki/Sabine_River_(Texas-Louisiana)" title="Sabine River (Texas-Louisiana)" class="mw-redirect">Sabine River</a>&nbsp;forms a natural border with Louisiana to the east. The&nbsp;<a href="http://en.wikipedia.org/wiki/Texas_Panhandle" title="Texas Panhandle">Texas Panhandle</a>&nbsp;has an eastern border with Oklahoma at&nbsp;<a href="http://en.wikipedia.org/wiki/100th_meridian_west" title="100th meridian west">100Â° W</a>, a northern border with Oklahoma at&nbsp;<a href="http://en.wikipedia.org/wiki/Parallel_36Â°30''_north" title="Parallel 36Â°30'' north" class="mw-redirect">36Â°30'' N</a>&nbsp;and a western border with New Mexico at&nbsp;<a href="http://en.wikipedia.org/wiki/103rd_meridian_west" title="103rd meridian west">103Â° W</a>.&nbsp;<a href="http://en.wikipedia.org/wiki/El_Paso" title="El Paso" class="mw-redirect">El Paso</a>&nbsp;lies on the state''s western tip at&nbsp;<a href="http://en.wikipedia.org/wiki/32nd_parallel_north" title="32nd parallel north">32Â° N</a>&nbsp;and the Rio Grande.<sup id="cite_ref-comp1850_16-0" class="reference" 1em;="" "=""><a href="http://en.wikipedia.org/wiki/Texas#cite_note-comp1850-16">[17]</a></sup></p><div class="thumb tright" right;="" float:="" margin:="" 0.5em="" 0px="" 1.3em="" 1.4em;="" width:="" auto;="" font-family:="" sans-serif;="" line-height:="" 19px;="" "=""><div class="thumbinner" 100px;="" border:="" 1px="" solid="" rgb(204,="" 204,="" 204);="" padding:="" 3px="" !important;="" background-color:="" rgb(249,="" 249,="" 249);="" font-size:="" 12px;="" text-align:="" center;="" overflow:="" hidden;="" width:="" 222px;="" "=""><a href="http://en.wikipedia.org/wiki/File:Texas_Hill_Country_187N-2.JPG" class="image"><img alt="" src="http://upload.wikimedia.org/wikipedia/commons/thumb/c/ce/Texas_Hill_Country_187N-2.JPG/220px-Texas_Hill_Country_187N-2.JPG" width="220" height="165" class="thumbimage"></a><div class="thumbcaption" none;="" line-height:="" 1.4em;="" padding:="" 3px="" !important;="" font-size:="" 11px;="" text-align:="" left;="" "=""><div class="magnify" none="" !important;="" background-image:="" float:="" right;="" background-position:="" initial="" background-repeat:="" "=""><a href="http://en.wikipedia.org/wiki/File:Texas_Hill_Country_187N-2.JPG" class="internal" title="Enlarge" none=""><img src="http://bits.wikimedia.org/static-1.20wmf3/skins/common/images/magnify-clip.png" width="15" height="11" alt="" none=""></a></div><a href="http://en.wikipedia.org/wiki/Texas_Hill_Country" title="Texas Hill Country">Hill Country</a></div></div></div><p 0.4em="" 0px="" 0.5em;="" line-height:="" 19px;="" font-family:="" sans-serif;="" "="">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; With 10&nbsp;<a href="http://en.wikipedia.org/wiki/KÃ¶ppen_climate_classification" title="KÃ¶ppen climate classification">climatic regions</a>, 14&nbsp;<a href="http://en.wikipedia.org/wiki/Agricultural_soil_science" title="Agricultural soil science">soil regions</a>, and 11 distinct&nbsp;<a href="http://en.wikipedia.org/wiki/Ecoregion" title="Ecoregion">ecological regions</a>, regional classification becomes problematic with differences in soils, topography, geology, rainfall, and plant and animal communities.<sup id="cite_ref-Tx_eco_regions_17-0" class="reference" 1em;="" "=""><a href="http://en.wikipedia.org/wiki/Texas#cite_note-Tx_eco_regions-17">[18]</a></sup>&nbsp;One classification system divides Texas, in order from southeast to west, into the following:&nbsp;<a href="http://en.wikipedia.org/wiki/Gulf_Coastal_Plains" title="Gulf Coastal Plains" class="mw-redirect">Gulf Coastal Plains</a>, Interior Lowlands,&nbsp;<a href="http://en.wikipedia.org/wiki/Great_Plains" title="Great Plains">Great Plains</a>, and Basin and Range Province. The Gulf Coastal Plains region wraps around the Gulf of Mexico on the southeast section of the state. Vegetation in this region consists of thick piney woods. The Interior Lowlands region consists of gently rolling to hilly forested land and is part of a larger pine-hardwood forest. The Great Plains region in central Texas is located in spans through the state''s&nbsp;<a href="http://en.wikipedia.org/wiki/Texas_Panhandle" title="Texas Panhandle">panhandle</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Llano_Estacado" title="Llano Estacado">Llano Estacado</a>&nbsp;to the state''s&nbsp;<a href="http://en.wikipedia.org/wiki/Texas_Hill_Country" title="Texas Hill Country">hill country</a>&nbsp;near Austin. This region is dominated by&nbsp;<a href="http://en.wikipedia.org/wiki/Prairie" title="Prairie">prairie</a>&nbsp;and&nbsp;<a href="http://en.wikipedia.org/wiki/Steppe" title="Steppe">steppe</a>. "Far West Texas" or the "<a href="http://en.wikipedia.org/wiki/Trans-Pecos" title="Trans-Pecos">Trans-Pecos</a>" region is the state''s Basin and Range Province. The most varied of the regions, this area includes Sand Hills, the Stockton Plateau, desert valleys, wooded mountain slopes and desert grasslands.</p><div class="thumb tleft" left;="" clear:="" margin-top:="" 0.5em;="" margin-right:="" 1.4em;="" margin-bottom:="" 1.3em;="" width:="" auto;="" font-family:="" sans-serif;="" line-height:="" 19px;="" "=""><div class="thumbinner" 100px;="" border:="" 1px="" solid="" rgb(204,="" 204,="" 204);="" padding:="" 3px="" !important;="" background-color:="" rgb(249,="" 249,="" 249);="" font-size:="" 12px;="" text-align:="" center;="" overflow:="" hidden;="" width:="" 222px;="" "=""><a href="http://en.wikipedia.org/wiki/File:Lake_Alan_Henry.jpg" class="image"><img alt="" src="http://upload.wikimedia.org/wikipedia/en/thumb/9/97/Lake_Alan_Henry.jpg/220px-Lake_Alan_Henry.jpg" width="220" height="169" class="thumbimage"></a><div class="thumbcaption" none;="" line-height:="" 1.4em;="" padding:="" 3px="" !important;="" font-size:="" 11px;="" text-align:="" left;="" "=""><div class="magnify" none="" !important;="" background-image:="" float:="" right;="" background-position:="" initial="" background-repeat:="" "=""><a href="http://en.wikipedia.org/wiki/File:Lake_Alan_Henry.jpg" class="internal" title="Enlarge" none=""><img src="http://bits.wikimedia.org/static-1.20wmf3/skins/common/images/magnify-clip.png" width="15" height="11" alt="" none=""></a></div>Lake Alan Henry</div></div></div><p 0.4em="" 0px="" 0.5em;="" line-height:="" 19px;="" font-family:="" sans-serif;="" "="">Texas has 3,700 named streams and 15 major rivers.<sup id="cite_ref-18" class="reference" 1em;="" "=""><a href="http://en.wikipedia.org/wiki/Texas#cite_note-18">[19]</a></sup><sup id="cite_ref-19" class="reference" 1em;="" "=""><a href="http://en.wikipedia.org/wiki/Texas#cite_note-19">[20]</a></sup>&nbsp;The largest of these rivers is the&nbsp;<a href="http://en.wikipedia.org/wiki/Rio_Grande" title="Rio Grande">Rio Grande</a>. Other major rivers include the&nbsp;<a href="http://en.wikipedia.org/wiki/Pecos_River" title="Pecos River">Pecos</a>, the<a href="http://en.wikipedia.org/wiki/Brazos_River" title="Brazos River">Brazos</a>,&nbsp;<a href="http://en.wikipedia.org/wiki/Colorado_River_(Texas)" title="Colorado River (Texas)">Colorado</a>, and&nbsp;<a href="http://en.wikipedia.org/wiki/Red_River_(Mississippi_River)" title="Red River (Mississippi River)">Red River</a>, which forms the border with Oklahoma. While Texas has few natural lakes, Texans have built over 100&nbsp;<a href="http://en.wikipedia.org/wiki/List_of_lakes_in_Texas" title="List of lakes in Texas">artificial reservoirs</a>.<sup id="cite_ref-20" class="reference" 1em;="" "=""><a href="http://en.wikipedia.org/wiki/Texas#cite_note-20">[21]</a></sup></p><p 0.4em="" 0px="" 0.5em;="" line-height:="" 19px;="" font-family:="" sans-serif;="" "="">The size and unique history of Texas make its regional affiliation debatable: it can be fairly considered a Southern or a Southwestern state, or both. The vast geographic, economic, and cultural diversity within the state itself prohibits easy categorization of the whole state into a&nbsp;<a href="http://en.wikipedia.org/wiki/List_of_regions_of_the_United_States" title="List of regions of the United States">recognized region of the United States</a>. Notable extremes range from&nbsp;<a href="http://en.wikipedia.org/wiki/East_Texas" title="East Texas">East Texas</a>&nbsp;which is often considered an extension of the&nbsp;<a href="http://en.wikipedia.org/wiki/Deep_South" title="Deep South">Deep South</a>, to&nbsp;<a href="http://en.wikipedia.org/wiki/Trans-Pecos" title="Trans-Pecos">Far West Texas</a>&nbsp;which is generally acknowledged to be part of the&nbsp;<a href="http://en.wikipedia.org/wiki/Southwestern_United_States" title="Southwestern United States">interior Southwest</a>.</p><div sans-serif;="" line-height:="" 19px;="" clear:="" both;="" "=""></div><h3 none;="" font-weight:="" bold;="" margin:="" 0px="" 0.3em;="" overflow:="" hidden;="" padding-top:="" 0.5em;="" padding-bottom:="" 0.17em;="" border-bottom-style:="" font-size:="" 17px;="" font-family:="" sans-serif;="" line-height:="" 19px;="" "=""><span class="mw-headline" id="Geology">Geology</span></h3>', 0),
