(85, 498, '0', '<span verdana,="" arial,="" helvetica,="" sans-serif;="" font-size:="" 10px;="" line-height:="" 17px;="" text-align:="" justify;="" "="">Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat. Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi. Nam liber tempor cum soluta nobis eleifend option congue nihil imperdiet doming id quod mazim placerat facer possim assum. Typi non habent claritatem insitam; est usus legentis in iis qui facit eorum claritatem. Investigationes demonstraverunt lectores legere me lius quod ii legunt saepius. Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum. Mirum est notare quam littera gothica, quam nunc putamus parum claram, anteposuerit litterarum formas humanitatis per seacula quarta decima et quinta decima. Eodem modo typi, qui nunc nobis videntur parum clari, fiant sollemnes in futurum.</span>\n', 0),
(86, 503, '0', '<p>All Hawk-Eye systems are based on the principles of <a title="Triangulation" href="http://en.wikipedia.org/wiki/Triangulation">triangulation</a> using the visual images and timing data provided by at least four high-speed <a title="Video camera" href="http://en.wikipedia.org/wiki/Video_camera">video cameras</a> located at different locations and angles around the area of play.<sup id="cite_ref-espacenet_1-1" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-espacenet-1"><span>[</span>2<span>]</span></a></sup> The system rapidly processes the video feeds by a high-speed <a title="Video camera" href="http://en.wikipedia.org/wiki/Video_camera">video camera</a> and ball tracker. A data store contains a predefined model of the playing area and includes data on the rules of the game.</p><p>In each frame sent from each camera, the system identifies the group of pixels which corresponds to the image of the ball. It then calculates for each frame the 3D position of the ball by comparing its position on at least two of the physically separate cameras at the same instant in time. A succession of frames builds up a record of the path along which the ball has travelled. It also "predicts" the future flight path of the ball and where it will interact with any of the playing area features already programmed into the database. The system can also interpret these interactions to decide infringements of the rules of the game.<sup id="cite_ref-espacenet_1-2" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-espacenet-1"><span>[</span>2<span>]</span></a></sup></p><p>The system generates a graphic image of the ball path and playing area, which means that information can be provided to judges, television viewers or coaching staff in near <a title="Real-time computing" href="http://en.wikipedia.org/wiki/Real-time_computing">real time</a>.</p><p>The pure tracking system is combined with a <a class="mw-redirect" title="Backend" href="http://en.wikipedia.org/wiki/Backend">backend</a> <a title="Database" href="http://en.wikipedia.org/wiki/Database">database</a> and archiving capabilities so that it is possible to extract and analyse trends and statistics about individual players, games, ball-to-ball comparisons, etc.</p><p><br></p><p><p>All of the technology and intellectual property was spun off into a separated company, Hawk-Eye Innovations Ltd, based in <a class="mw-redirect" title="Winchester, Hampshire" href="http://en.wikipedia.org/wiki/Winchester,_Hampshire">Winchester, Hampshire</a>.</p><p>On June 14, 2006, a group of investors led by the <a title="Wisden Group" href="http://en.wikipedia.org/wiki/Wisden_Group">Wisden Group</a> bought the company,<sup id="cite_ref-3" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-3"><span>[</span>4<span>]</span></a></sup> who included <a title="Mark Getty" href="http://en.wikipedia.org/wiki/Mark_Getty">Mark Getty</a>, a member of the wealthy USA family and business dynasty. The acquisition was intended to strengthen Wisden''s presence in cricket, and allow it to enter tennis and other international sports, with Hawk-Eye working on implementing a system for <a title="Basketball" href="http://en.wikipedia.org/wiki/Basketball">basketball</a>. According to Hawk-Eye''s website, the system produces much more data than that shown on television, which could be easily shown on the internet.</p><p>Put up for sale in September 2010, it was sold as a complete entity to <a title="Japan" href="http://en.wikipedia.org/wiki/Japan">Japanese</a> electronic giant Sony in March 2011.<sup id="cite_ref-BBC12670063_2-1" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-BBC12670063-2"><span>[</span>3<span>]</span></a></sup></p><p><br></p><p>Until March 2008, the International Tennis Federation (ITF), <a title="Association of Tennis Professionals" href="http://en.wikipedia.org/wiki/Association_of_Tennis_Professionals">Association of Tennis Professionals</a> (ATP), <a title="Women''s Tennis Association" href="http://en.wikipedia.org/wiki/Women''s_Tennis_Association">Women''s Tennis Association</a> (WTA), <a title="Grand Slam (tennis)" href="http://en.wikipedia.org/wiki/Grand_Slam_(tennis)">Grand Slam</a> Committee, and several individual tournaments had conflicting rules on how Hawk-Eye was to be utilized. A key example of this was the number of challenges a player was permitted per set, which varied among events.<sup id="cite_ref-tind1_14-0" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-tind1-14"><span>[</span>15<span>]</span></a></sup> Some tournaments allowed players a greater margin for error, with players allowed an unlimited numbers of challenges over the course of a match.<sup id="cite_ref-tind1_14-1" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-tind1-14"><span>[</span>15<span>]</span></a></sup> In other tournaments players received two or three per set.<sup id="cite_ref-tind1_14-2" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-tind1-14"><span>[</span>15<span>]</span></a></sup> On March 19, 2008, the aforementioned organizing bodies announced a uniform system of rules: three unsuccessful challenges per set, with an additional challenge if the set reaches a tiebreak. The next scheduled event on the men and women''s tour, the <a title="2008 Sony Ericsson Open" href="http://en.wikipedia.org/wiki/2008_Sony_Ericsson_Open">2008 Sony Ericsson Open</a>, was the first event to implement these new, standardized rules.<sup id="cite_ref-15" class="reference"><a href="http://en.wikipedia.org/wiki/Hawk-Eye#cite_note-15"><span>[</span>16<span>]</span></a></sup></p></p>', 0),
