(91, 538, '0', 'Creating an account on InkSmash is very simple and straight forward and can be set up in seconds.&nbsp; All you need to do is enter the following information: Username, Email, Password, confirm password, and enter the text shown on the site to make sure you are human and not a bot.&nbsp; Keep in mind when selecting the username your profile page will be located at inksmash.com/your_username.&nbsp; We recommend choosing something you are comfortable sharing with others. See the image below:<br>', 0),
(93, 544, '0', 'After filling in all the information and clicking the “Join” button you will receive an email that will contain a link to confirm sign up.&nbsp; Once you click through to that link you are all set up.&nbsp; You can now either spruce up your profile page by adding an image and a little bio about yourself or just go straight to posting.<br><br>Signup is located on the following pages:<br><br><a href="http://www.inksmash.com/">http://www.inksmash.com/</a> <br>or<br><a href="http://www.inksmash.com/user/login">http://www.inksmash.com/user/login</a><br><br>', 0),
(94, 546, '0', 'It’s really easy to create a post on InkSmash.&nbsp; First choose a topic that interests you and one that you feel comfortable speaking about.&nbsp; Next choose a suitable title for your post.&nbsp; The title is more important than you may think and it may be among the most important ways people will find your posts.&nbsp; So make sure you choose a title that you believe people may search.&nbsp; Next comes the type of post you would like to create.&nbsp; We have provided many different posts types ranging from blog posts, video posts, how to articles, local posts, and more.&nbsp; Once you’ve decided on the type of post, the category, and the title, the next step is to tag your post with some keywords that best describes your post.&nbsp; This is a very easy step that will give your post a lot of exposure through search.&nbsp; We require that you enter at least 2 tags per post but in order to give your posts more visibility you should really enter 5-10 or more as long as they relate to your post.&nbsp; Again, just like the title, make sure you use keywords that you think people may search.&nbsp; This will give you the opportunity to have more visibility.&nbsp; <br><br>Now comes the body of your post.&nbsp; We have separated the body of the posts in 7 sections called “blocks”.&nbsp; The following blocks you can add to your posts are: Paragraph, List, Image, Video, Polls, Reviews, and Amazon.&nbsp; Depending on the type of post you choose there are suggested blocks for them, although you can choose to add as many different blocks as you would like.&nbsp; You can also move the order of the blocks as you wish to customize your page.&nbsp; Once you’ve selected your blocks fill them in with your content and if you are happy with the way it looks just go ahead and publish it and share it on your social networks to start getting views.<br><br>', 0),
(95, 549, '0', 'This is where the body of your content goes.&nbsp; <b>Don''t forgot to hit save when your are finished entering your content.&nbsp; </b><br>', 0),
(96, 555, '0', 'Your profile page is basically your identity on InkSmash.&nbsp; We recommend you upload a picture and tell other users a little bit about yourself.&nbsp; We feel that putting a face and a description of you always helps in generating more followers.&nbsp; Here you will find a list of all the great posts you have created and all the posts you have marked as your favorites.&nbsp; This page is also your unique destination on InkSmash.&nbsp; The address of your profile page will always be inksmash.com/your_username.&nbsp; So choose something you like and don’t change it too often because this will change the location of your posts and will make it hard for others to find you again. This is also the page that advertisers (Google AdSense) will find you on when applying to those accounts in order to make money on your posts.&nbsp; <br><br><img src="uploads/post/paragraph-images/409918192721088.jpg" width="680"><br>', 0),
(97, 558, '0', 'The user dashboard is what you will see as soon as you login.&nbsp; This dashboard is unique to you and your experience on InkSmash.&nbsp; Here you will be able to do and see various things like creating a post, to viewing the amount of hits your posts have gotten, to viewing the posts of the authors you are following, and much more.&nbsp; In this section we will go through what each section is about and what it means to you.<br>Create a post:&nbsp; Just click this button to get started on creating a post.&nbsp; Create a post in various post types and categories.<br><br><br><b><u>View All Categories:</u></b>&nbsp; This section shows you a list of all the current categories that InkSmash currently has.&nbsp; Browse through your favorite categories to view some posts or just get some inspiration from others on your next great post.<br><br><br><br><b>My Area</b><br><u><b>My Feeds:</b></u>&nbsp; My Feeds shows you posts within “Network feeds” and “Local feeds”.&nbsp; Network feeds are posts from people that you are following and local feeds are posts from within the local are you are in.&nbsp; Note: in order to see posts from others in this section you will have to start following other members and/or enter your zip code in the “Account Settings &amp; Privacy” section.<br><br><br><br><b><u>My Posts:</u></b>&nbsp; Here you will be able to see all the posts that you have created, the status of each post, statistics on how many visitors you have gotten, and when the post was lasts edited.&nbsp; You can also manage your posts in this section by editing, publishing, un-publishing or deleting posts.&nbsp; <br><br><br><br><b><u>My Favorites:</u></b>&nbsp; This section will have a list of posts that you have marked as “My Favorite” whether it’s one of yours or from a fellow inker you are following.&nbsp; Other members will also be able to see your favorite posts in your profile page.&nbsp; <br><br><br><br><u><b>My Earnings:</b></u>&nbsp; This is the section that allows you to get paid for publishing and sharing your content.&nbsp; When you sign up for a Google AdSense account or an Amazon Associates account this is where your ID code goes.&nbsp; Once you have been approved for either one or both these accounts they will provide you with a unique ID number.&nbsp; Take that ID, plug it into the earnings section and that’s it.&nbsp; You’re ready to start making some money!!<br><br><br><br><u><b>Following:</b></u>&nbsp; On InkSmash you can follow and be followed.&nbsp; In the section under “People You Follow” and “People Following You” you can see the other InkSmash members following your posts, and see the members you are following.&nbsp; Following members allows you to see their posts in your “My Feeds” section and allows others to see your posts once they follow you.&nbsp; So go ahead, build an audience, be followed, and follow others.&nbsp; It’s ok to stalk people on InkSmash.&nbsp; <br><br><br><br><u><b>Messages:</b></u>&nbsp; In This section we’ve built a messaging and mail system so you can better interact with the members and community on InkSmash.&nbsp; Here you can send them private messages, receive messages, and interact with others just like you would on email.<br><br><br><br><u><b>My Profile:</b></u>&nbsp; Your profile page is basically your identity on InkSmash.&nbsp; We recommend you upload a picture and tell other users a little bit about yourself.&nbsp; We feel that putting a face and a description of you always helps in generating more followers.&nbsp; Here you will find a list of all the great posts you have created and all the posts you have marked as your favorites.&nbsp; This page is also your unique destination on InkSmash.&nbsp; The address of your profile page will always be inksmash.com/your_username.&nbsp; So choose something you like and don’t change it too often because this will change the location of your posts and will make it hard for others to find you again. This is also the page that advertisers (Google AdSense) will find you on when applying to those accounts in order to make money on your posts.&nbsp; <br><br><br><br><u><b>Account Settings &amp; Privacy:</b></u>&nbsp; Visit this section to make any changes to your account settings including: email, password, basic info, profile pic, and other account related items.<br><br>', 0),
(98, 561, '0', 'At InkSmash there is nothing more important to us than our authors and content providers.&nbsp; To show how much they mean to us we provide the authors a majority of the ad space on each post they create.&nbsp; What does that mean?&nbsp; That means that 70% of the time the authors Google AdSense or Amazon Associates code will bring up the ads, and the other 30% of the time our code will bring up the ads.&nbsp; This basically means that 70% of the revenue generated from ads will go to the author that created the post and the other 30% will go the site.&nbsp; In order to get paid from these advertisers you will need to sign up for a Google Adsense account and an Amazon Affiliate account and plug in the unique identifier in the InkSmash earnings section.&nbsp; Signing up is easy and we will show you step by step instructions in this section.&nbsp;&nbsp;&nbsp; <br><br><br><u><b>How to Make Money on InkSmash</b></u><br>Get paid on the posts you create.&nbsp; Currently we have two ways of getting our members paid for the posts they create.&nbsp; We know that our site wouldn’t have any posts without its members so we thought it was important to provide most of the revenue share to you, the inker.&nbsp; Here’s how it works: first you will need to sign up for a Google Adsense account.&nbsp; We will show you how.&nbsp; Adsense will provide you with a unique code for your account.&nbsp;&nbsp; Just plug that code into the earnings section when you log in and presto!! You’re ready to get paid.&nbsp; Each page you create will have dedicated areas for targeted Google ads based on your topic.&nbsp; Google ads with your unique code will show up 70% of the time and our ads with our code will show up 30% of the time.&nbsp; <br><br><br>Amazon ads work very similar except you’re in charge of the products you display.&nbsp; Using the Amazon “block” can also be the most effective way to increase your earnings.&nbsp; Here’s how it works.&nbsp; Sign up for an Amazon Affiliate account and once you receive your unique code just plug it into the earnings section of InkSmash.com.&nbsp; While creating your post add the Amazon block to your posts and refer to any product on Amazon that relates to your post.&nbsp; With over 100 million products currently selling on Amazon it shouldn’t be difficult to link to a product that relates to your article or post.&nbsp; Once someone clicks through the Amazon link and buys something you will get a commission for that sale 70% of the time and InkSmash will get the commission for it 30% of the time.&nbsp; It’s really that simple.&nbsp; <br><br>We will show step by step instructions on how to sign up for Google AdSense and Amazon Associates in the section below.&nbsp; <br><br><br><br>', 0),
(99, 563, '0', '<u><b>Signing up for AdSense:</b></u><br><br>Signing up for AdSense is easy.&nbsp; This section will give you step by step instructions on how to sign up.&nbsp; You first need to create one article or post before signing up for AdSense.&nbsp; Without creating a post Google will not be able to see where your ads will be located and might not approve your account.&nbsp; After you have written and published your first article go to the following page to apply for the AdSense account https://www.google.com/adsense note: if you already have an Adsense account DO NOT apply for another one.&nbsp; Just plug in your code in the earning section of InkSmash.&nbsp; It will look like the following: pub-xxxxxxxxxxxxxx and is located on the top right hand side of the page when you login to your AdSense account.&nbsp; Include the “pub-“ when providing us with the account number.&nbsp; <br><br>If you are new to AdSense click on the “Sign Up Now” button on the top right.<br><br><img src="uploads/post/paragraph-images/456382838541910.jpg" width="680"><br><br><br><br>Once you’ve hit the sign up button you will be prompted to use a Google account you already have or sign up for a new one if you don’t already have a Google account.&nbsp; <br><br>The next step is very important.&nbsp; In the field where it asks “I will show ads on” be sure to include your username in the url as shown in the image below.&nbsp; For example: www.inksmash.com/your_username.&nbsp; This step is very important and lets Google know where your ads will display.&nbsp; If you forget to add your username in the url you provide you will not be approved for the AdSense account.&nbsp; <br><br>For “Content Language” choose “English-English”.&nbsp; Read and accept the program policies and hit continue.<br><br><img src="uploads/post/paragraph-images/831896067345663.jpg" width="680"><br><br><br><br><br><br>In the next and final step you just have to add your personal information.&nbsp; One important field here is to choose the “Individual Account”.&nbsp; DO NOT choose business account otherwise your application might not get approved.&nbsp; Once you’ve entered all your information simply submit the application for Google to review.&nbsp; Google might take up to one week to review the application but can reply in as little as a day.&nbsp; Please see the image below:<br><br><img src="uploads/post/paragraph-images/795503288765398.jpg" width="680"><br><br><br>Once Google has approved your account, log in and find your “Publisher ID” (located on the top right hand side of the page) so you can plug it into InkSmash and start getting paid.&nbsp; You can find this number on top as soon as you sign in.&nbsp; It will have “pub- and 16 digits.&nbsp; It will look like the following: pub-xxxxxxxxxxxxxx.&nbsp; When entering the Publisher ID in the earnings section on InkSmash make sure to enter the “pub-“ as well as all the digits.&nbsp; This does <u><b>NOT</b></u> allow us access to your account.&nbsp; We will <b><u>never</u></b> ask you for your Google AdSense password and you should never provide it to anyone.&nbsp; This code simply lets us display ads on InkSmash on your behalf.&nbsp; <br><br><br>That’s it.&nbsp; You’re ready to get paid. <br><br><b>note: until Google fully approves your account you may see some blank\n ad spaces on your posts.&nbsp; This is normal.&nbsp; Once your account is fully \nverified those blank spaces will be filled with Google ads.</b><br><br>', 0);
INSERT INTO `paragraph` (`paragraph_id`, `capsule_id`, `title`, `value`, `weight`) VALUES
(100, 564, '0', '<u><b>Signing Up For Amazon Associates:</b></u><br><br>If you already have an Amazon affiliate account all you need to do is plug in your account ID in the Earnings section of InkSmash.&nbsp; Your account ID is located on the top left hand side of the page when you login to your Amazon Associates account.&nbsp; It’s an 8 character code that usually ends in “-20”.&nbsp; Include the “-20” when providing the code to us.&nbsp; <br><br>If you don’t have one, signing up is very easy.&nbsp; <br><br>First go to the following link: https://affiliate-program.amazon.com/<br><br><br>On the top right click the button that says “Join Now for Free” and sign into your existing Amazon account or create one if you don’t already have one.&nbsp; <br><br><img src="uploads/post/paragraph-images/864338339164633.jpg" width="680"><br><br><br>After signing in, select the payee information of who you want the payments to go to and click the button at the bottom that says: “Next: Your Website Profile”.<br><br>You will then get to a page that looks like the following:<br><br><img src="uploads/post/paragraph-images/297997690337607.jpg" width="680"><br><br><br><br>Above we have numbered each field and will now show you how to answer each one.<br><br>1.&nbsp;&nbsp;&nbsp; The name of the website you should use: InkSmash<br><br>2.&nbsp;&nbsp;&nbsp; Make sure to enter your username in the url for example: www.inksmash.com/your_username Note: make sure the link you enter actually goes to your profile page.&nbsp; This is how Amazon will verify your account.<br><br>3.&nbsp;&nbsp;&nbsp; “What your Website is about” – here you can write a brief description that this is a blogging and content sharing website that you will provide content to.&nbsp; <br><br>4.&nbsp;&nbsp;&nbsp; Select which topics best describe what you will write about or share on InkSmash.&nbsp; You may select more than one topic.<br><br>5.&nbsp;&nbsp;&nbsp; Select which categories will best describe your writings.&nbsp; You can select more than one category.<br><br>6.&nbsp;&nbsp;&nbsp; Select “content or niche website”<br><br>7.&nbsp;&nbsp;&nbsp; Select SEO<br><br>8.&nbsp;&nbsp;&nbsp; Select “Contextual Advertising e.g. Google AdSense”<br><br>9.&nbsp;&nbsp;&nbsp; Select “Content Management System”<br><br>10.&nbsp;&nbsp;&nbsp; If you are new to InkSmash select “less than 500”<br><br>11.&nbsp;&nbsp;&nbsp; Select “To monetize my site”<br><br>12.&nbsp;&nbsp;&nbsp; Select “Word of mouth”<br><br>13.&nbsp;&nbsp;&nbsp; Read the contract terms and check the box to agree<br><br>14.&nbsp;&nbsp;&nbsp; Enter the characters in the box to prove you are a human and click finish.<br><br><br><br>Once you hit finish you will get immediate access to the Amazon Affiliate site right away while they review your application.&nbsp; <br><br>When you log in you will see a Tracking ID at the top left of the screen.&nbsp; Enter that tracking ID as you see it in the Earnings section of InkSmash.&nbsp; See the image below for reference.&nbsp; Now you’re all set to get paid on referrals you send to Amazon.&nbsp; <br><br><br><img src="uploads/post/paragraph-images/629805067318195.jpg" width="200"><br><br><br>That''s it!! Now all that''s left is to create some awesome posts, share with the world, have fun, and even make some money!!<br><br>', 0),
(101, 566, '0', '<p>Early Western travelers, whether to <a class="mw-redirect" title="Persian Empire" href="http://en.wikipedia.org/wiki/Persian_Empire">Persia</a>, <a title="Turkey" href="http://en.wikipedia.org/wiki/Turkey">Turkey</a> or <a title="China" href="http://en.wikipedia.org/wiki/China">China</a> frequently remark on the absence of changes in fashion there, and observers from these other cultures comment on the unseemly pace of Western fashion, which many felt suggested an instability and lack of order in Western culture. The Japanese <a title="Shogun" href="http://en.wikipedia.org/wiki/Shogun">Shogun</a>''s secretary boasted (not completely accurately) to a Spanish visitor in 1609 that <a title="Japanese clothing" href="http://en.wikipedia.org/wiki/Japanese_clothing">Japanese clothing</a> had not changed in over a thousand years.<sup id="cite_ref-2" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-2"><span>[</span>3<span>]</span></a></sup> However in <a title="Ming Dynasty" href="http://en.wikipedia.org/wiki/Ming_Dynasty">Ming China</a>, for example, there is considerable evidence for rapidly changing fashions in <a title="Han Chinese clothing" href="http://en.wikipedia.org/wiki/Han_Chinese_clothing">Chinese clothing</a>.<sup id="cite_ref-3" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-3"><span>[</span>4<span>]</span></a></sup> Changes in costume often took place at times of economic or social change (such as in <a title="Ancient Rome" href="http://en.wikipedia.org/wiki/Ancient_Rome">ancient Rome</a> and the medieval <a title="Caliphate" href="http://en.wikipedia.org/wiki/Caliphate">Caliphate</a>), but then a long period without major changes followed by a long period without any major changes until the advent of new technology. For example, the invention of the sewing machine made mass production possible, increasing the ease with which clothing could be produced and lowering the costs to do so. This, in turn, spurned economic changes. This occurred in <a class="mw-redirect" title="Moorish Spain" href="http://en.wikipedia.org/wiki/Moorish_Spain">Moorish Spain</a> during the 8th century, when the famous musician <a title="Ziryab" href="http://en.wikipedia.org/wiki/Ziryab">Ziryab</a> introduced <a title="Sophistication" href="http://en.wikipedia.org/wiki/Sophistication">sophisticated</a> clothing-styles based on seasonal and daily timings from his native <a title="Baghdad" href="http://en.wikipedia.org/wiki/Baghdad">Baghdad</a> and his own inspiration to <a class="mw-redirect" title="Córdoba, Spain" href="http://en.wikipedia.org/wiki/Córdoba,_Spain">Córdoba</a> in <a title="Al-Andalus" href="http://en.wikipedia.org/wiki/Al-Andalus">Al-Andalus</a>.<sup id="cite_ref-4" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-4"><span>[</span>5<span>]</span></a></sup><sup id="cite_ref-5" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-5"><span>[</span>6<span>]</span></a></sup> Ziryab inspired the dress of Men and women, and some people even say the way they decorated their house. Men who used to wear their hair long and parted, now wore it up and a crown around it. The dress of men changed as well, in the spring they wore bright colors, loose garments for the summer, and fur hats for winter. However, the men were not the only ones inspired by this fashion, the women wore scarves which had lyrics embroidered on them. One can see how Ziryab truly made an impact and touched the hearts in Spain, and how the people aspire to dress and be like him. Similar changes in fashion occurred in the Middle East from the 11th century, following the arrival of the <a title="Turkic peoples" href="http://en.wikipedia.org/wiki/Turkic_peoples">Turks</a>, who introduced clothing styles from <a title="Central Asia" href="http://en.wikipedia.org/wiki/Central_Asia">Central Asia</a> and the <a title="Far East" href="http://en.wikipedia.org/wiki/Far_East">Far East</a>.<sup id="cite_ref-6" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-6"><span>[</span>7<span>]</span></a></sup></p><p>The beginnings of the habit in Europe of continual and increasingly rapid change in clothing styles can be fairly reliably dated to the middle of the <a title="1300–1400 in fashion" href="http://en.wikipedia.org/wiki/1300–1400_in_fashion">14th century</a>, to which historians including <a title="James Laver" href="http://en.wikipedia.org/wiki/James_Laver">James Laver</a> and <a title="Fernand Braudel" href="http://en.wikipedia.org/wiki/Fernand_Braudel">Fernand Braudel</a> date the start of Western fashion in clothing.<sup id="cite_ref-7" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-7"><span>[</span>8<span>]</span></a></sup><sup id="cite_ref-braudel_8-0" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-braudel-8"><span>[</span>9<span>]</span></a></sup> The 14th century was a period in which the distinction between the sexes was starting to come into effect. Some of the clothing has changed from garments held by string, to the upgrade of buttons. At this period one can see how the traditional style is slowing turning more modern. Many people during this time wore the big garments, and pointed shoes, but realized that they wanted more self-refined flattering tighter clothing. The most dramatic manifestation was a sudden drastic shortening and tightening of the male over-garment, from <a title="Calf (anatomy)" href="http://en.wikipedia.org/wiki/Calf_(anatomy)">calf</a>-length to barely covering the <a title="Buttocks" href="http://en.wikipedia.org/wiki/Buttocks">buttocks</a>, sometimes accompanied with stuffing on the chest to look bigger. This created the distinctive Western male outline of a tailored top worn over leggings or trousers.</p><p>The pace of change accelerated considerably in the following century, and women and men''s fashion, especially in the dressing and adorning of the hair, became equally complex and changing. <a title="Art history" href="http://en.wikipedia.org/wiki/Art_history">Art historians</a> are therefore able to use fashion in dating images with increasing confidence and precision, often within five years in the case of 15th century images. Initially changes in fashion led to a fragmentation of what had previously been very similar styles of dressing across the upper classes of Europe, and the development of distinctive national styles. These remained very different until a counter-movement in the 17th to 18th centuries imposed similar styles once again, mostly originating from <a title="Ancien Régime" href="http://en.wikipedia.org/wiki/Ancien_Régime">Ancien Régime</a> <a title="France" href="http://en.wikipedia.org/wiki/France">France</a>.<sup id="cite_ref-9" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-9"><span>[</span>10<span>]</span></a></sup> Though the rich usually led fashion, the increasing affluence of <a title="Early modern Europe" href="http://en.wikipedia.org/wiki/Early_modern_Europe">early modern Europe</a> led to the <a title="Bourgeoisie" href="http://en.wikipedia.org/wiki/Bourgeoisie">bourgeoisie</a> and even <a title="Peasant" href="http://en.wikipedia.org/wiki/Peasant">peasants</a> following trends at a distance sometimes uncomfortably close for the elites—a factor Braudel regards as one of the main motors of changing fashion.<sup id="cite_ref-10" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-10"></a></sup></p><p>Ten 16th century portraits of <a title="Germany" href="http://en.wikipedia.org/wiki/Germany">German</a> or <a title="Italy" href="http://en.wikipedia.org/wiki/Italy">Italian</a> gentlemen may show ten entirely different hats, and at this period national differences were at their most pronounced, as <a title="Albrecht Dürer" href="http://en.wikipedia.org/wiki/Albrecht_Dürer">Albrecht Dürer</a> recorded in his actual or composite contrast of <a title="Nuremberg" href="http://en.wikipedia.org/wiki/Nuremberg">Nuremberg</a> and <a title="Venice" href="http://en.wikipedia.org/wiki/Venice">Venetian</a> fashions at the close of the 15th century (<i>illustration, right</i>). The "Spanish style" of the end of the century began the move back to synchronicity among upper-class Europeans, and after a struggle in the mid 17th century, French styles decisively took over leadership, a process completed in the 18th century.<sup id="cite_ref-11" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-11"></a></sup></p><p>Though colors and patterns of textiles changed from year to year,<sup id="cite_ref-12" class="reference"><a href="http://en.wikipedia.org/wiki/Fashion#cite_note-12"><span>[</span>13<span>]</span></a></sup> the cut of a gentleman''s coat and the length of his waistcoat, or the pattern to which a lady''s dress was cut changed more slowly. Men''s fashions largely derived from <a title="Military" href="http://en.wikipedia.org/wiki/Military">military</a> models, and changes in a European male silhouette are galvanized in theatres of European war, where gentleman officers had opportunities to make notes of foreign styles: an example is the "Steinkirk" <a title="Cravat" href="http://en.wikipedia.org/wiki/Cravat">cravat</a> or <a title="Necktie" href="http://en.wikipedia.org/wiki/Necktie">necktie</a>.</p>', 0),
(102, 552, '0', '<div class="ingredients"  10px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Verdana, Arial, sans-serif; font-size: 11px; text-align: left; "><h3  0px 0px 10px; padding: 0px; border: 0px; outline: 0px; color: rgb(122, 122, 122); font-size: 14px; ">This is my favorite recipe!&nbsp;</h3><h3  0px 0px 10px; padding: 0px; border: 0px; outline: 0px; color: rgb(122, 122, 122); font-size: 14px; "><br></h3><h3  0px 0px 10px; padding: 0px; border: 0px; outline: 0px; color: rgb(122, 122, 122); font-size: 14px; ">Ingredients</h3><ul  0px; padding: 0px; border: 0px; outline: 0px; list-style: none; "><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">2 cups sliced onions</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">2 cups ketchup</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">2 cups water</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">4 teaspoons&nbsp;salt</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">1/4 cup Worcestershire sauce</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">1/2 cup white vinegar</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">1/2 cup dark&nbsp;brown sugar</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">4 teaspoons dry mustard</li><li class="plaincharacterwrap ingredient"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; line-height: 16px; ">4 pounds pork spareribs</li></ul></div><div  20px; border-width: 1px 0px 0px; border-top-style: dotted; border-top-color: rgb(204, 204, 204); outline: 0px; color: rgb(102, 102, 102); font-family: Verdana, Arial, sans-serif; font-size: 11px; text-align: left; width: 300px; "></div><div class="directions"  10px; border: 0px; outline: 0px; color: rgb(102, 102, 102); font-family: Verdana, Arial, sans-serif; font-size: 11px; text-align: left; "><h3  0px 0px 10px; padding: 0px; border: 0px; outline: 0px; color: rgb(122, 122, 122); font-size: 14px; ">Directions</h3><ol  0px 0px 0px 16px; padding: 0px 0px 0px 16px; border: 0px; outline: 0px; list-style-position: initial; list-style-image: initial; "><li  0px; padding: 0px; border: 0px; outline: 0px; line-height: 16px; "><span class="plaincharacterwrap break"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; ">Preheat oven to 350 degrees F (175 degrees C).</span></li><li  0px; padding: 0px; border: 0px; outline: 0px; line-height: 16px; "><span class="plaincharacterwrap break"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; ">In a large bowl, combine onions, ketchup, water, salt, Worcestershire sauce, vinegar and mustard. Split ribs down the center between the bones.</span></li><li  0px; padding: 0px; border: 0px; outline: 0px; line-height: 16px; "><span class="plaincharacterwrap break"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; ">Heat a large lightly oiled skillet over medium-high heat. Add ribs and sear until browned. This may have to be done in several batches.</span></li><li  0px; padding: 0px; border: 0px; outline: 0px; line-height: 16px; "><span class="plaincharacterwrap break"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; ">Place ribs in a single layer in two baking pans or casserole dishes. Pour half of the sauce over the ribs, reserve remainder.</span></li><li  0px; padding: 0px; border: 0px; outline: 0px; line-height: 16px; "><span class="plaincharacterwrap break"  0px; padding: 0px; border: 0px; outline: 0px; word-wrap: break-word; overflow: hidden; ">Bake ribs in preheated oven for 3 hours. Turn and baste meat every twenty minutes with remaining sauce, using all sauce by two hours. Continue turning and basting ribs using sauce in the pan during the last hour of baking.</span></li></ol></div>', 0),
(103, 532, '0', '<img src="https://s3.amazonaws.com/ink-staging/uploads/post/paragraph-images/101133857858574.jpg" width="50"><br><br><p><strong>Admin Page Notes</strong></p>\n\n<p><strong>Add Product Section:</strong></p>\n\n<p><a>- \nWe need to add a field “Add New” straight from\nthe drop down section in Category, Sub-Category, Name, Size, and Unit. (e.g. we need the ability to create a new\n“category” quickly from the drop down by clicking “add new”). </a><a href="#_msocom_1">[a1]</a></p>\n\n<p><a>- \nOn Name, Size, Unit we want to have this\nstandardized therefore we need drop down choices instead of just typing in the\ndata so we can manage the inputs</a><a href="#_msocom_2">[a2]</a>.\n</p>\n\n<p><strong>Store Page:</strong></p>\n\n<p>- \n<a>Can we make a\nbutton called “Import” where we can import a store list from an excel file?</a><a href="#_msocom_3">[a3]</a></p>\n\n<p><a>- \nThe search bar does not work. We need this to be\nfunctional</a><a href="#_msocom_4">[a4]</a>.\nIT needs to be work for more than just store name. I should be able to search any\nof the column headers in the search bar. This should be true for the Product\nSection as well</p>\n\n<p>- \nPlease add Column before “Action” that says “Flag Status” to show which\nstores are flagged. We Are going\nto be removing this</p>\n\n<p>- \nThe “Add New Store” button we need to also\ninclude the following fields</p>\n\n<p><a>o \nStore Category (Drop Down menu with “Add New”\nfeature to add new categories</a><a href="#_msocom_5">[a5]</a></p>\n\n\n\n\n\n\n\n\n\n<a></a>\n\n<p> <a href="#_msoanchor_1">[a1]</a>Additional\nScope</p>\n\n\n\n\n\n\n\n<a></a>\n\n<p> <a href="#_msoanchor_2">[a2]</a>Please\nexplain do you have some prescribed list or do you want to have a list and\nstill be enable to add another value</p>\n\n\n\n\n\n\n\n<a></a>\n\n<p> <a href="#_msoanchor_3">[a3]</a>Additional\nScope</p>\n\n\n\n\n\n\n\n<a></a>\n\n<p> <a href="#_msoanchor_4">[a4]</a>It\nis working for store name kindly retest</p>\n\n\n\n\n\n\n\n<a></a>\n\n<p> <a href="#_msoanchor_5">[a5]</a>Additional\nScope</p>\n\n\n\n\n\n<br>&lt;!--[if gte mso 9]>&lt;xml&gt;\n \n  Normal\n  0\n  \n  \n  \n  \n  false\n  false\n  false\n  \n  EN-US\n  X-NONE\n  X-NONE\n  \n   \n   \n   \n   \n   \n   \n   \n   \n   \n   \n   \n  \n  MicrosoftInternetExplorer4\n  \n   \n   \n   \n   \n   \n   \n   \n   \n   \n   \n   \n  \n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 9]>&lt;xml&gt;\n \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n \n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]>\n&lt;style&gt;\n /* Style Definitions */\n table.MsoNormalTable\n {mso-style-name:"Table Normal";\n mso-tstyle-rowband-size:0;\n mso-tstyle-colband-size:0;\n mso-style-noshow:yes;\n mso-style-priority:99;\n mso-style-qformat:yes;\n mso-style-parent:"";\n mso-padding-alt:0in 5.4pt 0in 5.4pt;\n mso-para-margin-top:0in;\n mso-para-margin-right:0in;\n mso-para-margin-bottom:10.0pt;\n mso-para-margin-left:0in;\n line-height:115%;\n mso-pagination:widow-orphan;\n font-size:11.0pt;\n font-family:"Calibri","sans-serif";\n mso-ascii-font-family:Calibri;\n mso-ascii-theme-font:minor-latin;\n mso-hansi-font-family:Calibri;\n mso-hansi-theme-font:minor-latin;\n mso-bidi-font-family:"Times New Roman";\n mso-bidi-theme-font:minor-bidi;}\n&lt;/style&gt;\n\n   <p class="MsoNormal" \n   mso-element-wrap:around;mso-element-anchor-vertical:page;mso-element-anchor-horizontal:\n   page;mso-element-top:top;mso-height-rule:exactly" /p\n   /td\n   td \n    solid white .5pt;mso-border-left-themecolor:background1;background:#943634;\n    mso-background-themecolor:accent2;mso-background-themeshade:191;padding:\n    0in 5.4pt 0in 5.4pt;height:1.0in" valign="bottom" width="168">\n    <p class="MsoNoSpacing" \n    9.35pt;mso-element-wrap:around;mso-element-anchor-vertical:page;mso-element-anchor-horizontal:\n    page;mso-element-top:top;mso-height-rule:exactly"bspan \n    major-latin;mso-fareast-font-family:"Times New Roman";mso-fareast-theme-font:\n    major-fareast;mso-hansi-theme-font:major-latin;mso-bidi-font-family:"Times New Roman";\n    mso-bidi-theme-font:major-bidi;color:white;mso-themecolor:background1">[Year]</b></p>\n    \n   \n  \n   </p>\n   \n   \n  <b>Type the document title\n    <p class="MsoNoSpacing" \n    9.35pt;mso-element-wrap:around;mso-element-anchor-horizontal:margin;\n    mso-element-left:center;mso-element-top:bottom;mso-height-rule:exactly"span \n    the abstract of the document here. The abstract is typically a short\n    summary of the contents of the document. Type the abstract of the document\n    here. The abstract is typically a short summary of the contents of the\n    document.]/span/p\n    /td\n   \n  /tr\n /tbody/table\n p class="MsoNormal" /p\n span \n mso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\n minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:"Times New Roman";\n mso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\n EN-US;mso-bidi-language:AR-SA">--&gt;', 0),
(104, 572, '0', 'Post type is the very first step in creating your post.&nbsp; There a number of different posts types to choose from depending on what your post is about.&nbsp; We will go through each one in this section.&nbsp; <br><br><u><b><br>News Post:</b></u>&nbsp; News Post is best used for a local writing or post about something that is going on in your local area.&nbsp; Imagine being your own local news reporter for your town.&nbsp; Discuss the local happenings around you, new places that are opening, events that are being hosted in your town or city and more.&nbsp; News posts can also be used for news that’s going on around the country and the world.&nbsp; This post type does not have to just be limited to local listings.&nbsp; <br><br><u><b><br>Recipe:</b></u>&nbsp; Have you just created something new and amazing in the kitchen that you must share with the world?&nbsp; Share it here.&nbsp; Share the ingredients and instructions on how to make your awesome dish.&nbsp; People can also comment on your dish, pastry, drink, or whatever it else it might be that you have shared.&nbsp; Now you can really find out what others think about your recipe and discuss.&nbsp; <br><br><u><b><br>Ask a Question:</b></u>&nbsp; Ask a question about anything you want and let the InkSmash community answer for you.&nbsp; It could be anything from what Madonna’s real name is to how you convert from Celsius to Fahrenheit.&nbsp; Ask questions and answer them.&nbsp; Help and be helped.&nbsp; <br><br><u><b><br>Blog Post:</b></u>&nbsp; A blog post can be about anything.&nbsp; It can be any general information that you have about a topic of your choosing.&nbsp; You want to talk about why you think the Knicks lost last night, or what you think great parenting is all about then blog about it.&nbsp; Tell the world what you think.&nbsp; <br><br><u><b><br>Reviews/Reports:</b></u>&nbsp; Reviews and Reports can be about anything from products you own, restaurants you’ve been to or really anything you have an opinion about.&nbsp; You can rate your experiences here and tell the world what you think.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><br><u><b><br>How to:</b></u>&nbsp; In this section you can write a “how to” or a DIY (do it yourself) about any topic that interests you.&nbsp; It could be anything from how to tie your shoelaces, to how make the most unique wedding favors, to how to install kitchen cabinets.&nbsp; The options are endless.&nbsp; People are always searching the internet on how to do things on their own.&nbsp; Find a topic that interests you and one that you know a great deal about and tell others how they can do it themselves.&nbsp;&nbsp;&nbsp;&nbsp; <br><br><u><b><br>Video Blog:</b></u>&nbsp; InkSmash is not just for writers.&nbsp; If you have a passion for something and writing is just not your thing, then just post a video about it.&nbsp; As videos get more and more popular on the internet this may be your best way to connect with people about the topics that you are passionate about.&nbsp; Instead of writing about a certain topic, create your own video of yourself speaking to your audience.&nbsp; If you want to just stick to videos, go for it!&nbsp; If you want to take it a step further you can also create a post with a video and write about it all within the same post.&nbsp; The creative freedom is yours.&nbsp; <br><br><u><b><br>Image Gallery:</b></u>&nbsp; As they say, pictures paint a thousand words.&nbsp; The Image Gallery section can used to illustrate an event, place you visited, cars you love, your favorite wedding dresses, or anything that interests you.&nbsp; Have the pictures tell your story.&nbsp; You can add a short description to your complete set of images to tell your audience what your image gallery is about.&nbsp; <br><br><br><u><b>Polls:</b></u>&nbsp; Want to know how the InkSmash community feels about a certain subject?&nbsp; Just poll them.&nbsp; Create a poll on any topic you want.&nbsp; Poll results are kept anonymous so poll them about all those taboo subjects we’re not allowed to speak of like religion and politics.&nbsp; Or just poll them about more important subjects like “Do you squeeze your toothpaste bottle from the bottom or the middle?”<br><br><br>Go ahead, choose the one that best suites your post and start inking today.&nbsp; <br>', 0),
(105, 575, '0', 'Signing up for AdSense is easy.&nbsp; This section will give you step by step instructions on how to sign up.&nbsp; You first need to create one article before signing up for AdSense.&nbsp; Without creating a post Google will not be able to see where your ads will be located and will not be able to verify your account for approval.&nbsp; <br><br>After you have written and published your first article go to the following page to apply for the AdSense account http://www.google.com/adsense <br><br>note: if you already have an Adsense account DO NOT apply for another one.&nbsp; Just plug in your code in the earning section of InkSmash.&nbsp; It will look like the following: pub-xxxxxxxxxxxxxx and is located on the top right hand side of the page when you login to your AdSense account.&nbsp; Include the “pub-“ when providing us with the account number.&nbsp; <br><br>If you are new to AdSense click on the “Sign Up Now” button on the top right.<br><br><img src="uploads/post/paragraph-images/219970928212073.jpg" width="680"><br><br><br><br>Once you’ve hit the sign up button you will be prompted to use a Google account you already have or sign up for a new one if you don’t already have a Google account.&nbsp; <br><br>The next step is very important.&nbsp; In the field where it asks “I will show ads on” be sure to include your username in the url as shown in the image below.&nbsp; For example: www.inksmash.com/your_username.&nbsp; This step is very important and lets Google know where your ads will display.&nbsp; If you forget to add your username in the url you provide you will not be approved for the AdSense account.&nbsp; <br><br>For “Content Language” choose “English-English”.&nbsp; Read and accept the program policies and hit continue.<br><br><img src="uploads/post/paragraph-images/258055471627375.jpg" width="680"><br><br><br><br><br>In the next and final step you just have to add your personal information.&nbsp; One important field here is to choose the “Individual Account”.&nbsp; DO NOT choose business account otherwise your application might not get approved.&nbsp; Once you’ve entered all your information simply submit the application for Google to review.&nbsp; Google might take up to one week to review the application but can reply in as little as a day.&nbsp; Please see the image below:<br><br><br><br><img src="uploads/post/paragraph-images/729861986290151.jpg" width="680"><br><br><br>Once Google has approved your account, log in and find your “Publisher ID” (located on the top right hand side of the page) so you can plug it into InkSmash and start getting paid.&nbsp; You can find this number on top as soon as you sign in.&nbsp; It will have “pub- and 16 digits.&nbsp; It will look like the following: pub-xxxxxxxxxxxxxx.&nbsp; When entering the Publisher ID in the earnings section on InkSmash make sure to enter the “pub-“ as well as all the digits.&nbsp; This does <u><b>NOT</b></u> allow us access to your account.&nbsp; We will <b><u>never</u></b> ask you for your Google AdSense password and you should never provide it to anyone.&nbsp; This code simply lets us display ads on InkSmash on your behalf.&nbsp; <br><br><br>That’s it.&nbsp; You’re ready to get paid.&nbsp; <br><br><b>note: until Google fully approves your account you may see some blank ad spaces on your posts.&nbsp; This is normal.&nbsp; Once your account is fully verified those blank spaces will be filled with Google ads.</b><br><br>', 0),
(106, 578, '0', 'If you already have an Amazon affiliate account all you need to do is plug in your account ID in the Earnings section of InkSmash.&nbsp; Your account ID is located on the top left hand side of the page when you login to your Amazon Associates account.&nbsp; It’s an 8 character code that usually ends in “-20”.&nbsp; Include the “-20” when providing the code to us.&nbsp; <br><br>If you don’t have one, signing up is very easy.&nbsp; <br><br>First go to the following link: https://affiliate-program.amazon.com/<br><br>On the top right click the button that says “Join Now for Free” and sign into your existing Amazon account or create one if you don’t already have one.&nbsp; <br><br><br><img src="uploads/post/paragraph-images/722429450786871.jpg" width="680"><br><br>After signing in, select the payee information of who you want the payments to go to and click the button at the bottom that says: “Next: Your Website Profile”.<br><br><br>You will then get to a page that looks like the following:<br><br><br><img src="uploads/post/paragraph-images/208802159233404.jpg" width="680"><br><br><br>Above we have numbered each field and will now show you how to answer each one.<br><br>1.&nbsp;&nbsp;&nbsp; The name of the website you should use: InkSmash<br><br>2.&nbsp;&nbsp;&nbsp; Make sure to enter your username in the url for example: www.inksmash.com/your_username Note: make sure the link you enter actually goes to your profile page.&nbsp; This is how Amazon will verify your account<br>.<br>3.&nbsp;&nbsp;&nbsp; “What your Website is about” – here you can write a brief description that this is a blogging and content sharing website that you will provide content to.&nbsp; <br><br>4.&nbsp;&nbsp;&nbsp; Select which topics best describe what you will write about or share on InkSmash.&nbsp; You may select more than one topic.<br><br>5.&nbsp;&nbsp;&nbsp; Select which categories will best describe your writings.&nbsp; You can select more than one category.<br><br>6.&nbsp;&nbsp;&nbsp; Select “content or niche website”<br><br>7.&nbsp;&nbsp;&nbsp; Select SEO<br><br>8.&nbsp;&nbsp;&nbsp; Select “Contextual Advertising e.g. Google AdSense”<br><br>9.&nbsp;&nbsp;&nbsp; Select “Content Management System”<br><br>10.&nbsp;&nbsp;&nbsp; If you are new to InkSmash select “less than 500”<br><br>11.&nbsp;&nbsp;&nbsp; Select “To monetize my site”<br><br>12.&nbsp;&nbsp;&nbsp; Select “Word of mouth”<br><br>13.&nbsp;&nbsp;&nbsp; Read the contract terms and check the box to agree<br><br>14.&nbsp;&nbsp;&nbsp; Enter the characters in the box to prove you are a human and click finish.<br><br><br>Once you hit finish you will get immediate access to the Amazon Affiliate site right away while they review your application.&nbsp; <br><br>When you log in you will see a Tracking ID at the top left of the screen.&nbsp; Enter that tracking ID as you see it in the Earnings section of InkSmash.&nbsp; See the image below for reference.&nbsp; Now you’re all set to get paid on referrals you send to Amazon.<br><br>The tracking code will look like the following:<br><br><img src="uploads/post/paragraph-images/77060948221493.jpg" width="200"><br><br>That''s all there is to it.&nbsp; Now you can create a post using the "Amazon Block" to link to some Amazon products.&nbsp; Each time you send them a customer that converts into a sale, you get paid!<br><br>Go for it, create your first post.&nbsp; It''s a lot of fun.&nbsp; <br><br>', 0),
(107, 586, '0', 'this article will show u how to build muscle<BR>', 0),
(108, 590, '0', 'I have been using the Apple TV MD199LL/A for about 2 months now and I have to say my initial reaction was that this device is outstanding for a mere $99.&nbsp; My reaction is still the same after 2 months of using it.&nbsp; They packed so much punch into this device for that price point that got me wondering why I''ve waited so long to get one of these babies.&nbsp; <br><br>First, like all Apple devices this one is super easy to use.&nbsp; You just have to plug in the power and the HDMI cable to your TV.&nbsp; You can also use an Ethernet cable for internet if it''s accessible, but here''s the great part; it''s wireless so you don''t have to go crazy running wires through walls they don''t belong.&nbsp; I use mine through wireless and have never had a problem.<br><br>After you''ve successfully hooked it up to your TV, just go through the settings menu and connect it to your iTunes.&nbsp; This literally is as easy as entering your iTunes username and password. &nbsp; <br><br>Now that you''re in you can watch all the movies, shows, music, or anything else you have stored on your iTunes straight to you TV (in 1080p as long as your TV and the content supports it).&nbsp; <br><br>It''s really easy to use and one of the best 100 buks I''ve ever spent.&nbsp; <br><br>One of the coolest features of all or at least my favorite:&nbsp; <u><b>AirPlay</b></u><br><br>If your an iPhone or Ipad lover like myself you''re going to love AirPlay through Apple TV.&nbsp; Airplay basically lets you play anything from your iPhone or iPad straight to your TV.&nbsp; So say you want to watch that funny video on youtube with your friends, but how annoying is it when 5 of you are trying to watch that video on a tiny iPhone screen?&nbsp; Not when you have airplay.&nbsp; Just airplay it straight to the TV.&nbsp; No wires or install necessary.<br><br>You have a photo gallery that you want to show the family on the iPhone or iPad, just airplay it right on the to TV.&nbsp; It''s so effortless and cool and the quality is super sharp. &nbsp;&nbsp; <br><br><b><br><br>Other Great Features include:</b><br><ul><li>Netflix</li><li>Youtube</li><li>flickr</li><li>Sports channels (subscribtion required) </li><li>Trailers</li></ul><br>&nbsp; <br><br><br>', 0),
(109, 600, '0', 'So tonight I went to see Charlie Murphy live at Levity Live in West Nyack located in the Palisades Mall.&nbsp; Charlie Murphy, "The Darkness!!!".&nbsp; This was my first time at Levity Live and I must say I was impressed.&nbsp; It was a pretty cool comedy club.&nbsp; The decor was cool, the setup was comfortable and trendy, and the service was ok.&nbsp; Tickets for the show were $27 each and a 2 item minimum so all in all it wasn''t too bad.&nbsp; They get some pretty decent names in there also so I would definitely go back.<br><br>Now to my man, the Darkness, Charlie Murphy.&nbsp; First off I have to say seeing him on "The Chappelle Show" and finding his characters absolutely hilarious, I think I had some high hopes.&nbsp; He was funny, and at times he was very funny, but it wasn''t the laugh your pants off, stop it or I can''t breathe anymore funny.&nbsp; I don''t want to give him a harsh review because it wasn''t that he wasn''t funny.&nbsp; It''s just that it wasn''t consistently funny. &nbsp; &nbsp;&nbsp; <br><br>Would I see him again?&nbsp; I don''t know, maybe.&nbsp; For $27 a ticket I guess you can''t really pass it up.&nbsp; I would, however, much rather see him back on the Chappelle show with Dave Chappelle.&nbsp; Bring it back!!!<br><br>All in all I say the show was average and the place was cool and I plan on going back.<br><br><br>', 0),
(110, 603, '0', '<p class="MsoNormal"><p class="MsoNormal"><b>Adults</b></p>\n\n<p class="MsoNormal">For adults who want to learn the guitar and are buying one\nfor the first time you have more options when it comes to instruments. Buying a\nmid-priced acoustic or electric guitar is the best choice for you because you’ll\nhave the income to pay for a better guitar. Adult hands are also able to handle\nmost acoustic and electric guitars with relative ease as compared to the\nsmaller hands of a child.&nbsp; There are many\ngreat electric and acoustic guitars between $300-$1000 dollars that are\nsuitable for beginner adults to learn on. Ask the music store about their selection\nand try out several guitars there in the shop to find one that’s comfortable. If\nyou have a friend or a family member that can play have them go with you to\nassist you in making your purchase. Be wary of store clerks as they will try to\nsell you an instrument that’s too expensive in which you don’t really need.\nJust remember that you’ll need an amplifier if you’re buying an electric\nguitar.</p></p>', 0),
(111, 605, '0', 'Looking to buy your first guitar? There are several things you need to keep in mind before you go and buy that first guitar. There are two main types of guitars and those are the acoustic guitar and the electric guitar. Here are some things to keep in mind before you buy one.\n', 0),
(112, 606, '0', '<p class="MsoNormal"><b>Acoustic Guitars</b></p>\n\n<p class="MsoNormal">The acoustic guitar is not the ideal choice for a beginner\nunless you get a nylon string acoustic and not a steel string. This is because\nthe strings on the acoustic guitar are harder to press down and form chords\nwith. As a guitar teacher I have found that many parents make the mistake of\nbuying their children aan acoustic guitar where the strings are just too hard\non their fingers. The ideal choice for an acoustic guitar which is easy for a\nbeginner to play is the nylon string because of how easy it is to press the\nstrings down.</p>\n\n<p class="MsoNormal">Nylon string acoustic guitars also come in smaller student\nsizes where it’s easy for a child to carry around the guitar. A child can’t\ncarry around a full dreadnaught acoustic because it’s simply too heavy and big\nfor them to hold let alone play. For a student beginner the best acoustic\nguitar is a nylon string guitar.</p>', 0),
(113, 607, '0', '<p class="MsoNormal"><b>Electric Guitars</b></p>\n\n<p class="MsoNormal">For younger children and especially teenagers the electric guitar\nis the ideal choice for a first instrument. For teenagers the electric guitar\nallows them to play all their favorite rock songs and it sounds great. It’s too\ndifficult to play rock on an acoustic guitar and this can just frustrate a\nteenager who wants to learn rock songs. If you have a teenager or a younger\nchild an electric guitar is the best choice for them. There are many low cost\nelectric guitar packages which come with an amplifier and some accessories that\nare perfect for younger beginners to use. Electric guitar companies such as\nFender and Gibson both make great starter electric guitar sets for younger\nplayers and these are great to buy if you’re a parent of a young music\nenthusiast.</p>', 0),
(114, 610, '0', '&lt;!--[if gte mso 9]>&lt;xml&gt;\n \n  \n \n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 9]>&lt;xml&gt;\n \n  Normal\n  0\n  \n  \n  \n  \n  false\n  false\n  false\n  \n  EN-US\n  X-NONE\n  X-NONE\n  \n   \n   \n   \n   \n   \n   \n   \n   \n   \n  \n  \n   \n   \n   \n   \n   \n   \n   \n   \n   \n   \n   \n  \n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 9]>&lt;xml&gt;\n \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n  \n \n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]>\n&lt;style&gt;\n /* Style Definitions */\n table.MsoNormalTable\n {mso-style-name:"Table Normal";\n mso-tstyle-rowband-size:0;\n mso-tstyle-colband-size:0;\n mso-style-noshow:yes;\n mso-style-priority:99;\n mso-style-parent:"";\n mso-padding-alt:0in 5.4pt 0in 5.4pt;\n mso-para-margin-top:0in;\n mso-para-margin-right:0in;\n mso-para-margin-bottom:10.0pt;\n mso-para-margin-left:0in;\n line-height:115%;\n mso-pagination:widow-orphan;\n font-size:11.0pt;\n font-family:"Calibri","sans-serif";\n mso-ascii-font-family:Calibri;\n mso-ascii-theme-font:minor-latin;\n mso-hansi-font-family:Calibri;\n mso-hansi-theme-font:minor-latin;}\n&lt;/style&gt;\n\n\n<p class="MsoNormal"  class="StyleArial">--&gt;', 0),
(115, 608, '0', '<p class="MsoNormal"><b>Online or Store</b></p>\n\n<p class="MsoNormal">You have the option of buying the guitar in a music store or\nonline. If you have never bought a guitar before, it’s a better idea to go to a\nmusic store and see what they have available in the shop. You can buy all the\naccessories there for the instrument and you don’t have to worry about paying\nonline shipping to have the gear delivered. When you go to the shop you can also\nenquire about music lessons for your young child. Most music stores offer some\ntype of music lesson or you can get instruction through a qualified music\nschool.</p>', 0),
(116, 612, '0', '<p class="MsoNormal"><b>Lessons</b></p>\n\n<p class="MsoNormal">After you buy your guitar you have the option of taking\nlessons. It’s really in your best interest to take guitar lessons as it’s the best\nway to start learning. While the Interne tis great you can pick up a lot of bad\nhabits from players who really shouldn’t be teaching online. Once you get the\nbasics down then you can teach with whatever method you want or continue with\nlessons.</p>', 0),
(117, 611, '0', '<p class="MsoNormal"><b>You Can Buy that\nFirst Guitar</b></p>\n\n<p class="MsoNormal">Buying a guitar is quite simple but for a beginner the electric\nis probably going to be easier for you or a child to play because the strings\nare easier to press down on. If you buy an acoustic guitar get a nylon string\nas these are easier on the hands. A full acoustic is still an option but it\nwill take more time to learn on.</p>', 0),
(118, 615, '0', '<p class="MsoNormal">Are you struggling on guitar or have you just bought your\nfirst one? The best thing you can do for your playing is to start taking guitar\nlessons. While there’s plenty of material on the Internet it’s also best to\ntake some lessons as a beginner.</p>', 0),
(119, 616, '0', '<p class="MsoNormal"><b>Learn the Basics</b></p>\n\n<p class="MsoNormal">A guitar teacher can start to teach you the basis of guitar\nplaying which so many just take for granted. This includes how to properly\npick, hold the guitar and how to play chords. The teacher is going to be able\nto help you with those basics that so many players end up struggling with. If\nyou don’t know how to chord properly or can’t play scales with the correct\nfingering then this is just going to hamper your progress on the guitar. A\nteacher will also help you overcome common hurdles on the guitar such as\nplaying barre chords and basic solos too.</p>', 0),
(120, 617, '0', '<p class="MsoNormal"><b>Confidence</b></p>\n\n<p class="MsoNormal">A guitar teacher will help you gain the confidence you need\nto succeed on the instrument. Not only will you gain confidence but you’ll\nlearn how to play songs in the correct way and learn how to become a complete\nmusician by coming up with your own material. Many beginner players simply lack\nthe confidence needed to learn properly on the guitar and a good guitar teacher\nwill help you with this. Not every guitar player will have confidence problems but\nmany do and a good teacher can help bring the music pout of the player and help\nthem player succeed.</p>', 0),
(121, 618, '0', '<p class="MsoNormal"><b>Performance</b></p>\n\n<p class="MsoNormal">Many guitar teachers will have student perform short pieces\nand sometimes even with a small audience. This gets the student used to performing\nin public and helps them gain even more confidence in their abilities. When you\nplay and practice with your teacher you’re already learning the basics about\nhow to play guitar with other people so this is another incentive to take\nlessons with a teacher.</p>', 0),
(122, 619, '0', '<p class="MsoNormal"><b>Timing</b></p>\n\n<p class="MsoNormal">A good teacher can work with the student on timing issues\nwhich is probably one of the single most difficult aspects of guitar playing. A\nsong isn’t a song unless the timing of the song is nailed down and done in the\ncorrect way. A teacher can help the student get this fundamental timing issue down.\nWithout proper timing the song isn’t going to be played properly and the person\nlearning guitar is going to feel frustrated.</p>', 0),
(123, 620, '0', '<p class="MsoNormal"><b>Bad Habits</b></p>\n\n<p class="MsoNormal">While you can learn on your own it’s often easier to pick up\nvery bad guitar playing habits which make learning music harder than it should\nbe. This can include incorrect scale fingerings, poor chord fingerings as well\nas just plain sloppy guitar playing habits. A good teacher will help you break\nout of those habits and make you a better overall player.</p>', 0),
(124, 622, '0', '<p class="MsoNormal"><b>Learn at a Faster\nRate</b></p>\n\n<p class="MsoNormal">A guitar teacher can help you learn at a faster rate than\nyou could on your own. You can pick up advanced guitar techniques and learn how\nto properly execute them when you have a good guitar there helping you.</p>', 0),
(125, 623, '0', '<p class="MsoNormal"><b>Makes Sense</b></p>\n\n<p class="MsoNormal">Taking lessons just makes good sense and you’ll become a better\noverall musician in a faster period of time. Take guitar lessons and see your\nmusicianship skyrocket in less time than if you tried to teach yourself the\nsame concepts.</p>', 0),
