(130, 637, '0', 'I tried Shake Shack for the very first time this a few days ago and as I did enjoy that little juicy delicious treat that came down from heaven I just don''t know if it was worth it all.&nbsp; The wait on the line was about 20 minutes, then we waited another 10 to get our food so that part wasn''t so great.<br><br>When we finally got to the line I order a Double Shack Burger and a Caramel Milk Shake.&nbsp; I figure since I''m there and since I don''t go too often I should go for what they''re known for.&nbsp; The burger was slightly undercooked but I didn''t really mind because it tasted really good.&nbsp; It was really juicy, the cheese was melted all over and the lettuce and tomato was very fresh.&nbsp; You can tell right off the bat that it was all fresh ingredients used which obviously makes a huge difference.&nbsp; <br>&nbsp; &nbsp; <br>', 0),
(131, 639, '0', '<b><u>DIRECTIONS</u></b><b><u><br></u></b><b><u><br></u></b>1) Preheat oven to 350 degrees F<br><br>2) Bake potatoes for 1 hour in oven, or for 8 minutes on high in the microwave (your call)<br><br>3) Meanwhile, cut the prosciutto into small pieces<br><br>4) Once cooked, let the potatoes cool down for about 5 minutes. Once cooled, cut the potatoes in half&nbsp;length&nbsp;wise and scoop out the flesh; leaving a small amount of flesh attached to the skin. Place flesh within a mixing bowl.<br><br>5) To the flesh add the heavy cream, butter, sour cream, cut prosciutto, salt, pepper, and 2/3 of the shredded cheese. Mix with a mixer until smooth. Scoop the mixture back into the potato skins and top them off with the remainder of the 1/3 shredded cheese.&nbsp;<br><br>6) Place the potatoes back in the oven and cook for an additional 15 minutes (this step can not be done via microwave)<br><br>ENJOY<br><br><br><br>', 0),
(132, 641, '0', 'HI', 0),
(133, 643, '0', '<b><u>DIRECTIONS</u></b><b><u><br></u></b>1) Preheat oven to 425 degrees F<br>2) Slice the avocado in half and take out the bit. Depending on size of avocado, take out some additional avocado flesh to make room for the eggs.<br>3) In a mixing bowl;&nbsp;whisk&nbsp;salt and pepper in with the eggs.<br>4) Place the avocados into a backing dish&nbsp;tightly&nbsp;together so that they do not fall over.&nbsp;<br>5) Pour the egg mixture into the two avocado halfs<br>6) Back in oven for 20 minutes.<br><br>Optional<br>7) After 15 minutes add the diced tomatoes on top of the avocado and cook for the remaining 5 minutes.&nbsp;<br><br>ENJOY<br><br><br><br>', 0),
(134, 646, '0', '<b><u>DIRECTIONS</u></b><b><u><br></u></b><b><u><br></u></b>1) Cut a triangular opening into each of the jumbo olives from top to bottom. This does not have to be perfect and it is okay if the triangle goes all the way from top to bottom or&nbsp;resembles&nbsp;more of a slit.<br><br>2) Carfully inseart about 1 teaspon of cream cheese into the slit and smooth out the edges to ensure the cream cheese is only within the triangular slit.<br><br>3) Cute the carrot into about 1/4 inch thick slices. Cut a triangular piece out of the carrot to form the feet.<br><br>4) Save the cut out piece of carrot and insert it into the small olives to form a beak. You may want to trim this piece down even more if beak&nbsp;appears&nbsp;too big.<br><br>5) Set the jumbo olive, hole on&nbsp;bottom,&nbsp;on top&nbsp;of a carrot slice. Then place the small olive on top of the jumbo olive ensuring that the carrot piece in the small olive (beak), the cream cheese of the jumbo olive (belly) and the opening of the carrot slice (feet) all line up. Secure with a toothpick!<br><br>ENJOY<br>', 0),
