(138, 660, '0', 'Confession of a shopaholic.… being so good at shopping that I get money back!<br><br><br>I do not know about you, but I could shop online all day, every day. I get a kick out of comparing prices and searching to see where I can find the best deal. Obviously my bank account is not always happy about my addiction so I had to come up with tricks to justify my fix of shopping. Nothing beats the feeling of submitting an order where you know that you got a great deal after searching for hours… nothing but ONE thing.<br><br><br>Once that submit button is hit, you anxiously wait to have your order arrive in the mail. Well I not only wait for my order to arrive, but wait for my check to arrive for doing the actual shopping. Getting money back in the mail a few weeks later after shopping online will give any shopaholic a fix that lasts weeks!<br><br><br>Whereas I would love to say that I know some magical special tricks, the truth is I am simply savvy when it comes to online affiliate programs that give you a percentage of your payment back for using them. The biggest and best known example is probably Ebates ( http://www.ebates.com/rf.do?referrerid=Oyb1SD4sCQ%HSKFgbIAXFg==). It could not be easier!<br><br><br>Simply register for it on the site. Every time you want to do a little online shopping go to Ebates first and select your store via their link. Shop as normal (you can even still use coupons) and a percentage of what you spend is sent back to you via a check a few weeks later. It is as easy as that. No tricks, no smoking doors and no contracts. Each store pays back a different percentage, however if you are about to buy something online, why not get money back even if it is only 1%. There is no extra work for you.Ebates works with all major stores, Amazon, Macy’s, Sephora, Bloomingdales, Nordstrom, shoes.com, even travel sites and many many more. Cash back is anywhere from 1% to 10%. It’s a win win.<br><br><br>Try it out… HAPPY SHOPPING!!', 0),
(139, 662, '0', '', 0),
(140, 668, '0', 'So the food experience was good over all but I couldn''t help but wonder \nwas the line all about the hype or was it really about the food.&nbsp; Are \npeople waiting on this long line because it is really the best burger in\nNew York or is that just the perception?&nbsp; I think it''s a little of \nboth.&nbsp; For me, it was just the fact that I wanted to try it since so \nmany people have told me how great it is.&nbsp; So now that I have \nexperienced it, will I go back again?&nbsp; Maybe.&nbsp; Maybe if the line is not \nso long. &nbsp; &nbsp; <br><br>In my opinion you can get an equally great burger at Five Guys for a few bucks less.&nbsp; Again that''s just my opinion and I still think that''s the best fast food burger joint around.&nbsp; <br><br>It''s still worth trying out Shake Shack.&nbsp; Since there is so much hype around it, it''s just one of those things you have to experience for yourself.&nbsp; Maybe that''s why so many people were there. &nbsp; <br><br>', 0),
(141, 666, '0', 'For the "do it yourself"&nbsp; ("diy") homeowner, painting is just one of those tedious tasks that could take days, even weeks.&nbsp; For me its definitely weeks being that I tend to be a perfectionist especially when it comes to tasks I take on as a self proclaimed handyman.&nbsp; Painting is fun in the beginning.&nbsp; A few sloppy coats of primer followed by a more precise coat or two of the carefully selected color and you see your project taking shape.&nbsp; Then comes the sometimes annoying and time consuming task of cutting corners, painting trim, and doors.&nbsp; Painting doors is the absolute thorn in my side when it comes to painting a home.&nbsp; After patching up any imperfections and the time comes to start painting, the dreaded "one side at a time" routine begins. Bust out those not so stable saw horses,&nbsp; paint one side, let it dry, apply another coat, then FLIP!&nbsp; Besides taking forever and thinking theres no way to properly do both sides at once, I always cause some sort of imperfection or marring of the dry, freshly painted side when laying it on the saw horse (padded or not) in order to get to the unpainted side.&nbsp; I cant paint a door thats hung, its just too easy to cause a mess or have a subpar finish.<br><br>I stumbled upon a tip from a pro when searching for a specific brand of professional painting tools. I wish I could claim the tip as mine since its so simple yet absolutely genius.&nbsp; All it takes is (3) 1/4" x 3" lag screws!&nbsp; Thats about what, ummm 15 cents?&nbsp; Picture the top edge of your door as one line.&nbsp; Lets call the top left corner "1", the right corner "2".&nbsp; Now for the bottom edge, lets call right smack in the middle "3" .&nbsp; Using a drill, drill a small pilot hole about 2 inches in from the edges for "1" and "2".&nbsp; Drilling a pilot hole will prevent splitting the wood when driving the lag screws in, not to mention time, money, and the use of multiple four letter words.&nbsp; Do the same for "3".&nbsp; Now drive the lag screws in and you got yourself a pivot point ("3") and two handles ( "1" and "2").&nbsp; <br><br>The lag screws will keep the door secure and stable on the saw horses while allowing you to rotate the door using the two handles to get to the other side.&nbsp; The wet paint surface doesnt touch anything and now you are able to paint two sides at once!&nbsp; This just cut your paint time in HALF!&nbsp; Dont be afraid to ask a buddy, neighbor, or significant other to prop the door up and/or rotate it.&nbsp; Doors especially the old school solid wood door weigh a ton.<br><br>I hope this tip was as helpful to you as it was for me.&nbsp; Best of luck with your home improvement projects!<br><br><br>', 0),
(142, 672, '0', '<img alt="golf ball" src="http://images.search.yahoo.com/images/view;_ylt=A0PDoKonUBVQyE8Aqu6JzbkF;_ylu=X3oDMTBlMTQ4cGxyBHNlYwNzcgRzbGsDaW1n?back=http://images.search.yahoo.com/search/images?p=golf+ball&fr=chr-greentree_ff&fr2=piv-web&tab=organic&ri=1&w=1280&h=1024&imgurl=www.psdgraphics.com/file/white-golf-ball.jpg&rurl=http://explow.com/golf_ball&size=112+KB&name=Golf+ball+-+white+golf+ball&p=golf+ball&oid=3862337266eb7048fe9bcc65e7e77ee7&fr2=piv-web&fr=chr-greentree_ff&tt=Golf+ball+-+white+golf+ball&b=0&ni=21&no=1&ts=&tab=organic&sigr=10ro0rbgd&sigb=139qhudkd&sigi=11c1qcu5c&.crumb=L5516r4NOVv" align="none"><br>', 0),
(144, 703, '0', 'It seems that wherever I go, I somehow manage to whip out a coupon at the checkout line.&nbsp; My friends are amazed every time we go shopping together and have asked me for my secrets.&nbsp; Well here they are!<br><br>It isn’t difficult being a couponer.&nbsp; There are a few things you need to do before you start seeing those savings and payback of all your hard work.<br><br>First… start looking through your junk mail and any store ads/flyers that wind up in your mailbox.&nbsp; You’ll be surprised how many coupons you get in the mail.&nbsp; If you’re not on the list of your favorite stores, sign up online or in store for their home mailing list.&nbsp; <br><br>Check out those VAL PACK’s that come in the mail.&nbsp; You may be surprised to find your favorite restaurant in there offering 20% off your meal.&nbsp; <br><br>The next stop on your coupon search, are the weekend newspapers.&nbsp; Most newspapers put up coupons with the most savings closer to the weekend.&nbsp; I’d recommend going to a store and checking out a few different papers and the kinds of coupons they offer before subscribing to one.&nbsp; You may find one paper that has better or more desirable coupons than another.<br><br>The final stage in accumulation, buying coupons!&nbsp; I know, I know, the whole point of couponing is saving money, but sometimes, buying a coupon for something you will be purchasing is worth it in the end.&nbsp; My favorite place for buying coupons? EBAY.&nbsp; Do your math and make sure purchasing a coupon is worth it.<br><br>Now that you’ve started accumulating coupons, what to do with them?&nbsp; Your purse must look like a garbage pale with all the clip outs you have going on in there.&nbsp; My suggestion, purchase a little accordion folder to stock all your coupons.&nbsp; You can pick this up in your local Target or Wal-mart for $1-$2.&nbsp; The key is to stay organized. You can put all your coupons in categories (like food or clothing) or by store names.&nbsp; It’s your call.&nbsp; Just make sure to go through your folder at least once a month to throw out those expired coupons.&nbsp; Shopping will be much easier if you don’t hold up the checkout line rummaging through your valid and expired coupons.<br><br>And that’s all!&nbsp; Not crazy at all.&nbsp; I promise, after you’ve started couponing, you will wonder how you ever lived without it.<br><br>', 0),
(145, 714, '0', '<b><u>DIRECTIONS:</u></b><b><u><br></u></b><b><u><br></u></b>Preheat your oven to 450 degrees F.<br>Mix cheese, milk, and baking mix until you have a smooth dough like mixture. Form dough into tablespoon size balls and place on a greased backing sheet.&nbsp;<br>Bake for 8 to 10 minutes or until golden brown.<br>Mix the butter and garlic powder together in the meantime. Brush mixture over warm biscuits prior to&nbsp;removing&nbsp;from baking sheet. Serve warm.<br><br>ENJOY!', 0),
(146, 717, '0', '<u><b>DIRECTIONS:</b></u><br><br>Start with the sauce by heating 2 tsp of the oil in a saucepan. Add in the ginger and garlic followed quickly by the soy sauce and water (you do not want the garlic to burn). Once warm, dissolve the brown sugar in the sauce, then turn up the heat and boil the sauce until it thickens (about 2 minutes). Remove from heat.<br><br>Cut the flank steak into about 1/4 inch think bite size slices. Dip each piece into the cornstarch to apply a thin dusting to all sides of each piece. &nbsp;Let the beef sit for a little so the cornstarch can stick.&nbsp;\n<br><br>Heat up a cup of oil in a wok or skillet. Add the beef to the oil and saute for about a minute until the beef just starts to darken on all sides. Once cooked remove the meat from the oil.&nbsp;<br><br>Now mix the lightly cooked meat and the sauce together in a clean wok or skillet. Cooke for about 2 minutes and add the green onions. Cook for another minute then remove the onions and the beef with tongs and plate. Extra sauce should be left in pan unless you want to add it ontop.<br><br>ENJOY', 0),
